import java.util.ArrayList;
import java.util.List;
import java.util.PriorityQueue;

public class Solution {
    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        // Build adjacency list for the original graph
        List<int[]>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] e : edges) {
            int u = e[0], v = e[1], cnt = e[2];
            int weight = cnt + 1; // distance between u and v in the subdivided graph
            graph[u].add(new int[]{v, weight});
            graph[v].add(new int[]{u, weight});
        }

        // Dijkstra's algorithm to find shortest distances from node 0
        long[] dist = new long[n];
        final long INF = Long.MAX_VALUE / 4;
        for (int i = 0; i < n; i++) dist[i] = INF;
        dist[0] = 0;
        PriorityQueue<long[]> pq = new PriorityQueue<>((a, b) -> Long.compare(a[0], b[0]));
        pq.offer(new long[]{0L, 0L});

        while (!pq.isEmpty()) {
            long[] cur = pq.poll();
            long d = cur[0];
            int u = (int) cur[1];
            if (d != dist[u]) continue;
            for (int[] nb : graph[u]) {
                int v = nb[0];
                int w = nb[1];
                long nd = d + w;
                if (nd < dist[v]) {
                    dist[v] = nd;
                    pq.offer(new long[]{nd, v});
                }
            }
        }

        // Count reachable original nodes
        long reachableOriginal = 0;
        for (int i = 0; i < n; i++) {
            if (dist[i] <= maxMoves) reachableOriginal++;
        }

        // Count reachable subdivided nodes
        long reachableSubdivided = 0;
        for (int[] e : edges) {
            int u = e[0], v = e[1], cnt = e[2];
            long left = Math.max(0L, maxMoves - dist[u]);
            long right = Math.max(0L, maxMoves - dist[v]);
            long reachableOnEdge = Math.min(cnt, left + right);
            reachableSubdivided += reachableOnEdge;
        }

        return (int) (reachableOriginal + reachableSubdivided);
    }
}

