public class Solution {
    public int robotSim(int[] commands, int[][] obstacles) {
        // Directions: 0=East, 1=North, 2=West, 3=South
        int[] dx = {1, 0, -1, 0};
        int[] dy = {0, 1, 0, -1};

        Set<Long> obstacleSet = new HashSet<>();
        for (int[] obs : obstacles) {
            long key = ((long)obs[0] << 32) ^ (obs[1] & 0xffffffffL);
            obstacleSet.add(key);
        }

        int x = 0, y = 0, dir = 1; // start facing north
        int maxDistSq = 0;

        for (int cmd : commands) {
            if (cmd == -2) { // turn left
                dir = (dir + 3) % 4;
            } else if (cmd == -1) { // turn right
                dir = (dir + 1) % 4;
            } else { // move forward cmd steps
                for (int step = 0; step < cmd; step++) {
                    int nx = x + dx[dir];
                    int ny = y + dy[dir];
                    long key = ((long)nx << 32) ^ (ny & 0xffffffffL);
                    if (obstacleSet.contains(key)) {
                        break; // stop moving for this command
                    }
                    x = nx;
                    y = ny;
                    int distSq = x * x + y * y;
                    if (distSq > maxDistSq) {
                        maxDistSq = distSq;
                    }
                }
            }
        }

        return maxDistSq;
    }
}

