import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class Solution {
    private int n;
    private int[][] grid;
    private int[] dirs = {0, 1, 0, -1, 0};

    public int largestIsland(int[][] grid) {
        this.n = grid.length;
        this.grid = grid;
        Map<Integer, Integer> sizeMap = new HashMap<>();
        int id = 2; // start labeling from 2 to distinguish from 0 and 1

        // Label each island with a unique id and record its size
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int sz = dfs(i, j, id);
                    sizeMap.put(id, sz);
                    id++;
                }
            }
        }

        // If the whole grid is already an island
        if (sizeMap.isEmpty()) {
            return 1; // flipping any 0 to 1
        }
        int maxIsland = 0;
        for (int sz : sizeMap.values()) {
            if (sz > maxIsland) maxIsland = sz;
        }

        // Try flipping each 0 to 1 and compute potential island size
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    Set<Integer> neighborIds = new HashSet<>();
                    for (int d = 0; d < 4; d++) {
                        int ni = i + dirs[d];
                        int nj = j + dirs[d + 1];
                        if (ni >= 0 && ni < n && nj >= 0 && nj < n) {
                            int nid = grid[ni][nj];
                            if (nid > 1) {
                                neighborIds.add(nid);
                            }
                        }
                    }
                    int newSize = 1; // the flipped cell itself
                    for (int nid : neighborIds) {
                        newSize += sizeMap.get(nid);
                    }
                    if (newSize > maxIsland) {
                        maxIsland = newSize;
                    }
                }
            }
        }

        return maxIsland;
    }

    private int dfs(int i, int j, int id) {
        if (i < 0 || i >= n || j < 0 || j >= n || grid[i][j] != 1) {
            return 0;
        }
        grid[i][j] = id;
        int size = 1;
        for (int d = 0; d < 4; d++) {
            size += dfs(i + dirs[d], j + dirs[d + 1], id);
        }
        return size;
    }
}

