public class Solution {
    public int[] shortestToChar(String s, char c) {
        int n = s.length();
        int[] ans = new int[n];
        int prev = -1;
        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == c) {
                prev = i;
            }
            if (prev != -1) {
                ans[i] = i - prev;
            } else {
                ans[i] = Integer.MAX_VALUE;
            }
        }
        int next = -1;
        for (int i = n - 1; i >= 0; i--) {
            if (s.charAt(i) == c) {
                next = i;
            }
            if (next != -1) {
                ans[i] = Math.min(ans[i], next - i);
            }
        }
        return ans;
    }
}

