public class Solution {
    public int maxDistToClosest(int[] seats) {
        int last = -1;
        int maxDist = 0;
        int n = seats.length;
        for (int i = 0; i < n; i++) {
            if (seats[i] == 1) {
                if (last == -1) {
                    maxDist = i; // distance from start to first person
                } else {
                    maxDist = Math.max(maxDist, (i - last) / 2);
                }
                last = i;
            }
        }
        // distance from last person to end
        maxDist = Math.max(maxDist, n - 1 - last);
        return maxDist;
    }
}

