import java.util.HashSet;

public class Solution {
    public int[] fairCandySwap(int[] aliceSizes, int[] bobSizes) {
        int sumA = 0, sumB = 0;
        for (int a : aliceSizes) sumA += a;
        for (int b : bobSizes) sumB += b;

        int diff = sumA - sumB;
        // We need to find a pair (a, b) such that a - b = diff / 2
        int target = diff / 2;

        HashSet<Integer> bobSet = new HashSet<>();
        for (int b : bobSizes) bobSet.add(b);

        for (int a : aliceSizes) {
            int bNeeded = a - target;
            if (bobSet.contains(bNeeded)) {
                return new int[]{a, bNeeded};
            }
        }
        // According to problem statement, an answer always exists
        return new int[0];
    }
}

