import java.util.Arrays;

public class Solution {
    public double soupServings(int n) {
        if (n > 4800) return 1.0; // for large n the probability is effectively 1
        int m = (n + 24) / 25; // ceil division by 25
        double[][] memo = new double[m + 1][m + 1];
        for (int i = 0; i <= m; i++) Arrays.fill(memo[i], -1.0);
        return dfs(m, m, memo);
    }

    private double dfs(int a, int b, double[][] memo) {
        if (a <= 0 && b <= 0) return 0.5; // both empty simultaneously
        if (a <= 0) return 1.0;           // A empty first
        if (b <= 0) return 0.0;           // B empty first
        if (memo[a][b] >= 0) return memo[a][b];

        double res = 0.25 * (
                dfs(a - 4, b) +
                dfs(a - 3, b - 1) +
                dfs(a - 2, b - 2) +
                dfs(a - 1, b - 3)
        );
        memo[a][b] = res;
        return res;
    }
}

