public class Solution {
    public double new21Game(int n, int k, int w) {
        if (k == 0 || n < k) return 1.0;
        double[] dp = new double[n + 1];
        for (int i = 0; i < k; i++) dp[i] = 1.0;
        double windowSum = 0.0;
        for (int i = k - 1; i >= 0; i--) {
            windowSum += dp[i + 1];
            if (i + w + 1 <= n) windowSum -= dp[i + w + 1];
            dp[i] = windowSum / w;
        }
        return dp[0];
    }
}

