import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<String> ambiguousCoordinates(String s) {
        List<String> result = new ArrayList<>();
        String inner = s.substring(1, s.length() - 1);
        int n = inner.length();
        for (int i = 1; i < n; i++) {
            String leftPart = inner.substring(0, i);
            String rightPart = inner.substring(i);
            List<String> leftNums = generateNumbers(leftPart);
            List<String> rightNums = generateNumbers(rightPart);
            for (String l : leftNums) {
                for (String r : rightNums) {
                    result.add("(" + l + ", " + r + ")");
                }
            }
        }
        return result;
    }

    private List<String> generateNumbers(String part) {
        List<String> nums = new ArrayList<>();
        int len = part.length();
        if (len == 1) {
            nums.add(part);
            return nums;
        }
        // If part starts with '0', only possible is "0.xxx"
        if (part.charAt(0) == '0') {
            String fractional = part.substring(1);
            if (fractional.charAt(fractional.length() - 1) != '0') {
                nums.add("0." + fractional);
            }
            return nums;
        }
        // No leading zero
        // Integer form
        nums.add(part);
        // Decimal forms
        for (int i = 1; i < len; i++) {
            String intPart = part.substring(0, i);
            String fracPart = part.substring(i);
            if (fracPart.charAt(fracPart.length() - 1) != '0') {
                nums.add(intPart + "." + fracPart);
            }
        }
        return nums;
    }
}

