                g[r][c] = 0;
            }
        }

        // Directions
        int[][] dirs = {{-1,0},{1,0},{0,-1},{0,1}};

        // Union all bricks that are still present
        for (int r = 0; r < m; r++) {
            for (int c = 0; c < n; c++) {
                if (g[r][c] == 1) {
                    int id = r * n + c;
                    if (r == 0) {
                        union(parent, size, id, virtualTop);
                    }
                    for (int[] d : dirs) {
                        int nr = r + d[0], nc = c + d[1];
                        if (nr >= 0 && nr < m && nc >= 0 && nc < n && g[nr][nc] == 1) {
                            union(parent, size, id, nr * n + nc);
                        }
                    }
                }
            }
        }

        int[] res = new int[hits.length];
        // Process hits in reverse
        for (int i = hits.length - 1; i >= 0; i--) {
            int r = hits[i][0], c = hits[i][1];
            if (grid[r][c] == 0) {
                // No brick originally
                res[i] = 0;
                continue;
            }
            int before = size[find(parent, virtualTop)];
            // Restore brick
            g[r][c] = 1;
            int id = r * n + c;
            if (r == 0) {
                union(parent, size, id, virtualTop);
            }
            for (int[] d : dirs) {
                int nr = r + d[0], nc = c + d[1];
                if (nr >= 0 && nr < m && nc >= 0 && nc < n && g[nr][nc] == 1) {
                    union(parent, size, id, nr * n + nc);
                }
            }
            int after = size[find(parent, virtualTop)];
            int fallen = Math.max(0, after - before - 1);
            res[i] = fallen;
        }
        return res;
    }

    private int find(int[] parent, int x) {
        if (parent[x] != x) {
            parent[x] = find(parent, parent[x]);
        }
        return parent[x];
    }

    private void union(int[] parent, int[] size, int a, int b) {
        int pa = find(parent, a);
        int pb = find(parent, b);
        if (pa == pb) return;
        if (size[pa] < size[pb]) {
            int tmp = pa; pa = pb; pb = tmp;
        }
        parent[pb] = pa;
        size[pa] += size[pb];
    }
}

