import java.util.Arrays;
import java.util.Comparator;

public class Solution {
    private static class Op {
        int idx;
        String src;
        String tgt;
        Op(int idx, String src, String tgt) {
            this.idx = idx;
            this.src = src;
            this.tgt = tgt;
        }
    }

    public String findReplaceString(String s, int[] indices, String[] sources, String[] targets) {
        int k = indices.length;
        Op[] ops = new Op[k];
        for (int i = 0; i < k; i++) {
            ops[i] = new Op(indices[i], sources[i], targets[i]);
        }
        Arrays.sort(ops, Comparator.comparingInt(o -> o.idx));

        StringBuilder sb = new StringBuilder();
        int pos = 0;
        for (Op op : ops) {
            if (pos < op.idx) {
                sb.append(s, pos, op.idx);
                pos = op.idx;
            }
            if (s.startsWith(op.src, op.idx)) {
                sb.append(op.tgt);
                pos = op.idx + op.src.length();
            } else {
                sb.append(s, op.idx, op.idx + op.src.length());
                pos = op.idx + op.src.length();
            }
        }
        if (pos < s.length()) {
            sb.append(s, pos, s.length());
        }
        return sb.toString();
    }
}

