public class Solution {
    public int surfaceArea(int[][] grid) {
        int n = grid.length;
        int area = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int h = grid[i][j];
                if (h > 0) {
                    area += 4 * h + 2; // top, bottom, and sides
                    if (i > 0) area -= 2 * Math.min(h, grid[i - 1][j]); // subtract shared faces with top neighbor
                    if (j > 0) area -= 2 * Math.min(h, grid[i][j - 1]); // subtract shared faces with left neighbor
                }
            }
        }
        return area;
    }
}

