import java.util.ArrayList;
import java.util.List;

public class Solution {
    public int[][] spiralMatrixIII(int rows, int cols, int y, int x) {
        int total = rows * cols;
        List<int[]> result = new ArrayList<>(total);
        // Directions: east, south, west, north
        int[] dr = {0, 1, 0, -1};
        int[] dc = {1, 0, -1, 0};

        int r = y, c = x;
        result.add(new int[]{r, c});

        int step = 1; // number of steps in current leg
        while (result.size() < total) {
            for (int dir = 0; dir < 4; dir++) {
                for (int i = 0; i < step; i++) {
                    if (result.size() >= total) break;
                    r += dr[dir];
                    c += dc[dir];
                    if (r >= 0 && r < rows && c >= 0 && c < cols) {
                        result.add(new int[]{r, c});
                    }
                }
                // After moving east and south (dir 1) or west and north (dir 3), increase step
                if (dir % 2 == 1) {
                    step++;
                }
            }
        }

        int[][] ans = new int[total][2];
        for (int i = 0; i < total; i++) {
            ans[i] = result.get(i);
        }
        return ans;
    }
}

