import java.util.PriorityQueue;

public class Solution {
    public int minRefuelStops(int target, int startFuel, int[][] stations) {
        // Max-heap to store fuels of stations we have passed
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>((a, b) -> b - a);
        int stops = 0;
        int currentFuel = startFuel;
        int i = 0;
        int n = stations.length;

        while (currentFuel < target) {
            // Add all stations that are reachable with current fuel
            while (i < n && stations[i][0] <= currentFuel) {
                maxHeap.offer(stations[i][1]);
                i++;
            }

            // If we cannot reach the target and no station to refuel from
            if (maxHeap.isEmpty()) {
                return -1;
            }

            // Refuel at the station with the most fuel
            currentFuel += maxHeap.poll();
            stops++;
        }

        return stops;
    }
}

