public class Solution {
    public int projectionArea(int[][] grid) {
        if (grid == null || grid.length == 0) return 0;
        int n = grid.length;
        int xy = 0; // top view
        int yz = 0; // front view
        int zx = 0; // side view

        // Compute xy projection: count non-zero cells
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 0) xy++;
            }
        }

        // Compute yz projection: max per column
        for (int j = 0; j < n; j++) {
            int max = 0;
            for (int i = 0; i < n; i++) {
                if (grid[i][j] > max) max = grid[i][j];
            }
            yz += max;
        }

        // Compute zx projection: max per row
        for (int i = 0; i < n; i++) {
            int max = 0;
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > max) max = grid[i][j];
            }
            zx += max;
        }

        return xy + yz + zx;
    }
}

