public class Solution {
    public int maxIncreaseKeepingSkyline(int[][] grid) {
        int n = grid.length;
        int[] rowMax = new int[n];
        int[] colMax = new int[n];

        // Compute maximum height for each row and column
        for (int r = 0; r < n; r++) {
            for (int c = 0; c < n; c++) {
                int val = grid[r][c];
                if (val > rowMax[r]) rowMax[r] = val;
                if (val > colMax[c]) colMax[c] = val;
            }
        }

        // Calculate the total possible increase
        int totalIncrease = 0;
        for (int r = 0; r < n; r++) {
            for (int c = 0; c < n; c++) {
                int allowed = Math.min(rowMax[r], colMax[c]);
                if (allowed > grid[r][c]) {
                    totalIncrease += allowed - grid[r][c];
                }
            }
        }

        return totalIncrease;
    }
}

