import com_github_leetcode.TreeNode;
import java.util.LinkedList;
import java.util.List;
import java.util.Stack;

public class Solution {
    public TreeNode increasingBST(final TreeNode root) {
        if (root == null) {
            return null;
        }

        // In-order traversal to collect nodes in ascending order
        List<TreeNode> nodes = new LinkedList<>();
        Stack<TreeNode> stack = new Stack<>();
        TreeNode curr = root;

        while (curr != null || !stack.isEmpty()) {
            while (curr != null) {
                stack.push(curr);
                curr = curr.left;
            }
            curr = stack.pop();
            nodes.add(curr);
            curr = curr.right;
        }

        // Rebuild the tree with only right children
        TreeNode dummy = new TreeNode(0);
        TreeNode prev = dummy;
        for (TreeNode node : nodes) {
            node.left = null;
            node.right = null; // will be set in next iteration
            prev.right = node;
            prev = node;
        }

        return dummy.right;
    }
}

