public class Solution {
    public int expressiveWords(String s, String[] words) {
        int count = 0;
        for (String w : words) {
            if (isStretchy(s, w)) {
                count++;
            }
        }
        return count;
    }

    private boolean isStretchy(String s, String w) {
        int i = 0, j = 0;
        int n = s.length(), m = w.length();

        while (i < n && j < m) {
            if (s.charAt(i) != w.charAt(j)) {
                return false;
            }

            int iStart = i;
            while (i < n && s.charAt(i) == s.charAt(iStart)) i++;
            int sLen = i - iStart;

            int jStart = j;
            while (j < m && w.charAt(j) == w.charAt(jStart)) j++;
            int wLen = j - jStart;

            if (sLen < 3) {
                if (sLen != wLen) return false;
            } else {
                if (sLen < wLen) return false;
                if (sLen < 3) return false; // redundant but explicit
            }
        }

        return i == n && j == m;
    }
}

