import java.util.*;

public class Solution {
    public int primePalindrome(int n) {
        if (n <= 2) return 2;
        if (n <= 3) return 3;
        if (n <= 5) return 5;
        if (n <= 7) return 7;
        if (n <= 11) return 11;

        // Generate palindromes of odd length only (except 11)
        for (int len = String.valueOf(n).length(); len <= 8; len++) {
            if (len == 2) continue; // even length > 2 are divisible by 11
            if (len % 2 == 0) continue; // skip even lengths

            int halfLen = (len + 1) / 2;
            int start = (int)Math.pow(10, halfLen - 1);
            int end = (int)Math.pow(10, halfLen) - 1;

            for (int half = start; half <= end; half++) {
                int pal = buildPalindrome(half);
                if (pal >= n && isPrime(pal)) {
                    return pal;
                }
            }
        }
        // In case no palindrome found within 8 digits, return 100030001 (known next prime palindrome)
        return 100030001;
    }

    private int buildPalindrome(int half) {
        int pal = half;
        int temp = half / 10; // skip middle digit for odd length
        while (temp > 0) {
            pal = pal * 10 + (temp % 10);
            temp /= 10;
        }
        return pal;
    }

    private boolean isPrime(int num) {
        if (num < 2) return false;
        if (num == 2) return true;
        if (num % 2 == 0) return false;
        int sqrt = (int)Math.sqrt(num);
        for (int i = 3; i <= sqrt; i += 2) {
            if (num % i == 0) return false;
        }
        return true;
    }
}

