public class Solution {
    public int minSwap(int[] listA, int[] listB) {
        int n = listA.length;
        if (n == 0) return 0;

        int[] keep = new int[n];
        int[] swap = new int[n];

        keep[0] = 0;   // no swap at first position
        swap[0] = 1;   // swap at first position

        for (int i = 1; i < n; i++) {
            keep[i] = Integer.MAX_VALUE;
            swap[i] = Integer.MAX_VALUE;

            // Condition 1: both sequences are increasing without swapping at i
            if (listA[i - 1] < listA[i] && listB[i - 1] < listB[i]) {
                keep[i] = Math.min(keep[i], keep[i - 1]);          // keep from previous keep
                swap[i] = Math.min(swap[i], swap[i - 1] + 1);      // keep from previous swap
            }

            // Condition 2: sequences are increasing if we swap at i
            if (listA[i - 1] < listB[i] && listB[i - 1] < listA[i]) {
                keep[i] = Math.min(keep[i], swap[i - 1]);          // keep from previous swap
                swap[i] = Math.min(swap[i], keep[i - 1] + 1);      // swap from previous keep
            }
        }

        return Math.min(keep[n - 1], swap[n - 1]);
    }
}

