import java.util.Comparator;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int rectangleArea(int[][] rectangles) {
        int n = rectangles.length;
        // Collect all y coordinates
        int[] ys = new int[2 * n];
        for (int i = 0; i < n; i++) {
            ys[2 * i] = rectangles[i][1];
            ys[2 * i + 1] = rectangles[i][3];
        }
        Arrays.sort(ys);
        int m = 0;
        for (int i = 0; i < ys.length; i++) {
            if (i == 0 || ys[i] != ys[i - 1]) {
                ys[m++] = ys[i];
            }
        }
        ys = Arrays.copyOf(ys, m);

        // Build events
        class Event {
            int x, y1, y2, delta;
            Event(int x, int y1, int y2, int delta) {
                this.x = x;
                this.y1 = y1;
                this.y2 = y2;
                this.delta = delta;
            }
        }
        List<Event> events = new ArrayList<>(2 * n);
        for (int[] rect : rectangles) {
            int x1 = rect[0], y1 = rect[1], x2 = rect[2], y2 = rect[3];
            events.add(new Event(x1, y1, y2, 1));
            events.add(new Event(x2, y1, y2, -1));
        }
        events.sort(Comparator.comparingInt(e -> e.x));

        // Segment tree
        int size = m - 1; // number of leaf intervals
        int[] count = new int[4 * size];
        long[] length = new long[4 * size];

        // Helper to update
        java.util.function.BiConsumer<Integer, Integer> update = new java.util.function.BiConsumer<Integer, Integer>() {
            @Override
            public void accept(Integer node, Integer l) {
                // placeholder
            }
        };
        // We'll implement recursive method inside
        class SegTree {
            void update(int node, int l, int r, int ql, int qr, int delta) {
                if (qr < l || r < ql) return;
                if (ql <= l && r <= qr) {
                    count[node] += delta;
                } else {
                    int mid = (l + r) >> 1;
                    update(node << 1, l, mid, ql, qr, delta);
                    update(node << 1 | 1, mid + 1, r, ql, qr, delta);
                }
                if (count[node] > 0) {
                    length[node] = (long) ys[r + 1] - ys[l];
                } else {
                    if (l == r) {
                        length[node] = 0;
                    } else {
                        length[node] = length[node << 1] + length[node << 1 | 1];
                    }
                }
            }
        }
        SegTree seg = new SegTree();

        long area = 0;
        int prevX = events.get(0).x;
        for (Event e : events) {
            int curX = e.x;
            long dx = (long) curX - prevX;
            area = (area + dx * seg.length[1]) % MOD;
            int y1Idx = Arrays.binarySearch(ys, e.y1);
            int y2Idx = Arrays.binarySearch(ys, e.y2);
            // update over [y1Idx, y2Idx-1]
            seg.update(1, 0, size - 1, y1Idx, y2Idx - 1, e.delta);
            prevX = curX;
        }
        return (int) area;
    }
}

