import java.util.ArrayList;
import java.util.List;

public class Solution {
    public int[] sumOfDistancesInTree(int n, int[][] edges) {
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) graph[i] = new ArrayList<>();
        for (int[] e : edges) {
            graph[e[0]].add(e[1]);
            graph[e[1]].add(e[0]);
        }

        int[] count = new int[n];   // number of nodes in subtree rooted at i (including i)
        int[] dp = new int[n];      // sum of distances from i to nodes in its subtree
        int[] ans = new int[n];

        dfs1(0, -1, graph, count, dp);
        dfs2(0, -1, graph, count, dp, ans, n);

        return ans;
    }

    private void dfs1(int node, int parent, List<Integer>[] graph, int[] count, int[] dp) {
        count[node] = 1;
        for (int nei : graph[node]) {
            if (nei == parent) continue;
            dfs1(nei, node, graph, count, dp);
            count[node] += count[nei];
            dp[node] += dp[nei] + count[nei];
        }
    }

    private void dfs2(int node, int parent, List<Integer>[] graph, int[] count, int[] dp, int[] ans, int n) {
        ans[node] = dp[node];
        for (int nei : graph[node]) {
            if (nei == parent) continue;
            // move root from node to nei
            int origNodeDp = dp[node];
            int origNeiDp = dp[nei];

            // update dp for node and nei temporarily
            dp[node] -= dp[nei] + count[nei];
            count[node] -= count[nei];
            dp[nei] += dp[node] + count[node];
            count[nei] += count[node];

            dfs2(nei, node, graph, count, dp, ans, n);

            // restore original values
            dp[nei] = origNeiDp;
            count[nei] = count[nei] - count[node];
            dp[node] = origNodeDp;
            count[node] = count[node] + count[nei];
        }
    }
}

