public class Solution {
    public int largestOverlap(int[][] img1, int[][] img2) {
        int n = img1.length;
        List<int[]> ones1 = new ArrayList<>();
        List<int[]> ones2 = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (img1[i][j] == 1) ones1.add(new int[]{i, j});
                if (img2[i][j] == 1) ones2.add(new int[]{i, j});
            }
        }

        if (ones1.isEmpty() || ones2.isEmpty()) return 0;

        int size = 2 * n - 1;
        int offset = n - 1;
        int[] count = new int[size * size];
        int maxOverlap = 0;

        for (int[] p1 : ones1) {
            for (int[] p2 : ones2) {
                int dx = p2[0] - p1[0];
                int dy = p2[1] - p1[1];
                int key = (dx + offset) * size + (dy + offset);
                int newCount = ++count[key];
                if (newCount > maxOverlap) maxOverlap = newCount;
            }
        }

        return maxOverlap;
    }
}

