public class Solution {
    public String shiftingLetters(String s, int[][] shifts) {
        int n = s.length();
        int[] diff = new int[n + 1];
        for (int[] shift : shifts) {
            int start = shift[0];
            int end = shift[1];
            int direction = shift[2];
            int delta = direction == 1 ? 1 : -1;
            diff[start] += delta;
            if (end + 1 < n) {
                diff[end + 1] -= delta;
            }
