        char[] chars = s.toCharArray();
        int currentShift = 0;
        for (int i = 0; i < n; i++) {
            currentShift += diff[i];
            int net = currentShift % 26;
            if (net < 0) {
                net += 26;
            }
            int original = chars[i] - 'a';
            int shifted = (original + net) % 26;
            chars[i] = (char) ('a' + shifted);
        }
        return new String(chars);
    }
}

