        int[][] gcd = new int[MAX_VAL + 1][MAX_VAL + 1];
        for (int i = 1; i <= MAX_VAL; i++) {
            for (int j = 1; j <= MAX_VAL; j++) {
                gcd[i][j] = gcd(i, j);
            }
        }

        // dp[prev1][prev2] where prev1 is last value, prev2 is second last
        long[][] dp = new long[MAX_VAL + 1][MAX_VAL + 1];
        // Initialize for position 1
        for (int v = 1; v <= MAX_VAL; v++) {
            dp[v][0] = 1;
        }

        for (int pos = 2; pos <= n; pos++) {
            long[][] next = new long[MAX_VAL + 1][MAX_VAL + 1];
            for (int prev1 = 1; prev1 <= MAX_VAL; prev1++) {
                for (int prev2 = 0; prev2 <= MAX_VAL; prev2++) {
                    long cur = dp[prev1][prev2];
                    if (cur == 0) continue;
                    for (int v = 1; v <= MAX_VAL; v++) {
                        if (v == prev1 || v == prev2) continue; // distance constraint
                        if (prev1 != 0 && gcd[prev1][v] != 1) continue; // adjacency gcd
                        next[v][prev1] = (next[v][prev1] + cur) % MOD;
                    }
                }
            }
            dp = next;
        }

        long ans = 0;
        for (int prev1 = 1; prev1 <= MAX_VAL; prev1++) {
            for (int prev2 = 0; prev2 <= MAX_VAL; prev2++) {
                ans = (ans + dp[prev1][prev2]) % MOD;
            }
        }
        return (int) ans;
    }

    private int gcd(int a, int b) {
        while (b != 0) {
            int t = a % b;
            a = b;
            b = t;
        }
        return a;
    }
}

