public class Solution {
    public long taskSchedulerII(int[] tasks, int space) {
        Map<Integer, Long> lastDay = new HashMap<>();
        long day = 0;
        for (int type : tasks) {
            long earliest = day;
            if (lastDay.containsKey(type)) {
                long nextAllowed = lastDay.get(type) + space + 1;
                if (nextAllowed > earliest) {
                    earliest = nextAllowed;
                }
            }
            // Perform the task on 'earliest' day
            lastDay.put(type, earliest);
            // Move to the next day after performing
            day = earliest + 1;
        }
