                for (int k = 0; k < n; k++) {
                    int prevVal = grid[i - 1][k];
                    long cost = dp[i - 1][k] + moveCost[prevVal][j];
                    if (cost < best) {
                        best = cost;
                    }
                }
                dp[i][j] = best + grid[i][j];
            }
        }

        // Find minimum in last row
        long answer = Long.MAX_VALUE;
        for (int j = 0; j < n; j++) {
            if (dp[m - 1][j] < answer) {
                answer = dp[m - 1][j];
            }
        }
        return (int) answer;
    }
}

