import java.util.*;

public class Solution {
    public long countPairs(int n, int[][] edges) {
        int[] parent = new int[n];
        int[] sz = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
            sz[i] = 1;
        }

        // Union-Find functions
        java.util.function.IntUnaryOperator find = new java.util.function.IntUnaryOperator() {
            @Override
            public int applyAsInt(int x) {
                int root = x;
                while (parent[root] != root) {
                    root = parent[root];
                }
                // Path compression
                while (parent[x] != x) {
                    int next = parent[x];
                    parent[x] = root;
                    x = next;
                }
                return root;
            }
        };

        for (int[] e : edges) {
            int a = e[0];
            int b = e[1];
            int ra = find.applyAsInt(a);
            int rb = find.applyAsInt(b);
            if (ra != rb) {
                // Union by size
                if (sz[ra] < sz[rb]) {
                    int tmp = ra;
                    ra = rb;
                    rb = tmp;
                }
                parent[rb] = ra;
                sz[ra] += sz[rb];
            }
        }

        long totalPairs = (long) n * (n - 1) / 2;
        long connectedPairs = 0;
        for (int i = 0; i < n; i++) {
            if (parent[i] == i) {
                long s = sz[i];
                connectedPairs += s * (s - 1) / 2;
            }
        }
        return totalPairs - connectedPairs;
    }
}

