import java.util.Deque;
import java.util.ArrayDeque;

public class Solution {
    public int maximumRobots(int[] chargeTimes, int[] runningCosts, long budget) {
        int n = chargeTimes.length;
        Deque<Integer> maxDeque = new ArrayDeque<>();
        long sum = 0;
        int left = 0;
        int maxLen = 0;

        for (int right = 0; right < n; right++) {
            // add new element to sum
            sum += runningCosts[right];

            // maintain deque for maximum chargeTime
            while (!maxDeque.isEmpty() && chargeTimes[maxDeque.peekLast()] <= chargeTimes[right]) {
                maxDeque.pollLast();
            }
            maxDeque.offerLast(right);

            // shrink window while cost exceeds budget
            while (left <= right) {
                int k = right - left + 1;
                int maxCharge = chargeTimes[maxDeque.peekFirst()];
                long remaining = budget - maxCharge;
                if (remaining < 0 || sum > remaining / k) {
                    // remove leftmost element
                    if (maxDeque.peekFirst() == left) {
                        maxDeque.pollFirst();
                    }
                    sum -= runningCosts[left];
                    left++;
                } else {
                    break;
                }
            }

            // update maximum length
            maxLen = Math.max(maxLen, right - left + 1);
        }

        return maxLen;
    }
}

