public class Solution {
    public int closestMeetingNode(int[] edges, int node1, int node2) {
        int n = edges.length;
        int[] dist1 = new int[n];
        int[] dist2 = new int[n];
        for (int i = 0; i < n; i++) {
            dist1[i] = -1;
            dist2[i] = -1;
        }

        // Compute distances from node1
        int cur = node1;
        int d = 0;
        while (cur != -1 && dist1[cur] == -1) {
            dist1[cur] = d;
            cur = edges[cur];
            d++;
        }

        // Compute distances from node2
        cur = node2;
        d = 0;
        while (cur != -1 && dist2[cur] == -1) {
            dist2[cur] = d;
            cur = edges[cur];
            d++;
        }

        int best = Integer.MAX_VALUE;
        int answer = -1;
        for (int i = 0; i < n; i++) {
            if (dist1[i] != -1 && dist2[i] != -1) {
                int maxDist = Math.max(dist1[i], dist2[i]);
                if (maxDist < best || (maxDist == best && i < answer)) {
                    best = maxDist;
                    answer = i;
                }
            }
        }
        return answer;
    }
