public class Solution {
    public boolean matchReplacement(String s, String sub, char[][] mappings) {
        if (sub == null || s == null) return false;
        int n = s.length();
        int m = sub.length();
        if (m == 0 || n < m) return false;

        // Build mapping from old char to set of possible new chars
        Map<Character, Set<Character>> map = new HashMap<>();
        for (char[] pair : mappings) {
            if (pair.length != 2) continue;
            char old = pair[0];
            char newC = pair[1];
            map.computeIfAbsent(old, k -> new HashSet<>()).add(newC);
        }

        // Precompute allowed sets for each position in sub
        Set<Character>[] allowed = new Set[m];
        for (int i = 0; i < m; i++) {
            char c = sub.charAt(i);
            Set<Character> set = new HashSet<>();
            set.add(c); // identity
            Set<Character> mapped = map.get(c);
            if (mapped != null) set.addAll(mapped);
            allowed[i] = set;
        }

        // Sliding window over s
        for (int start = 0; start <= n - m; start++) {
            boolean ok = true;
            for (int j = 0; j < m; j++) {
                char sc = s.charAt(start + j);
                if (!allowed[j].contains(sc)) {
                    ok = false;
                    break;
                }
            }
            if (ok) return true;
        }
        return false;
    }
}

