public class Solution {
    public int peopleAwareOfSecret(int n, int delay, int forget) {
        final int MOD = 1_000_000_007;
        if (n == 1) return 1;
        int[] dp = new int[n + 2];
        dp[1] = 1;
        long total = 1;
        Queue<Integer> window = new ArrayDeque<>();
        long shareWindowSum = 0;
        // Initialize window with day 1's discoverers
        window.add(dp[1]);
        shareWindowSum = dp[1];
        for (int day = 2; day <= n; day++) {
            int newPeople = (int) (shareWindowSum % MOD);
            dp[day] = newPeople;
            total = (total + newPeople) % MOD;
            // Update window for future sharing
            window.add(dp[day]);
            shareWindowSum = (shareWindowSum + dp[day]) % MOD;
            if (window.size() > delay) {
                int removed = window.poll();
                shareWindowSum = (shareWindowSum - removed + MOD) % MOD;
            }
            // Subtract people who forget today
            if (day - forget >= 1) {
                int forgetPeople = dp[day - forget];
                total = (total - forgetPeople + MOD) % MOD;
            }
        }
        return (int) total;
    }
}

