public class Solution {
    public int shortestSequence(int[] rolls, int k) {
        int n = rolls.length;
        // nextAfter[pos][v] = smallest index > pos where rolls[index] == v
        // pos ranges 0..n-1, and pos = n represents the start state (-1)
        int[][] nextAfter = new int[n + 1][k + 1];
        for (int i = 0; i <= n; i++) {
            Arrays.fill(nextAfter[i], -1);
        }

        int[] nextPos = new int[k + 1];
        Arrays.fill(nextPos, -1);

        // Build nextAfter for positions 0..n-1
        for (int pos = n - 1; pos >= 0; pos--) {
            for (int v = 1; v <= k; v++) {
                nextAfter[pos][v] = nextPos[v];
            }
            nextPos[rolls[pos]] = pos;
        }

        // first occurrence for start state
        for (int v = 1; v <= k; v++) {
            nextAfter[n][v] = nextPos[v];
        }

        int[] dp = new int[n + 1];
        // Compute dp for positions n-1 down to 0
        for (int pos = n - 1; pos >= 0; pos--) {
            int minChild = Integer.MAX_VALUE;
            for (int v = 1; v <= k; v++) {
                int q = nextAfter[pos][v];
                if (q == -1) {
                    minChild = 0;
                    break;
                } else {
                    if (dp[q] < minChild) {
                        minChild = dp[q];
                    }
                }
            }
            dp[pos] = 1 + minChild;
        }

        // Compute dp for start state (pos = n)
        int minChild = Integer.MAX_VALUE;
        for (int v = 1; v <= k; v++) {
            int q = nextAfter[n][v];
            if (q == -1) {
                minChild = 0;
                break;
            } else {
                if (dp[q] < minChild) {
                    minChild = dp[q];
                }
            }
        }
        dp[n] = 1 + minChild;

        return dp[n] + 1;
    }
}

