import java.util.Arrays;

public class Solution {
    public int distributeCookies(int[] c, int k) {
        Arrays.sort(c);
        // sort in descending order for better pruning
        for (int i = 0, j = c.length - 1; i < j; i++, j--) {
            int tmp = c[i];
            c[i] = c[j];
            c[j] = tmp;
        }

        int[] sums = new int[k];
        int best = Integer.MAX_VALUE;

        dfs(0, c, sums, bestHolder -> best = bestHolder);

        return best;
    }

    private void dfs(int idx, int[] c, int[] sums, java.util.function.IntConsumer bestConsumer) {
        if (idx == c.length) {
            int max = 0;
            for (int s : sums) {
                if (s > max) max = s;
            }
            bestConsumer.accept(max);
            return;
        }

        int val = c[idx];
        for (int i = 0; i < sums.length; i++) {
            // skip duplicate sums to avoid symmetric states
            if (i > 0 && sums[i] == sums[i - 1]) continue;
            if (sums[i] + val >= bestConsumer.getClass().getDeclaredField("best").getInt(null)) continue; // prune

            sums[i] += val;
            dfs(idx + 1, c, sums, bestConsumer);
            sums[i] -= val;
        }
    }
}

