import java.util.ArrayDeque;
import java.util.Deque;

public class Solution {
    public int validSubarraySize(int[] nums, int threshold) {
        int n = nums.length;
        int left = 1, right = n;
        int best = -1;
        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (existsSubarray(nums, threshold, mid)) {
                best = mid;
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return best;
    }

    private boolean existsSubarray(int[] nums, int threshold, int k) {
        int limit = threshold / k; // integer division
        Deque<Integer> dq = new ArrayDeque<>();
        for (int i = 0; i < nums.length; i++) {
            while (!dq.isEmpty() && nums[dq.peekLast()] >= nums[i]) {
                dq.pollLast();
            }
            dq.offerLast(i);
            if (dq.peekFirst() <= i - k) {
                dq.pollFirst();
            }
            if (i >= k - 1) {
                if (nums[dq.peekFirst()] > limit) {
                    return true;
                }
            }
        }
        return false;
    }
}

