import java.util.Arrays;
import java.util.Comparator;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int countIncreasingPaths(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int[][] dp = new int[m][n];

        // Prepare cells array: [i, j, value]
        int total = m * n;
        int[][] cells = new int[total][3];
        int idx = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                cells[idx][0] = i;
                cells[idx][1] = j;
                cells[idx][2] = grid[i][j];
                idx++;
            }
        }

        // Sort cells by value descending
        Arrays.sort(cells, new Comparator<int[]>() {
            @Override
            public int compare(int[] a, int[] b) {
                return Integer.compare(b[2], a[2]); // descending
            }
        });

        int[] dirs = {-1, 0, 1, 0, -1};

        for (int[] cell : cells) {
            int i = cell[0];
            int j = cell[1];
            int val = cell[2];
            long sum = 1; // path consisting of the cell itself
            for (int d = 0; d < 4; d++) {
                int ni = i + dirs[d];
                int nj = j + dirs[d + 1];
                if (ni >= 0 && ni < m && nj >= 0 && nj < n && grid[ni][nj] > val) {
                    sum += dp[ni][nj];
                    if (sum >= MOD) sum -= MOD;
                }
            }
            dp[i][j] = (int) sum;
        }

        long ans = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                ans += dp[i][j];
                if (ans >= MOD) ans -= MOD;
            }
        }
        return (int) ans;
    }
}

