import java.util.HashMap;
import java.util.Map;

public class Solution {
    // number n as an array, splitted by each digit
    public int countSpecialNumbers(int n) {
        String s = Integer.toString(n);
        int len = s.length();
        Map<Long, Long> memo = new HashMap<>();
        return (int) dfs(0, 0, true, false, s, memo);
    }

    private long dfs(int pos, int mask, boolean tight, boolean started, String s, Map<Long, Long> memo) {
        if (pos == s.length()) {
            return started ? 1 : 0;
        }
        long key = (((((long) pos) << 32) | mask) << 1) | (tight ? 1 : 0);
        key = (key << 1) | (started ? 1 : 0);
        if (!tight && memo.containsKey(key)) {
            return memo.get(key);
        }
        int limit = tight ? s.charAt(pos) - '0' : 9;
        long res = 0;
        for (int d = 0; d <= limit; d++) {
            boolean nextStarted = started || d != 0;
            boolean nextTight = tight && (d == limit);
            if (nextStarted) {
                if ((mask & (1 << d)) != 0) continue; // digit already used
                res += dfs(pos + 1, mask | (1 << d), nextTight, nextStarted, s, memo);
            } else {
                res += dfs(pos + 1, mask, nextTight, nextStarted, s, memo);
            }
        }
        if (!tight) {
            memo.put(key, res);
        }
        return res;
    }
}

