public class Solution {
    public long countSubarrays(int[] nums, long k) {
        if (k <= 0) return 0L;
        int n = nums.length;
        long count = 0L;
        int left = 0, right = 0;
        long sum = 0L;
        int len = 0;

        while (left < n) {
            while (right < n) {
                long newSum = sum + nums[right];
                int newLen = len + 1;
                long threshold = k / newLen;
                if (newSum < threshold) {
                    sum = newSum;
                    len = newLen;
                    right++;
                } else {
                    break;
                }
            }
            count += (right - left);
            if (left < right) {
                sum -= nums[left];
                len--;
            } else {
                right++;
            }
            left++;
        }
        return count;
    }
}

