import java.util.ArrayList;
import java.util.List;

public class Solution {
    private int[] parent;
    private int[] depth;
    private int[] tin;
    private int[] tout;
    private int[] xorSub;
    private int timer;

    public int minimumScore(int[] nums, int[][] edges) {
        int n = nums.length;
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] e : edges) {
            int a = e[0], b = e[1];
            graph[a].add(b);
            graph[b].add(a);
        }

        parent = new int[n];
        depth = new int[n];
        tin = new int[n];
        tout = new int[n];
        xorSub = new int[n];
        timer = 0;

        dfs(0, -1, nums, graph);

        int totalXor = xorSub[0];
        int minScore = Integer.MAX_VALUE;

        for (int i = 1; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                int a = xorSub[i];
                int b = xorSub[j];
                int comp1, comp2, comp3;

                if (isAncestor(i, j)) {
                    // i is ancestor of j
                    comp1 = b;
                    comp3 = totalXor ^ xorSub[i];
                    comp2 = xorSub[i] ^ xorSub[j];
                } else if (isAncestor(j, i)) {
                    // j is ancestor of i
                    comp1 = a;
                    comp3 = totalXor ^ xorSub[j];
                    comp2 = xorSub[i] ^ xorSub[j];
                } else {
                    // no ancestor relationship
                    comp1 = a;
                    comp2 = b;
                    comp3 = totalXor ^ xorSub[i] ^ xorSub[j];
                }

                int max = Math.max(comp1, Math.max(comp2, comp3));
                int min = Math.min(comp1, Math.min(comp2, comp3));
                int score = max - min;
                if (score < minScore) {
                    minScore = score;
                }
            }
        }

        return minScore;
    }

    private void dfs(int node, int par, int[] nums, List<Integer>[] graph) {
        parent[node] = par;
        tin[node] = timer++;
        xorSub[node] = nums[node];
        for (int nbr : graph[node]) {
            if (nbr == par) continue;
            depth[nbr] = depth[node] + 1;
            dfs(nbr, node, nums, graph);
            xorSub[node] ^= xorSub[nbr];
        }
        tout[node] = timer++;
    }

    private boolean isAncestor(int u, int v) {
        return tin[u] <= tin[v] && tout[v] <= tout[u];
    }
}

