import java.util.*;

public class Solution {
    public int[] maximumSegmentSum(int[] nums, int[] removeQueries) {
        int n = nums.length;
        int[] ans = new int[n];
        DSU dsu = new DSU(n);
        boolean[] active = new boolean[n];
        long maxSum = 0;
        for (int i = n - 1; i >= 0; i--) {
            int idx = removeQueries[i];
            active[idx] = true;
            dsu.add(idx, nums[idx]);
            if (idx - 1 >= 0 && active[idx - 1]) dsu.union(idx, idx - 1);
            if (idx + 1 < n && active[idx + 1]) dsu.union(idx, idx + 1);
            maxSum = Math.max(maxSum, dsu.getSum(idx));
            ans[i] = (int) maxSum;
        }
        return ans;
    }

    private static class DSU {
        private final int[] parent;
        private final int[] size;
        private final long[] sum;

        DSU(int n) {
            parent = new int[n];
            size = new int[n];
            sum = new long[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
                sum[i] = 0;
            }
        }

        int find(int x) {
            if (parent[x] != x) parent[x] = find(parent[x]);
            return parent[x];
        }

        void add(int x, int val) {
            sum[x] = val;
        }

        void union(int a, int b) {
            int ra = find(a);
            int rb = find(b);
            if (ra == rb) return;
            if (size[ra] < size[rb]) {
                int tmp = ra;
                ra = rb;
                rb = tmp;
            }
            parent[rb] = ra;
            size[ra] += size[rb];
            sum[ra] += sum[rb];
        }

        long getSum(int x) {
            return sum[find(x)];
        }
    }
}

