public class Solution {
    public String largestPalindromic(String num) {
        int[] count = new int[10];
        for (char c : num.toCharArray()) {
            count[c - '0']++;
        }

        StringBuilder leftHalf = new StringBuilder();

        // Build left half using digits 9 to 1
        for (int d = 9; d >= 1; d--) {
            int pairs = count[d] / 2;
            for (int i = 0; i < pairs; i++) {
                leftHalf.append((char) ('0' + d));
            }
            count[d] -= pairs * 2;
        }

        // If left half is not empty, we can add zero pairs after non-zero digits
        if (leftHalf.length() > 0) {
            int zeroPairs = count[0] / 2;
            for (int i = 0; i < zeroPairs; i++) {
                leftHalf.append('0');
            }
            count[0] -= zeroPairs * 2;
        }

        // Find middle digit (highest remaining digit)
        int middleDigit = -1;
        for (int d = 9; d >= 0; d--) {
            if (count[d] > 0) {
                middleDigit = d;
                break;
            }
        }

        // If left half is empty, we cannot use leading zeros
        if (leftHalf.length() == 0) {
            if (middleDigit != -1) {
                return String.valueOf((char) ('0' + middleDigit));
            } else {
                return "0";
            }
        }

        // Build palindrome
        StringBuilder rightHalf = new StringBuilder(leftHalf).reverse();
        StringBuilder result = new StringBuilder();
        result.append(leftHalf);
        if (middleDigit != -1) {
            result.append((char) ('0' + middleDigit));
        }
        result.append(rightHalf);
        return result.toString();
    }
}

