import java.util.*;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int idealArrays(int n, int maxValue) {
        // Precompute factorials up to n + 20 (enough for all needed combinations)
        int limit = n + 20;
        long[] fact = new long[limit + 1];
        long[] invFact = new long[limit + 1];
        fact[0] = 1;
        for (int i = 1; i <= limit; i++) {
            fact[i] = fact[i - 1] * i % MOD;
        }
        invFact[limit] = modPow(fact[limit], MOD - 2);
        for (int i = limit; i > 0; i--) {
            invFact[i - 1] = invFact[i] * i % MOD;
        }

        // Smallest prime factor sieve
        int[] spf = new int[maxValue + 1];
        for (int i = 2; i <= maxValue; i++) {
            if (spf[i] == 0) {
                spf[i] = i;
                if ((long) i * i <= maxValue) {
                    for (int j = i * i; j <= maxValue; j += i) {
                        if (spf[j] == 0) spf[j] = i;
                    }
                }
            }
        }

        long answer = 0;
        for (int v = 1; v <= maxValue; v++) {
            int temp = v;
            long ways = 1;
            while (temp > 1) {
                int p = spf[temp];
                int e = 0;
                while (temp % p == 0) {
                    temp /= p;
                    e++;
                }
                long comb = comb(e + n - 1, n - 1, fact, invFact);
                ways = ways * comb % MOD;
            }
            answer += ways;
            if (answer >= MOD) answer -= MOD;
        }
        return (int) answer;
    }

    private long comb(int n, int k, long[] fact, long[] invFact) {
        if (k < 0 || k > n) return 0;
        return fact[n] * invFact[k] % MOD * invFact[n - k] % MOD;
    }

    private long modPow(long a, long e) {
        long res = 1;
        while (e > 0) {
            if ((e & 1) == 1) res = res * a % MOD;
            a = a * a % MOD;
            e >>= 1;
        }
        return res;
    }
}

