public class Solution {
    public int longestCycle(int[] edges) {
        int n = edges.length;
        int[] state = new int[n]; // 0 = unvisited, 1 = visiting, 2 = visited
        int[] depth = new int[n];
        int maxLen = -1;

        for (int i = 0; i < n; i++) {
            if (state[i] != 0) continue;

            int current = i;
            int step = 0;
            // Traverse until we hit a visited node or no outgoing edge
            while (current != -1 && state[current] == 0) {
                state[current] = 1;
                depth[current] = step++;
                current = edges[current];
            }

            // If we found a cycle
            if (current != -1 && state[current] == 1) {
                int cycleLen = step - depth[current];
                if (cycleLen > maxLen) {
                    maxLen = cycleLen;
                }
            }

            // Mark all nodes in the current path as visited
            current = i;
            while (current != -1 && state[current] == 1) {
                state[current] = 2;
                current = edges[current];
            }
        }

        return maxLen;
    }
}

