        boolean three = false;
        boolean pair = false;
        for (int count : rankCount.values()) {
            if (count == 3) {
                three = true;
            } else if (count == 2) {
                pair = true;
            }
        }

        if (three) {
            return "Three of a Kind";
        }
        if (pair) {
            return "Pair";
        }
        return "High Card";
    }
}

