import java.util.*;

public class Solution {
    public long minSumSquareDiff(int[] nums1, int[] nums2, int k1, int k2) {
        int n = nums1.length;
        int[] diff = new int[n];
        int maxDiff = 0;
        for (int i = 0; i < n; i++) {
            diff[i] = Math.abs(nums1[i] - nums2[i]);
            if (diff[i] > maxDiff) maxDiff = diff[i];
        }

        int[] freq = new int[maxDiff + 1];
        for (int d : diff) freq[d]++;

        long k = (long) k1 + k2;
        for (int d = maxDiff; d > 0 && k > 0; d--) {
            int cnt = freq[d];
            if (cnt == 0) continue;
            if (k >= cnt) {
                freq[d - 1] += cnt;
                k -= cnt;
                freq[d] = 0;
            } else {
                freq[d - 1] += (int) k;
                freq[d] -= (int) k;
                k = 0;
            }
        }

        long sum = 0;
        for (int d = 0; d <= maxDiff; d++) {
            if (freq[d] != 0) {
                sum += (long) d * d * freq[d];
            }
        }
        return sum;
    }
}

