import java.util.*;

public class Solution {
    public int maximumRows(int[][] matrix, int numSelect) {
        int m = matrix.length;
        if (m == 0) return 0;
        int n = matrix[0].length;
        if (numSelect > n) numSelect = n;

        Map<Integer, Integer> freq = new HashMap<>();
        for (int[] row : matrix) {
            int mask = 0;
            for (int j = 0; j < n; j++) {
                if (row[j] == 1) {
                    mask |= (1 << j);
                }
            }
            if (Integer.bitCount(mask) <= numSelect) {
                freq.merge(mask, 1, Integer::sum);
            }
        }

        int maxCovered = 0;
        int totalSubsets = 1 << n;
        for (int subset = 0; subset < totalSubsets; subset++) {
            if (Integer.bitCount(subset) != numSelect) continue;
            int covered = 0;
            for (Map.Entry<Integer, Integer> entry : freq.entrySet()) {
                int rowMask = entry.getKey();
                if ((rowMask & subset) == rowMask) {
                    covered += entry.getValue();
                }
            }
            if (covered > maxCovered) {
                maxCovered = covered;
            }
        }
        return maxCovered;
    }
}

