import java.util.HashMap;
import java.util.Map;

public class Solution {
    public long sellingWood(int m, int n, int[][] prices) {
        long[][] dp = new long[m + 1][n + 1];
        Map<Long, Long> priceMap = new HashMap<>();

        // Store prices in a map with key = h * 1000 + w (assuming h,w <= 1000)
        for (int[] p : prices) {
            int h = p[0];
            int w = p[1];
            long key = ((long) h << 32) | (w & 0xffffffffL);
            priceMap.put(key, (long) p[2]);
        }

        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                long key = ((long) i << 32) | (j & 0xffffffffL);
                dp[i][j] = priceMap.getOrDefault(key, 0L);

                // Horizontal cuts
                for (int k = 1; k < i; k++) {
                    long val = dp[k][j] + dp[i - k][j];
                    if (val > dp[i][j]) dp[i][j] = val;
                }

                // Vertical cuts
                for (int k = 1; k < j; k++) {
                    long val = dp[i][k] + dp[i][j - k];
                    if (val > dp[i][j]) dp[i][j] = val;
                }
            }
        }

        return dp[m][n];
    }
}

