import java.util.ArrayDeque;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.Queue;

public class Solution {
    public int[][] buildMatrix(int k, int[][] rowC, int[][] colC) {
        int[] rowOrder = topoSort(k, rowC);
        if (rowOrder == null) return new int[0][0];
        int[] colOrder = topoSort(k, colC);
        if (colOrder == null) return new int[0][0];

        int[][] matrix = new int[k][k];
        for (int num = 1; num <= k; num++) {
            int r = rowOrder[num];
            int c = colOrder[num];
            matrix[r][c] = num;
        }
        return matrix;
    }

    private int[] topoSort(int k, int[][] conditions) {
        ArrayList<Integer>[] graph = new ArrayList[k + 1];
        for (int i = 1; i <= k; i++) graph[i] = new ArrayList<>();
        int[] indegree = new int[k + 1];

        for (int[] cond : conditions) {
            int a = cond[0];
            int b = cond[1];
            graph[a].add(b);
            indegree[b]++;
        }

        Queue<Integer> q = new ArrayDeque<>();
        for (int i = 1; i <= k; i++) {
            if (indegree[i] == 0) q.offer(i);
        }

        int[] order = new int[k + 1];
        int idx = 0;
        while (!q.isEmpty()) {
            int u = q.poll();
            order[u] = idx++;
            for (int v : graph[u]) {
                if (--indegree[v] == 0) q.offer(v);
            }
        }

        if (idx != k) return null; // cycle detected
        return order;
    }
}

