public class Solution {
    public int[] smallestTrimmedNumbers(String[] nums, int[][] queries) {
        int n = nums.length;
        int m = queries.length;
        int maxTrim = 0;
        for (int[] q : queries) {
            if (q[1] > maxTrim) {
                maxTrim = q[1];
            }
        }

        int[][] sortedIndices = new int[maxTrim][n];

        for (int trim = 1; trim <= maxTrim; trim++) {
            final int t = trim;
            int[] idx = new int[n];
            for (int i = 0; i < n; i++) {
                idx[i] = i;
            }
            Arrays.sort(idx, new Comparator<Integer>() {
                @Override
                public int compare(Integer a, Integer b) {
                    String sa = nums[a].substring(nums[a].length() - t);
                    String sb = nums[b].substring(nums[b].length() - t);
                    int cmp = sa.compareTo(sb);
                    if (cmp != 0) {
                        return cmp;
                    }
                    return Integer.compare(a, b);
                }
            });
            sortedIndices[trim - 1] = idx.clone();
        }

        int[] answer = new int[m];
        for (int i = 0; i < m; i++) {
            int k = queries[i][0];
            int trim = queries[i][1];
            answer[i] = sortedIndices[trim - 1][k - 1];
        }
        return answer;
    }
}

