import java.util.Arrays;

public class Solution {
    public int[] answerQueries(int[] nums, int[] queries) {
        Arrays.sort(nums);
        int n = nums.length;
        long[] prefix = new long[n];
        prefix[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefix[i] = prefix[i - 1] + nums[i];
        }

        int m = queries.length;
        int[] answer = new int[m];
        for (int i = 0; i < m; i++) {
            long q = queries[i];
            int idx = upperBound(prefix, q);
            answer[i] = idx + 1; // number of elements
        }
        return answer;
    }

    // returns the last index where prefix[idx] <= target, or -1 if none
    private int upperBound(long[] prefix, long target) {
        int low = 0, high = prefix.length - 1;
        int res = -1;
        while (low <= high) {
            int mid = (low + high) >>> 1;
            if (prefix[mid] <= target) {
                res = mid;
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }
        return res;
    }
}

