public class Solution {
    public int countSubarrays(int[] nums, int k) {
        int n = nums.length;
        int idx = -1;
        for (int i = 0; i < n; i++) {
            if (nums[i] == k) {
                idx = i;
                break;
            }
        }

        int offset = n;
        int size = 2 * n + 1;
        int[] freq = new int[size];

        int balance = 0;
        freq[balance + offset]++; // empty left side

        for (int i = idx - 1; i >= 0; i--) {
            if (nums[i] > k) {
                balance++;
            } else {
                balance--;
            }
            freq[balance + offset]++;
        }

        int[] cum = new int[size + 1];
        for (int i = size - 1; i >= 0; i--) {
            cum[i] = cum[i + 1] + freq[i];
        }

        long ans = 0;
        int balanceRight = 0;

        // empty right side
        int threshold = -balanceRight;
        int index = threshold + offset;
        if (index < 0) {
            ans += cum[0];
        } else if (index <= size - 1) {
            ans += cum[index];
        }

        for (int j = idx + 1; j < n; j++) {
            if (nums[j] > k) {
                balanceRight++;
            } else {
                balanceRight--;
            }
            threshold = -balanceRight;
            index = threshold + offset;
            if (index < 0) {
                ans += cum[0];
            } else if (index <= size - 1) {
                ans += cum[index];
            }
        }

        return (int) ans;
    }
}

