                if (maxVal > maxDeleted) maxDeleted = maxVal;
                // shift left to delete element at maxIdx
                for (int j = maxIdx; j < n - 1; j++) {
                    grid[i][j] = grid[i][j + 1];
                }
            }
            answer += maxDeleted;
            n--; // one column removed
        }
        return answer;
    }
}

