import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int unequalTriplets(int[] nums) {
        int n = nums.length;
        if (n < 3) return 0;

        Map<Integer, Integer> freq = new HashMap<>();
        for (int num : nums) {
            freq.put(num, freq.getOrDefault(num, 0) + 1);
        }

        long totalTriplets = (long) n * (n - 1) * (n - 2) / 6;
        long equalTriplets = 0;

        for (int count : freq.values()) {
            if (count >= 3) {
                equalTriplets += (long) count * (count - 1) * (count - 2) / 6; // C(count,3)
            }
            if (count >= 2) {
                equalTriplets += (long) count * (count - 1) / 2 * (n - count); // C(count,2) * (n - count)
            }
        }

        long result = totalTriplets - equalTriplets;
        return (int) result;
    }
}

