import java.util.*;

public class Solution {
    public long countPairs(int[] nums1, int[] nums2, int diff) {
        int n = nums1.length;
        long[] A = new long[n];
        for (int i = 0; i < n; i++) {
            A[i] = (long) nums1[i] - (long) nums2[i];
        }

        // Collect values for compression
        long[] all = new long[2 * n];
        int idx = 0;
        for (int i = 0; i < n; i++) {
            all[idx++] = A[i];
            all[idx++] = A[i] + diff;
        }
        Arrays.sort(all);
        int m = 0;
        for (int i = 0; i < all.length; i++) {
            if (i == 0 || all[i] != all[i - 1]) {
                all[m++] = all[i];
            }
        }
        long[] comp = Arrays.copyOf(all, m);

        Fenwick fenwick = new Fenwick(m);
        long result = 0;
        for (int j = 0; j < n; j++) {
            long target = A[j] + diff;
            int pos = upperBound(comp, target);
            if (pos > 0) {
                result += fenwick.sum(pos);
            }
            int posA = lowerBound(comp, A[j]) + 1; // 1-based index
            fenwick.add(posA, 1);
        }
        return result;
    }

    // Find last index where comp[idx] <= value
    private int upperBound(long[] comp, long value) {
        int l = 0, r = comp.length;
        while (l < r) {
            int mid = (l + r) >>> 1;
            if (comp[mid] <= value) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }
        return l; // number of elements <= value
    }

    // Find first index where comp[idx] >= value
    private int lowerBound(long[] comp, long value) {
        int l = 0, r = comp.length;
        while (l < r) {
            int mid = (l + r) >>> 1;
            if (comp[mid] < value) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }
        return l;
    }

    private static class Fenwick {
        private final int n;
        private final int[] tree;

        Fenwick(int n) {
            this.n = n;
            this.tree = new int[n + 2];
        }

        void add(int idx, int delta) {
            for (int i = idx; i <= n; i += i & -i) {
                tree[i] += delta;
            }
        }

        int sum(int idx) {
            int res = 0;
            for (int i = idx; i > 0; i -= i & -i) {
                res += tree[i];
            }
            return res;
        }
    }
}

