import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int subarrayGCD(int[] nums, int k) {
        long result = 0;
        Map<Integer, Integer> prev = new HashMap<>();
        for (int num : nums) {
            Map<Integer, Integer> curr = new HashMap<>();
            // Subarray consisting of only the current element
            curr.put(num, curr.getOrDefault(num, 0) + 1);

            // Extend previous subarrays by the current element
            for (Map.Entry<Integer, Integer> entry : prev.entrySet()) {
                int newGcd = gcd(entry.getKey(), num);
                curr.put(newGcd, curr.getOrDefault(newGcd, 0) + entry.getValue());
            }

            // Count subarrays ending at current index with GCD == k
            result += curr.getOrDefault(k, 0);

            prev = curr;
        }
        return (int) result;
    }

    private int gcd(int a, int b) {
        while (b != 0) {
            int t = a % b;
            a = b;
            b = t;
        }
        return a;
    }
}

