public class Solution {
    public int maxSum(int[][] grid) {
        int m = grid.length;
        if (m < 3) return 0;
        int n = grid[0].length;
        if (n < 3) return 0;

        int max = Integer.MIN_VALUE;
        for (int i = 0; i <= m - 3; i++) {
            for (int j = 0; j <= n - 3; j++) {
                int sum = grid[i][j] + grid[i][j + 1] + grid[i][j + 2]
                        + grid[i + 1][j + 1]
                        + grid[i + 2][j] + grid[i + 2][j + 1] + grid[i + 2][j + 2];
                if (sum > max) {
                    max = sum;
                }
            }
        }
        return max;
    }
}

