public class Solution {
    public long makeSimilar(int[] nums, int[] target) {
        Map<Integer, Integer> diff = new HashMap<>();
        for (int v : nums) {
            diff.merge(v, 1, Integer::sum);
        }
        for (int v : target) {
            diff.merge(v, -1, Integer::sum);
        }
        long positiveSum = 0;
        for (int val : diff.values()) {
            if (val > 0) {
                positiveSum += val;
            }
        }
        return positiveSum / 2;
    }
}

