import com_github_leetcode.TreeNode;
import java.util.*;

public class Solution {
    private Map<Integer, TreeNode> nodeMap = new HashMap<>();
    private Map<Integer, Integer> depthMap = new HashMap<>();
    private Map<Integer, Integer> subMaxMap = new HashMap<>();
    private Map<Integer, Integer> outsideMap = new HashMap<>();

    public int[] treeQueries(TreeNode root, int[] queries) {
        buildMap(root);
        dfs1(root, 0);
        outsideMap.put(root.val, -1);
        dfs2(root);
        int[] ans = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            ans[i] = outsideMap.get(queries[i]);
        }
        return ans;
    }

    private void buildMap(TreeNode node) {
        if (node == null) return;
        nodeMap.put(node.val, node);
        buildMap(node.left);
        buildMap(node.right);
    }

    private void dfs1(TreeNode node, int d) {
        depthMap.put(node.val, d);
        int max = d;
        if (node.left != null) {
            dfs1(node.left, d + 1);
            max = Math.max(max, subMaxMap.get(node.left.val));
        }
        if (node.right != null) {
            dfs1(node.right, d + 1);
            max = Math.max(max, subMaxMap.get(node.right.val));
        }
        subMaxMap.put(node.val, max);
    }

    private void dfs2(TreeNode node) {
        int nodeVal = node.val;
        int outsideVal = outsideMap.get(nodeVal);

        List<TreeNode> children = new ArrayList<>();
        if (node.left != null) children.add(node.left);
        if (node.right != null) children.add(node.right);
        int k = children.size();

        int[] pref = new int[k];
        int[] suff = new int[k];

        for (int i = 0; i < k; i++) {
            int childVal = children.get(i).val;
            int childSubMax = subMaxMap.get(childVal);
            if (i == 0) pref[i] = childSubMax;
            else pref[i] = Math.max(pref[i - 1], childSubMax);
        }
        for (int i = k - 1; i >= 0; i--) {
            int childVal = children.get(i).val;
            int childSubMax = subMaxMap.get(childVal);
            if (i == k - 1) suff[i] = childSubMax;
            else suff[i] = Math.max(suff[i + 1], childSubMax);
        }

        for (int i = 0; i < k; i++) {
            TreeNode child = children.get(i);
            int bestSibling = -1;
            if (k > 1) {
                if (i == 0) bestSibling = suff[1];
                else if (i == k - 1) bestSibling = pref[k - 2];
                else bestSibling = Math.max(pref[i - 1], suff[i + 1]);
            }

            int candidate = Math.max(outsideVal, depthMap.get(nodeVal));
            if (bestSibling != -1) candidate = Math.max(candidate, bestSibling);

            outsideMap.put(child.val, candidate);
            dfs2(child);
        }
    }
}

