public class Solution {
    public String oddString(String[] w) {
        int n = w[0].length();
        String diff1 = getDiff(w[0], n);
        String diff2 = getDiff(w[1], n);
        String common;
        if (diff1.equals(diff2)) {
            common = diff1;
        } else {
            String diff3 = getDiff(w[2], n);
            if (diff1.equals(diff3)) {
                common = diff1;
            } else {
                common = diff2;
            }
        }
        for (String word : w) {
            if (!getDiff(word, n).equals(common)) {
                return word;
            }
        }
        return ""; // should never reach here
    }

    private String getDiff(String s, int n) {
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < n - 1; i++) {
            int diff = s.charAt(i + 1) - s.charAt(i);
            sb.append(diff).append(',');
        }
        return sb.toString();
    }
}

