import java.util.*;

public class Solution {
    public long minimumTotalDistance(List<Integer> robot, int[][] f) {
        int n = robot.size();
        int[] robots = new int[n];
        for (int i = 0; i < n; i++) robots[i] = robot.get(i);
        Arrays.sort(robots);

        int k = f.length;
        Factory[] factories = new Factory[k];
        for (int i = 0; i < k; i++) {
            factories[i] = new Factory(f[i][0], f[i][1]);
        }
        Arrays.sort(factories, Comparator.comparingInt(a -> a.pos));

        long INF = Long.MAX_VALUE / 4;
        long[] dp = new long[n + 1];
        Arrays.fill(dp, INF);
        dp[0] = 0;

        for (Factory fac : factories) {
            int pos = fac.pos;
            int limit = fac.limit;

            long[] costPref = new long[n + 1];
            costPref[0] = 0;
            for (int i = 0; i < n; i++) {
                costPref[i + 1] = costPref[i] + Math.abs((long) robots[i] - pos);
            }

            long[] newdp = new long[n + 1];
            Arrays.fill(newdp, INF);
            Deque<Integer> deque = new ArrayDeque<>();

            for (int q = 0; q <= n; q++) {
                long val = dp[q] - costPref[q];
                while (!deque.isEmpty() && (dp[deque.peekLast()] - costPref[deque.peekLast()]) >= val) {
                    deque.pollLast();
                }
                deque.offerLast(q);

                while (!deque.isEmpty() && deque.peekFirst() < q - limit) {
                    deque.pollFirst();
                }

                long best = dp[deque.peekFirst()] - costPref[deque.peekFirst()];
                if (best >= INF / 2) {
                    newdp[q] = INF;
                } else {
                    newdp[q] = costPref[q] + best;
                }
            }
            dp = newdp;
        }

        return dp[n];
    }

    private static class Factory {
        int pos;
        int limit;

        Factory(int pos, int limit) {
            this.pos = pos;
            this.limit = limit;
        }
    }
}

