import java.util.*;

public class Solution {
    private static final long MOD1 = 1_000_000_007L;
    private static final long MOD2 = 1_000_000_009L;
    private static final long BASE = 911382323L;

    public int deleteString(String s) {
        int n = s.length();
        if (n == 0) return 0;

        long[] pow1 = new long[n + 1];
        long[] pow2 = new long[n + 1];
        pow1[0] = pow2[0] = 1;
        for (int i = 1; i <= n; i++) {
            pow1[i] = (pow1[i - 1] * BASE) % MOD1;
            pow2[i] = (pow2[i - 1] * BASE) % MOD2;
        }

        long[] pref1 = new long[n + 1];
        long[] pref2 = new long[n + 1];
        for (int i = 0; i < n; i++) {
            pref1[i + 1] = (pref1[i] * BASE + s.charAt(i)) % MOD1;
            pref2[i + 1] = (pref2[i] * BASE + s.charAt(i)) % MOD2;
        }

        int[] dp = new int[n + 1];
        dp[n] = 0;
        for (int i = n - 1; i >= 0; i--) {
            int best = 1; // delete entire suffix in one operation
            int maxLen = (n - i) / 2;
            for (int len = 1; len <= maxLen; len++) {
                int j = i + len;
                int k = j + len;
                if (k > n) break;
                if (hashEquals(pref1, pref2, pow1, pow2, i, j, j, k)) {
                    best = Math.max(best, 1 + dp[k]);
                }
            }
            dp[i] = best;
        }
        return dp[0];
    }

    private boolean hashEquals(long[] pref1, long[] pref2,
                               long[] pow1, long[] pow2,
                               int l1, int r1, int l2, int r2) {
        long h1a = (pref1[r1] - pref1[l1] * pow1[r1 - l1]) % MOD1;
        if (h1a < 0) h1a += MOD1;
        long h1b = (pref1[r2] - pref1[l2] * pow1[r2 - l2]) % MOD1;
        if (h1b < 0) h1b += MOD1;
        if (h1a != h1b) return false;

        long h2a = (pref2[r1] - pref2[l1] * pow2[r1 - l1]) % MOD2;
        if (h2a < 0) h2a += MOD2;
        long h2b = (pref2[r2] - pref2[l2] * pow2[r2 - l2]) % MOD2;
        if (h2b < 0) h2b += MOD2;
        return h2a == h2b;
    }
}

