public class Solution {
    public int countDaysTogether(String arriveAlice, String leaveAlice, String arriveBob, String leaveBob) {
        int[] monthDays = {31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31};

        int aliceStart = toDayOfYear(arriveAlice, monthDays);
        int aliceEnd   = toDayOfYear(leaveAlice, monthDays);
        int bobStart   = toDayOfYear(arriveBob, monthDays);
        int bobEnd     = toDayOfYear(leaveBob, monthDays);

        int overlapStart = Math.max(aliceStart, bobStart);
        int overlapEnd   = Math.min(aliceEnd, bobEnd);

        if (overlapStart > overlapEnd) {
            return 0;
        }
        return overlapEnd - overlapStart + 1;
    }

    private int toDayOfYear(String date, int[] monthDays) {
        int month = Integer.parseInt(date.substring(0, 2));
        int day   = Integer.parseInt(date.substring(3, 5));
        int sum = 0;
        for (int i = 0; i < month - 1; i++) {
            sum += monthDays[i];
        }
        return sum + day;
    }
}

