import java.util.Arrays;

public class Solution {
    public int[] smallestSubarrays(int[] nums) {
        int n = nums.length;
        int[] suffixOR = new int[n];
        int cur = 0;
        for (int i = n - 1; i >= 0; i--) {
            cur |= nums[i];
            suffixOR[i] = cur;
        }

        int[] ans = new int[n];
        int[] bitCount = new int[31];
        int windowOR = 0;
        int j = 0;

        for (int i = 0; i < n; i++) {
            if (j < i) {
                j = i;
                Arrays.fill(bitCount, 0);
                windowOR = 0;
            }

            if (i > 0) {
                int val = nums[i - 1];
                for (int b = 0; b < 31; b++) {
                    if (((val >> b) & 1) == 1) {
                        bitCount[b]--;
                        if (bitCount[b] == 0) {
                            windowOR &= ~(1 << b);
                        }
                    }
                }
            }

            while (j < n && windowOR != suffixOR[i]) {
                int val = nums[j];
                for (int b = 0; b < 31; b++) {
                    if (((val >> b) & 1) == 1) {
                        if (bitCount[b] == 0) {
                            windowOR |= (1 << b);
                        }
                        bitCount[b]++;
                    }
                }
                j++;
            }

            ans[i] = j - i;
        }

        return ans;
    }
}

