import java.util.PriorityQueue;

public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        int n = costs.length;
        int left = 0;
        int right = n - 1;

        PriorityQueue<int[]> leftPQ = new PriorityQueue<>((a, b) -> {
            if (a[0] != b[0]) return Integer.compare(a[0], b[0]);
            return Integer.compare(a[1], b[1]);
        });

        PriorityQueue<int[]> rightPQ = new PriorityQueue<>((a, b) -> {
            if (a[0] != b[0]) return Integer.compare(a[0], b[0]);
            return Integer.compare(a[1], b[1]);
        });

        // Initialize left candidates
        while (leftPQ.size() < candidates && left <= right) {
            leftPQ.offer(new int[]{costs[left], left});
            left++;
        }

        // Initialize right candidates
        while (rightPQ.size() < candidates && left <= right) {
            rightPQ.offer(new int[]{costs[right], right});
            right--;
        }

        long total = 0;
        for (int i = 0; i < k; i++) {
            int[] pick;
            if (leftPQ.isEmpty()) {
                pick = rightPQ.poll();
            } else if (rightPQ.isEmpty()) {
                pick = leftPQ.poll();
            } else {
                int[] leftTop = leftPQ.peek();
                int[] rightTop = rightPQ.peek();
                if (leftTop[0] < rightTop[0] || (leftTop[0] == rightTop[0] && leftTop[1] < rightTop[1])) {
                    pick = leftPQ.poll();
                } else {
                    pick = rightPQ.poll();
                }
            }

            total += pick[0];

            // Replenish from the side we just took from
            if (pick[1] < left) { // came from left side
                if (left <= right) {
                    leftPQ.offer(new int[]{costs[left], left});
                    left++;
                }
            } else { // came from right side
                if (left <= right) {
                    rightPQ.offer(new int[]{costs[right], right});
                    right--;
                }
            }
        }

        return total;
    }
}

