import java.util.*;

public class Solution {
    // Trie node definition
    private static class Node {
        int count = 0;          // number of words that have this prefix
        int[] next = new int[26]; // children indices, -1 if absent

        Node() {
            Arrays.fill(next, -1);
        }
    }

    private final List<Node> trie = new ArrayList<>();

    public Solution() {
        // initialize root node
        trie.add(new Node());
    }

    public int[] sumPrefixScores(String[] words) {
        // Build trie and count prefixes
        for (String word : words) {
            int nodeIdx = 0; // start at root
            for (char ch : word.toCharArray()) {
                int c = ch - 'a';
                int childIdx = trie.get(nodeIdx).next[c];
                if (childIdx == -1) {
                    childIdx = trie.size();
                    trie.get(nodeIdx).next[c] = childIdx;
                    trie.add(new Node());
                }
                nodeIdx = childIdx;
                trie.get(nodeIdx).count++; // increment count for this prefix
            }
        }

        // Compute answer for each word
        int[] answer = new int[words.length];
        for (int i = 0; i < words.length; i++) {
            String word = words[i];
            int nodeIdx = 0;
            int sum = 0;
            for (char ch : word.toCharArray()) {
                int c = ch - 'a';
                nodeIdx = trie.get(nodeIdx).next[c];
                sum += trie.get(nodeIdx).count;
            }
            answer[i] = sum;
        }
        return answer;
    }
}

