            CreatorInfo info = map.getOrDefault(creator, new CreatorInfo());
            info.totalViews += view;

            if (info.bestViews < view || (info.bestViews == view && (info.bestId == null || id.compareTo(info.bestId) < 0))) {
                info.bestViews = view;
                info.bestId = id;
            }

            map.put(creator, info);
        }

        long maxTotal = 0;
        for (CreatorInfo info : map.values()) {
            if (info.totalViews > maxTotal) {
                maxTotal = info.totalViews;
            }
        }

        List<List<String>> result = new ArrayList<>();
        for (Map.Entry<String, CreatorInfo> entry : map.entrySet()) {
            if (entry.getValue().totalViews == maxTotal) {
                result.add(Arrays.asList(entry.getKey(), entry.getValue().bestId));
            }
        }

