import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int destroyTargets(int[] nums, int space) {
        if (space == 0) {
            Map<Integer, Integer> freq = new HashMap<>();
            for (int num : nums) {
                freq.put(num, freq.getOrDefault(num, 0) + 1);
            }
            int bestCount = -1;
            int bestSeed = Integer.MAX_VALUE;
            for (Map.Entry<Integer, Integer> entry : freq.entrySet()) {
                int val = entry.getKey();
                int cnt = entry.getValue();
                if (cnt > bestCount || (cnt == bestCount && val < bestSeed)) {
                    bestCount = cnt;
                    bestSeed = val;
                }
            }
            return bestSeed;
        }

        Map<Integer, int[]> map = new HashMap<>(); // key: residue, value: [count, minSeed]
        for (int num : nums) {
            int residue = num % space;
            int[] data = map.get(residue);
            if (data == null) {
                map.put(residue, new int[]{1, num});
            } else {
                data[0]++; // increment count
                if (num < data[1]) {
                    data[1] = num; // update min seed
                }
            }
        }

        int bestCount = -1;
        int bestSeed = Integer.MAX_VALUE;
        for (int[] data : map.values()) {
            int cnt = data[0];
            int seed = data[1];
            if (cnt > bestCount || (cnt == bestCount && seed < bestSeed)) {
                bestCount = cnt;
                bestSeed = seed;
            }
        }
        return bestSeed;
    }
}

