import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Stack;

public class Solution {
    public long minimumFuelCost(int[][] roads, int seats) {
        int n = roads.length + 1;
        List<Integer>[] adj = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            adj[i] = new ArrayList<>();
        }
        for (int[] road : roads) {
            int a = road[0];
            int b = road[1];
            adj[a].add(b);
            adj[b].add(a);
        }

        int[] parent = new int[n];
        Arrays.fill(parent, -1);
        int[] order = new int[n];
        int idx = 0;

        Stack<Integer> stack = new Stack<>();
        stack.push(0);
        parent[0] = 0;
        while (!stack.isEmpty()) {
            int u = stack.pop();
            order[idx++] = u;
            for (int v : adj[u]) {
                if (parent[v] == -1) {
                    parent[v] = u;
                    stack.push(v);
                }
            }
        }

        long[] size = new long[n];
        long result = 0;
        for (int i = n - 1; i > 0; i--) {
            int u = order[i];
            long total = 1;
            for (int v : adj[u]) {
                if (parent[v] == u) {
                    total += size[v];
                }
            }
            size[u] = total;
            result += (total + seats - 1) / seats;
        }
        return result;
    }
}

