public class Solution {
    public int xorAllNums(int[] nums1, int[] nums2) {
        int xorA = 0;
        for (int a : nums1) {
            xorA ^= a;
        }
        int xorB = 0;
        for (int b : nums2) {
            xorB ^= b;
        }
