import com_github_leetcode.TreeNode;
import java.util.ArrayDeque;
import java.util.HashMap;
import java.util.Map;
public class Solution {
    public int minimumOperations(TreeNode root) {
        if (root == null) return 0;
        int totalSwaps = 0;
        ArrayDeque<TreeNode> queue = new ArrayDeque<>();
        queue.offer(root);
        while (!queue.isEmpty()) {
            int levelSize = queue.size();
            int[] values = new int[levelSize];
            for (int i = 0; i < levelSize; i++) {
                TreeNode node = queue.poll();
                values[i] = node.val;
                if (node.left != null) queue.offer(node.left);
                if (node.right != null) queue.offer(node.right);
            }
            if (levelSize <= 1) continue;
            int[] sorted = values.clone();
            java.util.Arrays.sort(sorted);
            Map<Integer, Integer> targetIndex = new HashMap<>(levelSize);
            for (int i = 0; i < levelSize; i++) {
                targetIndex.put(sorted[i], i);
            }
            boolean[] visited = new boolean[levelSize];
            for (int i = 0; i < levelSize; i++) {
                if (visited[i] || targetIndex.get(values[i]) == i) continue;
                int cycleSize = 0;
                int j = i;
                while (!visited[j]) {
                    visited[j] = true;
                    j = targetIndex.get(values[j]);
                    cycleSize++;
                }
                if (cycleSize > 0) totalSwaps += cycleSize - 1;
            }
        }
        return totalSwaps;
    }
}

