import java.util.Arrays;

public class Solution {
    public int numberOfPaths(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        final long MOD = 1_000_000_007L;

        int[][] prev = new int[n][k];
        int[][] curr = new int[n][k];

        int startMod = ((grid[0][0] % k) + k) % k;
        prev[0][startMod] = 1;

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (i == 0 && j == 0) {
                    continue; // already initialized
                }
                int valMod = ((grid[i][j] % k) + k) % k;
                Arrays.fill(curr[j], 0);

                for (int r = 0; r < k; r++) {
                    long count = 0;
                    if (i > 0) {
                        count += prev[j][r];
                    }
                    if (j > 0) {
                        count += curr[j - 1][r];
                    }
                    if (count == 0) {
                        continue;
                    }
                    int newMod = (r + valMod) % k;
                    curr[j][newMod] = (int) ((curr[j][newMod] + count) % MOD);
                }
            }
            // swap prev and curr for next row
            int[][] temp = prev;
            prev = curr;
            curr = temp;
        }

        return prev[n - 1][0];
    }
}

