import java.util.*;

public class Solution {
    public int mostProfitablePath(int[][] edges, int bob, int[] amount) {
        int n = amount.length;
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) graph[i] = new ArrayList<>();
        for (int[] e : edges) {
            graph[e[0]].add(e[1]);
            graph[e[1]].add(e[0]);
        }

        int[] bobTime = new int[n];
        Arrays.fill(bobTime, -1);
        dfsBob(bob, -1, 0, graph, bobTime);

        int[] maxIncome = new int[1];
        dfsAlice(0, -1, 0, graph, amount, bobTime, 0, maxIncome);
        return maxIncome[0];
    }

    private boolean dfsBob(int node, int parent, int time, List<Integer>[] graph, int[] bobTime) {
        if (node == 0) {
            bobTime[node] = time;
            return true;
        }
        for (int nei : graph[node]) {
            if (nei == parent) continue;
            if (dfsBob(nei, node, time + 1, graph, bobTime)) {
                bobTime[node] = time;
                return true;
            }
        }
        return false;
    }

    private void dfsAlice(int node, int parent, int time, List<Integer>[] graph, int[] amount,
                          int[] bobTime, int currentSum, int[] maxIncome) {
        int contrib = 0;
        if (bobTime[node] == -1) {
            contrib = amount[node];
        } else if (time < bobTime[node]) {
            contrib = amount[node];
        } else if (time == bobTime[node]) {
            contrib = amount[node] / 2;
        } // else contrib remains 0

        int newSum = currentSum + contrib;

        boolean isLeaf = (node != 0 && graph[node].size() == 1) || (node == 0 && graph[node].size() == 0);
        if (isLeaf) {
            if (newSum > maxIncome[0]) maxIncome[0] = newSum;
        } else {
            for (int nei : graph[node]) {
                if (nei == parent) continue;
                dfsAlice(nei, node, time + 1, graph, amount, bobTime, newSum, maxIncome);
            }
        }
    }
}

