public class Solution {
    private static final int MOD = 1_000_000_007;

    public int beautifulPartitions(String s, int k, int l) {
        int n = s.length();
        if (k == 0) return n == 0 ? 1 : 0;
        if (n == 0) return 0;

        boolean[] primeStart = new boolean[n];
        boolean[] nonPrimeEnd = new boolean[n];

        for (int i = 0; i < n; i++) {
            char c = s.charAt(i);
            primeStart[i] = (c == '2' || c == '3' || c == '5' || c == '7');
            nonPrimeEnd[i] = !(c == '2' || c == '3' || c == '5' || c == '7');
        }

        long[][] dp = new long[n + 1][k + 1];
        dp[0][0] = 1;

        for (int part = 1; part <= k; part++) {
            long[] pref = new long[n + 1];
            pref[0] = 0;
            for (int i = 0; i < n; i++) {
                pref[i + 1] = (pref[i] + dp[i][part - 1] * (primeStart[i] ? 1 : 0)) % MOD;
            }
            for (int i = 1; i <= n; i++) {
                if (!nonPrimeEnd[i - 1]) {
                    dp[i][part] = 0;
                    continue;
                }
                int startIdx = i - l;
                if (startIdx < 0) {
                    dp[i][part] = 0;
                } else {
                    dp[i][part] = pref[startIdx];
                }
            }
        }

        return (int) dp[n][k];
    }
}

