import java.util.ArrayList;
import java.util.List;

public class Solution {
    private List<Integer>[] graph;
    private int[] nums;
    private long target;
    private int cuts;

    public int componentValue(int[] nums, int[][] edges) {
        int n = nums.length;
        this.nums = nums;
        graph = new ArrayList[n];
        for (int i = 0; i < n; i++) graph[i] = new ArrayList<>();
        for (int[] e : edges) {
            graph[e[0]].add(e[1]);
            graph[e[1]].add(e[0]);
        }

        long totalSum = 0;
        for (int v : nums) totalSum += v;

        if (totalSum == 0) {
            return n - 1; // all edges can be removed
        }

        int maxComponents = 1; // at least one component
        for (long d : divisors(totalSum)) {
            if (d <= 0) continue;
            target = d;
            cuts = 0;
            long rootSum = dfs(0, -1);
            if (rootSum == 0) {
                int components = (int) (totalSum / d);
                if (components > maxComponents) {
                    maxComponents = components;
                }
            }
        }

        return maxComponents - 1; // edges removed = components - 1
    }

    private long dfs(int node, int parent) {
        long sum = nums[node];
        for (int nei : graph[node]) {
            if (nei == parent) continue;
            sum += dfs(nei, node);
        }
        if (sum == target) {
            cuts++;
            return 0;
        }
        return sum;
    }

    private List<Long> divisors(long x) {
        List<Long> res = new ArrayList<>();
        for (long i = 1; i * i <= x; i++) {
            if (x % i == 0) {
                res.add(i);
                if (i != x / i) res.add(x / i);
            }
        }
        return res;
    }
}

