public class Solution {
    public long makeIntegerBeautiful(long n, int target) {
        long cur = n;
        long increment = 0;
        while (sumDigits(cur) > target) {
            long power = 1;
            while (true) {
                long digit = (cur / power) % 10;
                if (digit != 9) {
                    long newCur = ((cur / power) + 1) * power;
                    long inc = newCur - cur;
                    cur = newCur;
                    increment += inc;
                    break;
                }
                power *= 10;
            }
        }
        return increment;
    }

    private long sumDigits(long x) {
        long sum = 0;
        while (x > 0) {
            sum += x % 10;
            x /= 10;
        }
        return sum;
    }
}

