import java.util.*;

public class Solution {
    // Segment Tree for range maximum query and point update
    private static class SegTree {
        private final int n;
        private final int[] tree;

        public SegTree(int n) {
            this.n = n;
            this.tree = new int[4 * n];
        }

        // point update: set position idx to max(current, val)
        public void update(int idx, int val) {
            update(1, 0, n - 1, idx, val);
        }

        private void update(int node, int l, int r, int idx, int val) {
            if (l == r) {
                tree[node] = Math.max(tree[node], val);
                return;
            }
            int mid = (l + r) >>> 1;
            if (idx <= mid) {
                update(node << 1, l, mid, idx, val);
            } else {
                update(node << 1 | 1, mid + 1, r, idx, val);
            }
            tree[node] = Math.max(tree[node << 1], tree[node << 1 | 1]);
        }

        // range maximum query [ql, qr]
        public int query(int ql, int qr) {
            if (ql > qr) return 0;
            return query(1, 0, n - 1, ql, qr);
        }

        private int query(int node, int l, int r, int ql, int qr) {
            if (ql <= l && r <= qr) return tree[node];
            int mid = (l + r) >>> 1;
            int res = 0;
            if (ql <= mid) res = Math.max(res, query(node << 1, l, mid, ql, qr));
            if (qr > mid) res = Math.max(res, query(node << 1 | 1, mid + 1, r, ql, qr));
            return res;
        }
    }

    public int longestSubsequence(int[] nums, int k) {
        int n = nums.length;
        // Coordinate compression
        int[] sorted = nums.clone();
        Arrays.sort(sorted);
        int m = 0;
        for (int i = 0; i < n; i++) {
            if (i == 0 || sorted[i] != sorted[i - 1]) {
                sorted[m++] = sorted[i];
            }
        }
        int[] comp = Arrays.copyOf(sorted, m);

        SegTree seg = new SegTree(m);
        int best = 0;

        for (int num : nums) {
            int idx = Arrays.binarySearch(comp, num);
            int leftVal = num - k;
            int rightVal = num - 1;

            int leftIdx = lowerBound(comp, leftVal);
            int rightIdx = upperBound(comp, rightVal) - 1;

            int cur = 1;
            if (leftIdx <= rightIdx) {
                cur = 1 + seg.query(leftIdx, rightIdx);
            }
            seg.update(idx, cur);
            best = Math.max(best, cur);
        }
        return best;
    }

    // Helper: first index >= target
    private static int lowerBound(int[] arr, int target) {
        int l = 0, r = arr.length;
        while (l < r) {
            int mid = (l + r) >>> 1;
            if (arr[mid] < target) l = mid + 1;
            else r = mid;
        }
        return l;
    }

    // Helper: first index > target
    private static int upperBound(int[] arr, int target) {
        int l = 0, r = arr.length;
        while (l < r) {
            int mid = (l + r) >>> 1;
            if (arr[mid] <= target) l = mid + 1;
            else r = mid;
        }
        return l;
    }
}

