import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class Solution {
    public int numberOfGoodPaths(int[] vals, int[][] edges) {
        int n = vals.length;
        List<Integer>[] adj = new ArrayList[n];
        for (int i = 0; i < n; i++) adj[i] = new ArrayList<>();
        for (int[] e : edges) {
            adj[e[0]].add(e[1]);
            adj[e[1]].add(e[0]);
        }

        int[] order = new int[n];
        for (int i = 0; i < n; i++) order[i] = i;
        Arrays.sort(order, (a, b) -> Integer.compare(vals[a], vals[b]));

        int[] parent = new int[n];
        int[] size = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
            size[i] = 1;
        }

        int[] count = new int[n];
        List<Integer> usedRoots = new ArrayList<>();

        int ans = n; // single nodes

        int idx = 0;
        while (idx < n) {
            int val = vals[order[idx]];
            int end = idx;
            while (end < n && vals[order[end]] == val) end++;

            // Union step for all nodes with current value
            for (int i = idx; i < end; i++) {
                int u = order[i];
                for (int v : adj[u]) {
                    if (vals[v] <= val) {
                        union(u, v, parent, size);
                    }
                }
            }

            // Count pairs
            for (int i = idx; i < end; i++) {
                int u = order[i];
                int root = find(u, parent);
                if (count[root] == 0) usedRoots.add(root);
                count[root]++;
                ans += count[root] - 1;
            }

            // Reset counts for next group
            for (int root : usedRoots) {
                count[root] = 0;
            }
            usedRoots.clear();

            idx = end;
        }

        return ans;
    }

    private int find(int x, int[] parent) {
        if (parent[x] != x) parent[x] = find(parent[x], parent);
        return parent[x];
    }

    private void union(int a, int b, int[] parent, int[] size) {
        int ra = find(a, parent);
        int rb = find(b, parent);
        if (ra == rb) return;
        if (size[ra] < size[rb]) {
            int tmp = ra;
            ra = rb;
            rb = tmp;
        }
        parent[rb] = ra;
        size[ra] += size[rb];
    }
}

