public class Solution {
    public int minimizeXor(int num1, int num2) {
        int k = Integer.bitCount(num2);
        int x = 0;
        int remaining = k;

        // Set ones at the most significant bits of num1 first
        for (int i = 31; i >= 0 && remaining > 0; i--) {
            if (((num1 >> i) & 1) == 1) {
                x |= (1 << i);
                remaining--;
            }
        }

        // If we still need more ones, set them at the least significant zero bits of num1
        if (remaining > 0) {
            for (int i = 0; i <= 31 && remaining > 0; i++) {
                if (((num1 >> i) & 1) == 0) {
                    x |= (1 << i);
                    remaining--;
                }
            }
        }

        return x;
    }
}

