import java.util.ArrayList;
import java.util.LinkedList;
import java.util.List;
import java.util.Queue;

public class Solution {
    public int magnificentSets(int n, int[][] edges) {
        List<Integer>[] graph = new ArrayList[n + 1];
        for (int i = 1; i <= n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] e : edges) {
            int a = e[0];
            int b = e[1];
            if (a == b) {
                // self-loop cannot satisfy |y - x| = 1
                return -1;
            }
            graph[a].add(b);
            graph[b].add(a);
        }

        boolean[] visited = new boolean[n + 1];
        int totalGroups = 0;

        for (int start = 1; start <= n; start++) {
            if (!visited[start]) {
                // First BFS: detect cycle and find farthest node
                Queue<Integer> q = new LinkedList<>();
                int[] parent = new int[n + 1];
                int[] dist = new int[n + 1];
                List<Integer> componentNodes = new ArrayList<>();

                q.add(start);
                visited[start] = true;
                parent[start] = 0;
                dist[start] = 0;
                componentNodes.add(start);

                boolean hasCycle = false;
                int farthestNode = start;
                int maxDist = 0;

                while (!q.isEmpty()) {
                    int u = q.poll();
                    for (int v : graph[u]) {
                        if (!visited[v]) {
                            visited[v] = true;
                            parent[v] = u;
                            dist[v] = dist[u] + 1;
                            q.add(v);
                            componentNodes.add(v);
                            if (dist[v] > maxDist) {
                                maxDist = dist[v];
                                farthestNode = v;
                            }
                        } else if (v != parent[u]) {
                            // visited neighbor that is not parent -> cycle
                            hasCycle = true;
                        }
                    }
                }

                if (hasCycle) {
                    return -1;
                }

                // Second BFS from farthestNode to compute diameter
                boolean[] visited2 = new boolean[n + 1];
                int[] dist2 = new int[n + 1];
                Queue<Integer> q2 = new LinkedList<>();
                q2.add(farthestNode);
                visited2[farthestNode] = true;
                dist2[farthestNode] = 0;
                int diameter = 0;

                while (!q2.isEmpty()) {
                    int u = q2.poll();
                    for (int v : graph[u]) {
                        if (!visited2[v]) {
                            visited2[v] = true;
                            dist2[v] = dist2[u] + 1;
                            diameter = Math.max(diameter, dist2[v]);
                            q2.add(v);
                        }
                    }
                }

                totalGroups += diameter + 1;
            }
        }

        return totalGroups;
    }
}

