import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public int mostBooked(int n, int[][] meetings) {
        // Sort meetings by start time
        Arrays.sort(meetings, Comparator.comparingInt(a -> a[0]));

        // Count of meetings per room
        int[] count = new int[n];

        // Free rooms sorted by room number
        PriorityQueue<Room> freeRooms = new PriorityQueue<>(Comparator.comparingInt(r -> r.id));

        // Busy rooms sorted by end time
        PriorityQueue<Room> busyRooms = new PriorityQueue<>(Comparator.comparingInt(r -> r.end));

        // Initially all rooms are free
        for (int i = 0; i < n; i++) {
            freeRooms.offer(new Room(i, 0));
        }

        for (int[] meeting : meetings) {
            int start = meeting[0];
            int duration = meeting[1] - meeting[0];
            int end = start + duration;

            // Free rooms that have finished before current start
            while (!busyRooms.isEmpty() && busyRooms.peek().end <= start) {
                freeRooms.offer(busyRooms.poll());
            }

            if (!freeRooms.isEmpty()) {
                // Assign to the lowest-numbered free room
                Room room = freeRooms.poll();
                room.end = end;
                busyRooms.offer(room);
                count[room.id]++;
            } else {
                // No free rooms, delay the meeting
                Room earliest = busyRooms.poll();
                int newStart = earliest.end;
                int newEnd = newStart + duration;
                earliest.end = newEnd;
                busyRooms.offer(earliest);
                count[earliest.id]++;
            }
        }

        // Find room with maximum meetings, tie-breaking by lowest id
        int bestRoom = 0;
        int maxCount = count[0];
        for (int i = 1; i < n; i++) {
            if (count[i] > maxCount) {
                maxCount = count[i];
                bestRoom = i;
            }
        }
        return bestRoom;
    }

    private static class Room {
        int id;
        int end;

        Room(int id, int end) {
            this.id = id;
            this.end = end;
        }
    }
}

