public class Solution {
    public long countSubarrays(int[] nums, int minK, int maxK) {
        long result = 0;
        int lastInvalid = -1;   // last index where nums[i] is outside [minK, maxK]
        int lastMin = -1;       // last index where nums[i] == minK
        int lastMax = -1;       // last index where nums[i] == maxK

        for (int i = 0; i < nums.length; i++) {
            int val = nums[i];
            if (val < minK || val > maxK) {
                lastInvalid = i;
            } else {
                if (val == minK) lastMin = i;
                if (val == maxK) lastMax = i;
                int minLast = Math.min(lastMin, lastMax);
                if (minLast > lastInvalid) {
                    result += minLast - lastInvalid;
                }
            }
        }
        return result;
    }
}

