import java.util.ArrayList;
import java.util.List;

public class Solution {
    private static final long MOD = 1_000_000_007L;

    public int[] productQueries(int n, int[][] queries) {
        // Build the powers array from the binary representation of n
        List<Integer> powersList = new ArrayList<>();
        for (int i = 0; i < 32; i++) {
            if ((n & (1 << i)) != 0) {
                powersList.add(1 << i);
            }
        }
        int m = powersList.size();
        long[] prefix = new long[m];
        for (int i = 0; i < m; i++) {
            long val = powersList.get(i);
            if (i == 0) {
                prefix[i] = val % MOD;
            } else {
                prefix[i] = (prefix[i - 1] * val) % MOD;
            }
        }

        int q = queries.length;
        int[] answers = new int[q];
        for (int i = 0; i < q; i++) {
            int left = queries[i][0];
            int right = queries[i][1];
            long prod;
            if (left == 0) {
                prod = prefix[right];
            } else {
                prod = (prefix[right] * modInverse(prefix[left - 1], MOD)) % MOD;
            }
            answers[i] = (int) prod;
        }
        return answers;
    }

    private long modInverse(long a, long mod) {
        return modPow(a, mod - 2, mod);
    }

    private long modPow(long base, long exp, long mod) {
        long result = 1;
        base %= mod;
        while (exp > 0) {
            if ((exp & 1) == 1) {
                result = (result * base) % mod;
            }
            base = (base * base) % mod;
            exp >>= 1;
        }
        return result;
    }
}

