public class Solution {
    public long minimumMoney(int[][] transactions) {
        long sumNeg = 0;
        for (int[] t : transactions) {
            long d = (long) t[1] - t[0];
            if (d < 0) sumNeg += d;
        }

        long ans = 0;
        for (int[] t : transactions) {
            long c = t[0];
            long d = (long) t[1] - c;
            long need = c - sumNeg;
