import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.HashSet;
import java.util.Arrays;

public class Solution {
    public List<String> findMatches(String[] queries, String[] dictionary) {
        List<String> result = new ArrayList<>();
        if (queries == null || dictionary == null) {
            return result;
        }
        HashSet<String> dictSet = new HashSet<>(Arrays.asList(dictionary));
        int len = queries.length;
        for (int idx = 0; idx < len; idx++) {
            String q = queries[idx];
            if (dictSet.contains(q)) {
                result.add(q);
                continue;
            }
            boolean matched = false;
            char[] arr = q.toCharArray();
            int wordLen = arr.length;
            // 1 edit
            for (int i = 0; i < wordLen && !matched; i++) {
                char original = arr[i];
                for (char c = 'a'; c <= 'z'; c++) {
                    if (c == original) continue;
                    arr[i] = c;
                    String newWord = new String(arr);
                    if (dictSet.contains(newWord)) {
                        matched = true;
                        break;
                    }
                }
                arr[i] = original;
            }
            // 2 edits
            if (!matched) {
                for (int i = 0; i < wordLen - 1 && !matched; i++) {
                    char origI = arr[i];
                    for (int j = i + 1; j < wordLen && !matched; j++) {
                        char origJ = arr[j];
                        for (char c1 = 'a'; c1 <= 'z'; c1++) {
                            for (char c2 = 'a'; c2 <= 'z'; c2++) {
                                if (c1 == origI && c2 == origJ) continue; // no change
                                arr[i] = c1;
                                arr[j] = c2;
                                String newWord = new String(arr);
                                if (dictSet.contains(newWord)) {
                                    matched = true;
                                    break;
                                }
                            }
                            if (matched) break;
                        }
                        arr[i] = origI;
                        arr[j] = origJ;
                    }
                }
            }
            if (matched) {
                result.add(q);
            }
        }
        return result;
    }
}

