import java.util.HashMap;
import java.util.Map;

public class Solution {
    public boolean equalFrequency(String word) {
        int[] freq = new int[26];
        for (char c : word.toCharArray()) {
            freq[c - 'a']++;
        }

        Map<Integer, Integer> freqCount = new HashMap<>();
        for (int f : freq) {
            if (f > 0) {
                freqCount.merge(f, 1, Integer::sum);
            }
        }

        if (freqCount.size() == 1) {
            // All letters have the same frequency
            int onlyFreq = freqCount.keySet().iterator().next();
            return onlyFreq == 1;
        }

        if (freqCount.size() == 2) {
            int freq1 = 0, freq2 = 0, count1 = 0, count2 = 0;
            int i = 0;
            for (Map.Entry<Integer, Integer> entry : freqCount.entrySet()) {
                if (i == 0) {
                    freq1 = entry.getKey();
                    count1 = entry.getValue();
                } else {
                    freq2 = entry.getKey();
                    count2 = entry.getValue();
                }
                i++;
            }

            // Case 1: one frequency is 1 and only one letter has that frequency
            if ((freq1 == 1 && count1 == 1) || (freq2 == 1 && count2 == 1)) {
                return true;
            }

            // Case 2: the higher frequency is exactly one more than the lower frequency
            // and only one letter has the higher frequency
            if (Math.abs(freq1 - freq2) == 1) {
                if ((freq1 > freq2 && count1 == 1) || (freq2 > freq1 && count2 == 1)) {
                    return true;
                }
            }
        }

        return false;
    }
}

