import java.util.*;

public class Solution {
    public String[] splitMessage(String message, int limit) {
        int n = message.length();
        if (n == 0) return new String[0];
        int low = 1, high = n;
        int best = -1;
        while (low <= high) {
            int mid = (low + high) >>> 1;
            if (canSplit(mid, message, limit)) {
                best = mid;
                high = mid - 1;
            } else {
                low = mid + 1;
            }
        }
        if (best == -1) return new String[0];
        return buildParts(message, limit, best);
    }

    private boolean canSplit(int b, String message, int limit) {
        int n = message.length();
        int sum = 0;
        for (int i = 1; i < b; i++) {
            int suffixLen = 3 + digits(i) + digits(b);
            if (suffixLen > limit) return false;
            int contentLen = limit - suffixLen;
            sum += contentLen;
            if (sum > n) return false;
        }
        int suffixLenLast = 3 + digits(b) + digits(b);
        if (suffixLenLast > limit) return false;
        int contentLenLast = limit - suffixLenLast;
        int remaining = n - sum;
        if (remaining < 0) return false;
        return remaining <= contentLenLast;
    }

    private String[] buildParts(String message, int limit, int b) {
        String[] parts = new String[b];
        int idx = 0;
        for (int i = 1; i < b; i++) {
            int suffixLen = 3 + digits(i) + digits(b);
            int contentLen = limit - suffixLen;
            StringBuilder sb = new StringBuilder();
            sb.append(message, idx, idx + contentLen);
            sb.append('<').append(i).append('/').append(b).append('>');
            parts[i - 1] = sb.toString();
            idx += contentLen;
        }
        int suffixLenLast = 3 + digits(b) + digits(b);
        StringBuilder sb = new StringBuilder();
        sb.append(message, idx, message.length());
        sb.append('<').append(b).append('/').append(b).append('>');
        parts[b - 1] = sb.toString();
        return parts;
    }

    private int digits(int x) {
        int d = 0;
        do {
            d++;
            x /= 10;
        } while (x > 0);
        return d;
    }
}

