public class Solution {
    public int subarrayLCM(int[] nums, int k) {
        int n = nums.length;
        int count = 0;
        for (int i = 0; i < n; i++) {
            long lcm = 1;
            for (int j = i; j < n; j++) {
                long g = gcd(lcm, nums[j]);
                long temp = lcm / g;
                if (temp > k / nums[j]) { // would exceed k
                    break;
                }
                lcm = temp * nums[j];
                if (lcm == k) {
                    count++;
                }
                if (lcm > k || k % lcm != 0) {
                    break;
                }
            }
        }
        return count;
    }

    private long gcd(long a, long b) {
        while (b != 0) {
            long t = a % b;
            a = b;
            b = t;
        }
        return a;
    }
}

