import java.util.HashSet;
import java.util.Set;

public class Solution {
    public long maximumSubarraySum(int[] nums, int k) {
        if (nums == null || nums.length == 0 || k <= 0 || k > nums.length) {
            return 0;
        }

        long maxSum = Long.MIN_VALUE;
        boolean found = false;
        long currentSum = 0;
        int left = 0;
        Set<Integer> window = new HashSet<>();

        for (int right = 0; right < nums.length; right++) {
            int val = nums[right];

            // Remove elements until the current value is unique in the window
            while (window.contains(val)) {
                int leftVal = nums[left];
                window.remove(leftVal);
                currentSum -= leftVal;
                left++;
            }

            // Add the current element
            window.add(val);
            currentSum += val;

            // Ensure window size does not exceed k
            while (right - left + 1 > k) {
                int leftVal = nums[left];
                window.remove(leftVal);
                currentSum -= leftVal;
                left++;
            }

            // If window size equals k, update maximum sum
            if (right - left + 1 == k) {
                found = true;
                if (currentSum > maxSum) {
                    maxSum = currentSum;
                }
            }
        }

        return found ? maxSum : 0;
    }
}

