import java.util.PriorityQueue;
import java.util.Collections;

public class Solution {
    public int minimumDeviation(int[] nums) {
        // Convert all numbers to even by multiplying odd numbers by 2
        int minVal = Integer.MAX_VALUE;
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>(Collections.reverseOrder());

        for (int num : nums) {
            if ((num & 1) == 1) { // odd
                num <<= 1; // multiply by 2
            }
            maxHeap.offer(num);
            if (num < minVal) {
                minVal = num;
            }
        }

        int answer = Integer.MAX_VALUE;

        while (!maxHeap.isEmpty()) {
            int max = maxHeap.poll();
            // Update answer with current deviation
            answer = Math.min(answer, max - minVal);

            // If the current maximum is odd, we cannot reduce it further
            if ((max & 1) == 1) {
                break;
            }

            // Reduce the maximum by dividing by 2
            int reduced = max >> 1; // divide by 2
            maxHeap.offer(reduced);
            if (reduced < minVal) {
                minVal = reduced;
            }
        }

        return answer;
    }
}

