import java.util.ArrayDeque;

public class Solution {
    public int boxDelivering(int[][] boxes, int portsCount, int maxBoxes, int maxWeight) {
        int n = boxes.length;
        int[] port = new int[n + 1];
        int[] weight = new int[n + 1];
        for (int i = 1; i <= n; i++) {
            port[i] = boxes[i - 1][0];
            weight[i] = boxes[i - 1][1];
        }

        int[] diff = new int[n + 1];
        diff[0] = 0;
        for (int i = 1; i <= n; i++) {
            diff[i] = diff[i - 1] + (port[i] != port[i - 1] ? 1 : 0);
        }

        int[] prefW = new int[n + 1];
        prefW[0] = 0;
        for (int i = 1; i <= n; i++) {
            prefW[i] = prefW[i - 1] + weight[i];
        }

        int[] dp = new int[n + 1];
        dp[0] = 0;
        ArrayDeque<Integer> deque = new ArrayDeque<>();
        int left = 1;

        for (int i = 1; i <= n; i++) {
            int j = i - 1;
            int val = dp[j] - diff[j + 1];
            while (!deque.isEmpty()) {
                int last = deque.peekLast();
                int lastVal = dp[last] - diff[last + 1];
                if (val <= lastVal) {
                    deque.pollLast();
                } else {
                    break;
                }
            }
            deque.offerLast(j);

            while (left <= i && (i - left + 1 > maxBoxes || prefW[i] - prefW[left - 1] > maxWeight)) {
                left++;
            }

            while (!deque.isEmpty() && deque.peekFirst() < left - 1) {
                deque.pollFirst();
            }

            int minVal = dp[deque.peekFirst()] - diff[deque.peekFirst() + 1];
            dp[i] = minVal + diff[i] + 2;
        }

        return dp[n];
    }
}

