import java.util.*;

public class Solution {
    public String getSmallestString(int n, int k) {
        // The minimal sum with all 'a's is n (since 'a' = 1)
        // The maximal sum with all 'z's is 26 * n
        // We need to distribute the extra sum (k - n) from the end to keep the string lexicographically smallest.
        int remaining = k - n; // how much we need to add to the base string of all 'a's
        char[] result = new char[n];
        Arrays.fill(result, 'a'); // start with all 'a's

        for (int i = n - 1; i >= 0 && remaining > 0; i--) {
            int add = Math.min(25, remaining); // we can add at most 25 (from 'a' to 'z')
            result[i] = (char) ('a' + add);
            remaining -= add;
        }

        return new String(result);
    }
}

