import java.util.*;

public class Solution {
    public int getMaxGridHappiness(int m, int n, int introvertsCount, int extrovertsCount) {
        int maxMask = (int) Math.pow(3, n);
        int[][] introCountMask = new int[maxMask];
        int[][] extroCountMask = new int[maxMask];
        for (int mask = 0; mask < maxMask; mask++) {
            int temp = mask;
            int intro = 0, extro = 0;
            for (int i = 0; i < n; i++) {
                int val = temp % 3;
                temp /= 3;
                if (val == 1) intro++;
                else if (val == 2) extro++;
            }
            introCountMask[mask] = intro;
            extroCountMask[mask] = extro;
        }

        int[][][] happiness = new int[maxMask][maxMask][];
        for (int curMask = 0; curMask < maxMask; curMask++) {
            int[] cur = new int[n];
            int temp = curMask;
            for (int i = 0; i < n; i++) {
                cur[i] = temp % 3;
                temp /= 3;
            }
            for (int prevMask = 0; prevMask < maxMask; prevMask++) {
                int[] prev = new int[n];
                int t = prevMask;
                for (int i = 0; i < n; i++) {
                    prev[i] = t % 3;
                    t /= 3;
                }
                int total = 0;
                for (int j = 0; j < n; j++) {
                    int type = cur[j];
                    if (type == 0) continue;
                    int base = (type == 1) ? 120 : 40;
                    // up neighbor
                    if (prev[j] != 0) {
                        int neighborType = prev[j];
                        base += (type == 1) ? -30 : 20;
                        total += (neighborType == 1) ? -30 : 20;
                    }
                    // left neighbor
                    if (j > 0 && cur[j - 1] != 0) {
                        int neighborType = cur[j - 1];
                        base += (type == 1) ? -30 : 20;
                        total += (neighborType == 1) ? -30 : 20;
                    }
                    total += base;
                }
                happiness[curMask][prevMask] = total;
            }
        }

        int[][][][] dp = new int[m + 1][maxMask][introvertsCount + 1][extrovertsCount + 1];
        for (int i = 0; i <= m; i++)
            for (int j = 0; j < maxMask; j++)
                for (int k = 0; k <= introvertsCount; k++)
                    Arrays.fill(dp[i][j][k], -1);
        dp[0][0][0][0] = 0;

        for (int row = 0; row < m; row++) {
            for (int prevMask = 0; prevMask < maxMask; prevMask++) {
                for (int introUsed = 0; introUsed <= introvertsCount; introUsed++) {
                    for (int extroUsed = 0; extroUsed <= extrovertsCount; extroUsed++) {
                        int curVal = dp[row][prevMask][introUsed][extroUsed];
                        if (curVal < 0) continue;
                        for (int curMask = 0; curMask < maxMask; curMask++) {
                            int introRow = introCountMask[curMask];
                            int extroRow = extroCountMask[curMask];
                            if (introUsed + introRow > introvertsCount || extroUsed + extroRow > extrovertsCount)
                                continue;
                            int newVal = curVal + happiness[curMask][prevMask];
                            int &nextIntro = introUsed + introRow;
                            int &nextExtro = extroUsed + extroRow;
                            if (dp[row + 1][curMask][nextIntro][nextExtro] < newVal)
                                dp[row + 1][curMask][nextIntro][nextExtro] = newVal;
                        }
                    }
                }
            }
        }

        int ans = 0;
        for (int prevMask = 0; prevMask < maxMask; prevMask++) {
            ans = Math.max(ans, dp[m][prevMask][introvertsCount][extrovertsCount]);
        }
        return ans;
    }
}

