import java.util.*;

public class Solution {
    public boolean canDistribute(int[] nums, int[] quantity) {
        // Count occurrences of each unique number
        Map<Integer, Integer> freqMap = new HashMap<>();
        for (int num : nums) {
            freqMap.put(num, freqMap.getOrDefault(num, 0) + 1);
        }

        // Convert frequencies to array
        int[] counts = new int[freqMap.size()];
        int idx = 0;
        for (int val : freqMap.values()) {
            counts[idx++] = val;
        }

        // Quick checks
        int totalNums = nums.length;
        int totalQty = 0;
        for (int q : quantity) totalQty += q;
        if (totalNums != totalQty) return false;

        // Sort counts descending for better pruning
        Arrays.sort(counts);
        reverse(counts);

        // Sort quantity descending
        Arrays.sort(quantity);
        reverse(quantity);

        // Memoization map
        Map<String, Boolean> memo = new HashMap<>();

        return dfs(0, counts, quantity, memo);
    }

    private boolean dfs(int custIdx, int[] counts, int[] quantity, Map<String, Boolean> memo) {
        if (custIdx == quantity.length) return true;

        String key = buildKey(counts);
        if (memo.containsKey(key)) return memo.get(key);

        int need = quantity[custIdx];
        for (int i = 0; i < counts.length; i++) {
            if (counts[i] >= need) {
                counts[i] -= need;
                if (dfs(custIdx + 1, counts, quantity, memo)) {
                    counts[i] += need;
                    memo.put(key, true);
                    return true;
                }
                counts[i] += need;
            }
        }

        memo.put(key, false);
        return false;
    }

    private String buildKey(int[] arr) {
        StringBuilder sb = new StringBuilder();
        for (int v : arr) {
            sb.append(v).append('#');
        }
        return sb.toString();
    }

    private void reverse(int[] arr) {
        int i = 0, j = arr.length - 1;
        while (i < j) {
            int tmp = arr[i];
            arr[i] = arr[j];
            arr[j] = tmp;
            i++;
            j--;
        }
    }
}

