import java.util.Arrays;

public class Solution {
    public int minimumIncompatibility(int[] nums, int k) {
        int n = nums.length;
        if (n % k != 0) return -1;
        int subsetSize = n / k;

        // Check frequency constraint
        int[] freq = new int[31];
        for (int num : nums) {
            if (++freq[num] > k) return -1;
        }

        int totalMasks = 1 << n;
        int[] subsetIncompat = new int[totalMasks];
        Arrays.fill(subsetIncompat, -1);

        // Precompute incompatibility for valid subsets of size subsetSize
        for (int mask = 0; mask < totalMasks; mask++) {
            if (Integer.bitCount(mask) != subsetSize) continue;
            int minVal = Integer.MAX_VALUE;
            int maxVal = Integer.MIN_VALUE;
            int valMask = 0;
            boolean valid = true;
            for (int i = 0; i < n; i++) {
                if ((mask & (1 << i)) != 0) {
                    int val = nums[i];
                    if ((valMask & (1 << val)) != 0) {
                        valid = false;
                        break;
                    }
                    valMask |= 1 << val;
                    if (val < minVal) minVal = val;
                    if (val > maxVal) maxVal = val;
                }
            }
            if (valid) {
                subsetIncompat[mask] = maxVal - minVal;
            }
        }

        int INF = Integer.MAX_VALUE / 2;
        int[] dp = new int[totalMasks];
        Arrays.fill(dp, INF);
        dp[0] = 0;

        for (int mask = 0; mask < totalMasks; mask++) {
            if (dp[mask] == INF) continue;
            int remaining = (~mask) & (totalMasks - 1);
            // iterate over submasks of remaining
            for (int sub = remaining; sub > 0; sub = (sub - 1) & remaining) {
                if (Integer.bitCount(sub) != subsetSize) continue;
                int incompat = subsetIncompat[sub];
                if (incompat == -1) continue;
                int newMask = mask | sub;
                int newVal = dp[mask] + incompat;
                if (newVal < dp[newMask]) dp[newMask] = newVal;
            }
        }

        int fullMask = totalMasks - 1;
        return dp[fullMask] == INF ? -1 : dp[fullMask];
    }
}

