import java.util.*;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int createSortedArray(int[] instructions) {
        int n = instructions.length;
        // Coordinate compression
        int[] sorted = instructions.clone();
        Arrays.sort(sorted);
        int m = 0;
        for (int i = 0; i < n; i++) {
            if (i == 0 || sorted[i] != sorted[i - 1]) {
                sorted[m++] = sorted[i];
            }
        }
        int[] comp = Arrays.copyOf(sorted, m);
        Map<Integer, Integer> map = new HashMap<>(m * 2);
        for (int i = 0; i < m; i++) {
            map.put(comp[i], i + 1); // 1-based index for BIT
        }

        BIT bit = new BIT(m);
        long result = 0;
        for (int i = 0; i < n; i++) {
            int idx = map.get(instructions[i]);
            long less = bit.query(idx - 1);
            long equal = bit.query(idx) - less;
            long greater = i - less - equal;
            result += Math.min(less, greater);
            result %= MOD;
            bit.update(idx, 1);
        }
        return (int) result;
    }

    // Binary Indexed Tree (Fenwick Tree)
    private static class BIT {
        private final long[] tree;
        private final int size;

        BIT(int size) {
            this.size = size;
            this.tree = new long[size + 2];
        }

        void update(int index, long delta) {
            for (int i = index; i <= size; i += i & -i) {
                tree[i] += delta;
            }
        }

        long query(int index) {
            long sum = 0;
            for (int i = index; i > 0; i -= i & -i) {
                sum += tree[i];
            }
            return sum;
        }
    }
}

