import java.math.BigInteger;

public class Solution {
    public String kthSmallestPath(int[] destination, int k) {
        int rows = destination[0];
        int cols = destination[1];
        int total = rows + cols;

        // Precompute binomial coefficients using Pascal's triangle
        BigInteger[][] comb = new BigInteger[total + 1][total + 1];
        for (int i = 0; i <= total; i++) {
            comb[i][0] = BigInteger.ONE;
            comb[i][i] = BigInteger.ONE;
            for (int j = 1; j < i; j++) {
                comb[i][j] = comb[i - 1][j - 1].add(comb[i - 1][j]);
            }
        }

        StringBuilder sb = new StringBuilder();
        int r = rows;
        int c = cols;
        BigInteger bigK = BigInteger.valueOf(k);

        while (r > 0 || c > 0) {
            if (c == 0) { // only V moves left
                sb.append('V');
                r--;
                continue;
            }
            if (r == 0) { // only H moves left
                sb.append('H');
                c--;
                continue;
            }

            // Number of paths if we choose 'H' now
            BigInteger countH = comb[r + c - 1][r];

            if (bigK.compareTo(countH) <= 0) {
                sb.append('H');
                c--;
            } else {
                sb.append('V');
                bigK = bigK.subtract(countH);
                r--;
            }
        }

        return sb.toString();
    }
}

