public class Solution {
    public int countSubstrings(String s, String t) {
        int n = s.length();
        int m = t.length();
        int[][] dp0 = new int[n + 1][m + 1]; // exact match
        int[][] dp1 = new int[n + 1][m + 1]; // at most one mismatch

        // Build dp0 and dp1 from the end
        for (int i = n - 1; i >= 0; i--) {
            for (int j = m - 1; j >= 0; j--) {
                if (s.charAt(i) == t.charAt(j)) {
                    dp0[i][j] = 1 + dp0[i + 1][j + 1];
                    dp1[i][j] = 1 + dp1[i + 1][j + 1];
                } else {
                    dp0[i][j] = 0;
                    dp1[i][j] = 1 + dp0[i + 1][j + 1];
                }
            }
        }

        int result = 0;
        // For each start position in s
        for (int i = 0; i < n; i++) {
            boolean[] seen = new boolean[n - i + 1]; // index by length
            for (int j = 0; j < m; j++) {
                int l0 = dp0[i][j];
                int l1 = dp1[i][j];
                // Mark lengths that have exactly one mismatch
                for (int len = l0 + 1; len <= l1; len++) {
                    seen[len] = true;
                }
            }
            for (int len = 1; len <= n - i; len++) {
                if (seen[len]) result++;
            }
        }
        return result;
    }
}

