import java.util.*;

public class Solution {
    public int[][] matrixRankTransform(int[][] matrix) {
        int m = matrix.length;
        int n = matrix[0].length;
        int[][] ans = new int[m][n];

        // Map value to list of positions
        Map<Integer, List<int[]>> map = new TreeMap<>();
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                map.computeIfAbsent(matrix[i][j], k -> new ArrayList<>()).add(new int[]{i, j});
            }
        }

        int total = m * n;
        DSU dsu = new DSU(total);
        int[] rowRank = new int[m];
        int[] colRank = new int[n];

        for (Map.Entry<Integer, List<int[]>> entry : map.entrySet()) {
            List<int[]> cells = entry.getValue();

            // Union cells with same value in same row or column
            Map<Integer, Integer> rowLast = new HashMap<>();
            Map<Integer, Integer> colLast = new HashMap<>();

            for (int[] cell : cells) {
                int i = cell[0];
                int j = cell[1];
                int idx = i * n + j;

                if (rowLast.containsKey(i)) {
                    dsu.union(idx, rowLast.get(i));
                }
                rowLast.put(i, idx);

                if (colLast.containsKey(j)) {
                    dsu.union(idx, colLast.get(j));
                }
                colLast.put(j, idx);
            }

            // Compute rank for each component
            Map<Integer, Integer> compMaxRank = new HashMap<>();
            for (int[] cell : cells) {
                int i = cell[0];
                int j = cell[1];
                int idx = i * n + j;
                int root = dsu.find(idx);
                int rank = Math.max(rowRank[i], colRank[j]) + 1;
                compMaxRank.put(root, Math.max(compMaxRank.getOrDefault(root, 0), rank));
            }

            // Assign ranks and update row/col ranks
            for (int[] cell : cells) {
                int i = cell[0];
                int j = cell[1];
                int idx = i * n + j;
                int root = dsu.find(idx);
                int rank = compMaxRank.get(root);
                ans[i][j] = rank;
                rowRank[i] = rank;
                colRank[j] = rank;
            }
        }

        return ans;
    }

    // Disjoint Set Union (Union-Find) with path compression and union by rank
    private static class DSU {
        int[] parent;
        int[] rank;

        DSU(int n) {
            parent = new int[n];
            rank = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                rank[i] = 0;
            }
        }

        int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        void union(int x, int y) {
            int rx = find(x);
            int ry = find(y);
            if (rx == ry) return;
            if (rank[rx] < rank[ry]) {
                parent[rx] = ry;
            } else if (rank[rx] > rank[ry]) {
                parent[ry] = rx;
            } else {
                parent[ry] = rx;
                rank[rx]++;
            }
        }
    }
}

