import java.util.ArrayList;
import java.util.List;

public class Solution {
    private static class DSU {
        int[] parent;
        int[] size;

        DSU(int n) {
            parent = new int[n + 1];
            size = new int[n + 1];
            for (int i = 1; i <= n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        void union(int a, int b) {
            int pa = find(a);
            int pb = find(b);
            if (pa == pb) return;
            if (size[pa] < size[pb]) {
                int tmp = pa;
                pa = pb;
                pb = tmp;
            }
            parent[pb] = pa;
            size[pa] += size[pb];
        }
    }

    public List<Boolean> areConnected(int n, int threshold, int[][] queries) {
        DSU dsu = new DSU(n);
        if (threshold < n) {
            for (int d = threshold + 1; d <= n; d++) {
                int first = d;
                for (int multiple = 2 * d; multiple <= n; multiple += d) {
                    dsu.union(first, multiple);
                }
            }
        }
        List<Boolean> result = new ArrayList<>(queries.length);
        for (int[] q : queries) {
            int a = q[0];
            int b = q[1];
            result.add(dsu.find(a) == dsu.find(b));
        }
        return result;
    }
}

