public class Solution {
    private static final int MOD = 1_000_000_007;

    public int numWays(String[] words, String target) {
        int n = words[0].length();          // length of each word
        int m = target.length();            // length of target

        // freq[i][c] = number of words that have character (c+'a') at position i
        int[][] freq = new int[n][26];
        for (String word : words) {
            for (int i = 0; i < n; i++) {
                freq[i][word.charAt(i) - 'a']++;
            }
        }

        int[] dp = new int[m + 1];
        dp[0] = 1; // empty target

        for (int i = 0; i < n; i++) {
            // iterate target positions from end to start to avoid overwriting needed values
            for (int j = m - 1; j >= 0; j--) {
                int cIdx = target.charAt(j) - 'a';
                int count = freq[i][cIdx];
                if (count == 0) continue;
                dp[j + 1] = (int) ((dp[j + 1] + (long) dp[j] * count) % MOD);
            }
        }

        return dp[m];
    }
}

