import java.util.*;

public class Solution {
    public int[] countSubgraphsForEachDiameter(int n, int[][] edges) {
        // Build adjacency list
        List<Integer>[] adj = new ArrayList[n];
        for (int i = 0; i < n; i++) adj[i] = new ArrayList<>();
        for (int[] e : edges) {
            int u = e[0] - 1;
            int v = e[1] - 1;
            adj[u].add(v);
            adj[v].add(u);
        }

        int totalMasks = 1 << n;
        int[] result = new int[n - 1];

        // Precompute list of nodes for each mask to speed up
        int[][] nodesInMask = new int[totalMasks][];
        for (int mask = 1; mask < totalMasks; mask++) {
            int cnt = Integer.bitCount(mask);
            int[] arr = new int[cnt];
            int idx = 0;
            for (int v = 0; v < n; v++) {
                if ((mask & (1 << v)) != 0) arr[idx++] = v;
            }
            nodesInMask[mask] = arr;
        }

        // For each subset
        for (int mask = 1; mask < totalMasks; mask++) {
            int size = Integer.bitCount(mask);
            if (size <= 1) continue; // diameter 0 not counted

            int[] nodes = nodesInMask[mask];

            // Check connectivity
            boolean[] visited = new boolean[n];
            Queue<Integer> q = new ArrayDeque<>();
            int start = nodes[0];
            visited[start] = true;
            q.add(start);
            int visitedCount = 1;
            while (!q.isEmpty()) {
                int u = q.poll();
                for (int v : adj[u]) {
                    if (!visited[v] && (mask & (1 << v)) != 0) {
                        visited[v] = true;
                        q.add(v);
                        visitedCount++;
                    }
                }
            }
            if (visitedCount != size) continue; // not connected

            // Compute diameter using two BFS
            int farNode = bfs(start, mask, adj, n);
            int diameter = bfs(farNode, mask, adj, n);
            if (diameter >= 1 && diameter <= n - 1) {
                result[diameter - 1]++;
            }
        }

        return result;
    }

    private int bfs(int src, int mask, List<Integer>[] adj, int n) {
        int[] dist = new int[n];
        Arrays.fill(dist, -1);
        Queue<Integer> q = new ArrayDeque<>();
        dist[src] = 0;
        q.add(src);
        int farNode = src;
        while (!q.isEmpty()) {
            int u = q.poll();
            for (int v : adj[u]) {
                if (dist[v] == -1 && (mask & (1 << v)) != 0) {
                    dist[v] = dist[u] + 1;
                    q.add(v);
                    if (dist[v] > dist[farNode]) farNode = v;
                }
            }
        }
        return dist[farNode];
    }
}

