public class Solution {
    public int[] getSumAbsoluteDifferences(int[] nums) {
        int n = nums.length;
        int[] result = new int[n];
        long[] prefix = new long[n];
        prefix[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefix[i] = prefix[i - 1] + nums[i];
        }
        for (int i = 0; i < n; i++) {
            long leftSum = i > 0 ? prefix[i - 1] : 0;
            long rightSum = prefix[n - 1] - prefix[i];
            long leftCount = i;
            long rightCount = n - 1 - i;
            long leftDiff = (long) nums[i] * leftCount - leftSum;
            long rightDiff = rightSum - (long) nums[i] * rightCount;
            result[i] = (int) (leftDiff + rightDiff);
        }
        return result;
    }
}

