import java.util.HashSet;
import java.util.Set;

public class Solution {
    public int minDeletions(String s) {
        int[] freq = new int[26];
        for (char c : s.toCharArray()) {
            freq[c - 'a']++;
        }

        // Collect non-zero frequencies
        int[] counts = new int[26];
        int idx = 0;
        for (int f : freq) {
            if (f > 0) {
                counts[idx++] = f;
            }
        }

        // Sort frequencies in descending order
        java.util.Arrays.sort(counts, 0, idx);
        for (int i = 0; i < idx / 2; i++) {
            int temp = counts[i];
            counts[i] = counts[idx - 1 - i];
            counts[idx - 1 - i] = temp;
        }

        Set<Integer> used = new HashSet<>();
        int deletions = 0;

        for (int i = 0; i < idx; i++) {
            int f = counts[i];
            while (f > 0 && used.contains(f)) {
                f--;
                deletions++;
            }
            if (f > 0) {
                used.add(f);
            }
        }

        return deletions;
    }
}

