public class Solution {
    public ListNode mergeInBetween(ListNode list1, int a, int b, ListNode list2) {
        // Find node just before index a
        ListNode prevA = null;
        ListNode curr = list1;
        int idx = 0;
        while (idx < a) {
            if (idx == a - 1) {
                prevA = curr;
            }
            curr = curr.next;
            idx++;
        }

        // Find node just after index b
        ListNode nextB = curr.next; // curr is at index b

        // Connect list2 into the gap
        if (prevA != null) {
            prevA.next = list2;
        } else {
            // a == 0, replace head
            list1 = list2;
        }

        // Find tail of list2
        ListNode tail = list2;
        while (tail.next != null) {
            tail = tail.next;
        }

        // Connect tail to nextB
        tail.next = nextB;

        return list1;
    }
}

