import java.util.ArrayDeque;
import java.util.HashSet;
import java.util.Queue;

public class Solution {
    public String smallestString(String s, int a, int b) {
        int n = s.length();
        int rot = b % n;
        int add = a % 10;
        String start = s;
        Queue<String> q = new ArrayDeque<>();
        HashSet<String> seen = new HashSet<>();
        q.add(start);
        seen.add(start);
        String best = start;

        while (!q.isEmpty()) {
            String cur = q.poll();
            if (cur.compareTo(best) < 0) {
                best = cur;
            }

            // Operation 1: add to odd indices
            StringBuilder sbAdd = new StringBuilder(cur);
            for (int i = 1; i < n; i += 2) {
                int digit = sbAdd.charAt(i) - '0';
                digit = (digit + add) % 10;
                sbAdd.setCharAt(i, (char) ('0' + digit));
            }
            String nextAdd = sbAdd.toString();
            if (seen.add(nextAdd)) {
                q.add(nextAdd);
            }

            // Operation 2: rotate right by rot positions
            if (rot != 0) {
                String rotated = cur.substring(n - rot) + cur.substring(0, n - rot);
                if (seen.add(rotated)) {
                    q.add(rotated);
                }
            }
        }

        return best;
    }
}

