import java.util.List;

public class Solution {
    public int visiblePoints(List<List<Integer>> points, int angle, List<Integer> location) {
        int n = points.size();
        if (n == 0) return 0;
        if (angle >= 360) return n;

        int base = 0; // points at the same location
        double[] angles = new double[n];
        int idx = 0;
        int px = location.get(0);
        int py = location.get(1);

        for (List<Integer> p : points) {
            int x = p.get(0);
            int y = p.get(1);
            if (x == px && y == py) {
                base++;
            } else {
                double ang = Math.toDegrees(Math.atan2(y - py, x - px));
                if (ang < 0) ang += 360.0;
                angles[idx++] = ang;
            }
        }

        int m = idx; // number of distinct angles
        if (m == 0) return base;

        double[] sorted = new double[m];
        System.arraycopy(angles, 0, sorted, 0, m);
        java.util.Arrays.sort(sorted);

        double[] extended = new double[2 * m];
        for (int i = 0; i < m; i++) {
            extended[i] = sorted[i];
            extended[i + m] = sorted[i] + 360.0;
        }

        int maxVisible = 0;
        int j = 0;
        for (int i = 0; i < m; i++) {
            while (j < i + m && extended[j] - extended[i] <= angle + 1e-9) {
                j++;
            }
            int count = j - i;
            if (count > maxVisible) maxVisible = count;
        }

        return base + maxVisible;
    }
}

