public class Solution {
    public int[] decrypt(int[] code, int k) {
        int n = code.length;
        int[] result = new int[n];
        if (k == 0) {
            // All zeros
            return result;
        }
        if (k > 0) {
            int sum = 0;
            // initial window: next k elements after index 0
            for (int i = 1; i <= k; i++) {
                sum += code[i % n];
            }
            for (int i = 0; i < n; i++) {
                result[i] = sum;
                // slide window
                int leaving = code[(i + 1) % n];
                int entering = code[(i + k + 1) % n];
                sum = sum - leaving + entering;
            }
        } else { // k < 0
            int m = -k;
            int sum = 0;
            // initial window: previous m elements before index 0
            for (int i = n - m; i < n; i++) {
                sum += code[i];
            }
            for (int i = 0; i < n; i++) {
                result[i] = sum;
                // slide window
                int leaving = code[(i - m + n) % n];
                int entering = code[i % n];
                sum = sum - leaving + entering;
            }
        }
        return result;
    }
}

