        for (int i = 0; i < 26; i++) {
            if ((freq1[i] == 0) != (freq2[i] == 0)) {
                return false;
            }
        }

        // Collect non-zero frequencies
        int[] counts1 = new int[26];
        int[] counts2 = new int[26];
