public class Solution {

    // Helper class to represent a state: current position and whether the last jump was backward
    static class Pair {
        int pos;
        boolean lastBack;

        Pair(int i, boolean b) {
            this.pos = i;
            this.lastBack = b;
        }
    }

    public int minimumJumps(int[] forbidden, int a, int b, int x) {
        Set<Integer> forbiddenSet = new HashSet<>();
        int maxForbidden = 0;
        for (int f : forbidden) {
            forbiddenSet.add(f);
            if (f > maxForbidden) maxForbidden = f;
        }

        // Upper bound to prevent infinite exploration
        int upperBound = Math.max(x, maxForbidden) + a + b + 1000;

        Queue<Pair> queue = new LinkedList<>();
        queue.offer(new Pair(0, false));

        Set<String> visited = new HashSet<>();
        visited.add(0 + "," + false);

        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                Pair cur = queue.poll();
                int pos = cur.pos;
                boolean lastBack = cur.lastBack;

                if (pos == x) return steps;

                // Jump forward
                int next = pos + a;
                if (next <= upperBound && !forbiddenSet.contains(next)
                        && !visited.contains(next + "," + false)) {
                    visited.add(next + "," + false);
                    queue.offer(new Pair(next, false));
                }

                // Jump backward (only if last jump was not backward)
                if (!lastBack) {
                    int nextBack = pos - b;
                    if (nextBack >= 0 && !forbiddenSet.contains(nextBack)
                            && !visited.contains(nextBack + "," + true)) {
                        visited.add(nextBack + "," + true);
                        queue.offer(new Pair(nextBack, true));
                    }
                }
            }
            steps++;
        }
        return -1;
    }
}

