public class Solution {
    public int waysToMakeFair(int[] nums) {
        int n = nums.length;
        long totalEven = 0, totalOdd = 0;
        for (int i = 0; i < n; i++) {
            if ((i & 1) == 0) totalEven += nums[i];
            else totalOdd += nums[i];
        }

        long prefixEven = 0, prefixOdd = 0;
        int count = 0;

        for (int i = 0; i < n; i++) {
            int val = nums[i];
            if ((i & 1) == 0) prefixEven += val;
            else prefixOdd += val;

            long sumEvenBefore = prefixEven - ((i & 1) == 0 ? val : 0);
            long sumOddBefore = prefixOdd - ((i & 1) == 1 ? val : 0);
            long sumEvenAfter = totalEven - prefixEven;
            long sumOddAfter = totalOdd - prefixOdd;

            long newEven = sumEvenBefore + sumOddAfter;
            long newOdd = sumOddBefore + sumEvenAfter;

            if (newEven == newOdd) count++;
        }

        return count;
    }
}

