public class Solution {
    public int minimumMountainRemovals(int[] nums) {
        int n = nums.length;
        if (n < 3) return 0;
        int[] lis = new int[n];
        int[] lds = new int[n];
        Arrays.fill(lis, 1);
        Arrays.fill(lds, 1);
        // Longest increasing subsequence ending at i
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < i; j++) {
                if (nums[j] < nums[i]) {
                    lis[i] = Math.max(lis[i], lis[j] + 1);
                }
            }
        }
        // Longest decreasing subsequence starting at i
        for (int i = n - 1; i >= 0; i--) {
            for (int j = i + 1; j < n; j++) {
                if (nums[j] < nums[i]) {
                    lds[i] = Math.max(lds[i], lds[j] + 1);
                }
            }
        }
        int maxLen = 0;
        for (int i = 0; i < n; i++) {
            if (lis[i] > 1 && lds[i] > 1) {
                maxLen = Math.max(maxLen, lis[i] + lds[i] - 1);
            }
        }
        if (maxLen < 3) return 0;
        return n - maxLen;
    }
}

