import java.util.TreeSet;

public class Solution {

    private static class Server {
        int id;
        int finishTime;

        Server(int id, int finishTime) {
            this.id = id;
            this.finishTime = finishTime;
        }
    }

    public List<Integer> busiestServers(int k, int[] arrival, int[] load) {
        int n = arrival.length;
        int[] count = new int[k];

        TreeSet<Integer> available = new TreeSet<>();
        for (int i = 0; i < k; i++) {
            available.add(i);
        }

        PriorityQueue<Server> busy = new PriorityQueue<>((a, b) -> Integer.compare(a.finishTime, b.finishTime));

        for (int i = 0; i < n; i++) {
            int curTime = arrival[i];

            // Release servers that have finished by curTime
            while (!busy.isEmpty() && busy.peek().finishTime <= curTime) {
                available.add(busy.poll().id);
            }

            if (available.isEmpty()) {
                continue; // request dropped
            }

            int startServer = i % k;
            Integer serverId = available.ceiling(startServer);
            if (serverId == null) {
                serverId = available.first();
            }

            available.remove(serverId);
            count[serverId]++;
            busy.offer(new Server(serverId, curTime + load[i]));
        }

        int max = 0;
        for (int c : count) {
            if (c > max) {
                max = c;
            }
        }

        List<Integer> result = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            if (count[i] == max) {
                result.add(i);
            }
        }
        return result;
    }
}

