public class Solution {
    public int minimumEffort(int[][] tasks) {
        if (tasks == null || tasks.length == 0) {
            return 0;
        }

        // Sort by decreasing minimum, then by increasing actual for ties
        Arrays.sort(tasks, new Comparator<int[]>() {
            @Override
            public int compare(int[] a, int[] b) {
                if (a[1] != b[1]) {
                    return Integer.compare(b[1], a[1]); // descending minimum
                }
                return Integer.compare(a[0], b[0]); // ascending actual
            }
        });

        long required = 0;
        long current = 0;

        for (int[] task : tasks) {
            int actual = task[0];
            int minimum = task[1];

            if (current < minimum) {
                long delta = (long) minimum - current;
                required += delta;
                current = minimum;
            }
            current -= actual;
        }

        return (int) required;
    }
}

