public class Solution {
    public int numberOfSets(int n, int k) {
        final long MOD = 1_000_000_007L;
        long[][] dp = new long[n + 1][k + 1];
        long[][] diff = new long[k + 1][n + 2]; // diff[cnt][pos]
        long[] curAdd = new long[k + 1];

        dp[0][0] = 1;

        for (int pos = 0; pos < n; pos++) {
            for (int cnt = 0; cnt <= k; cnt++) {
                curAdd[cnt] = (curAdd[cnt] + diff[cnt][pos]) % MOD;
                long ways = (dp[pos][cnt] + curAdd[cnt]) % MOD;

                // Do not start a segment at pos
                dp[pos + 1][cnt] = (dp[pos + 1][cnt] + ways) % MOD;

                // Start a segment at pos
                if (cnt < k && pos + 2 <= n) {
                    long val = ways;
                    diff[cnt + 1][pos + 2] = (diff[cnt + 1][pos + 2] + val) % MOD;
                    diff[cnt + 1][n + 1] = (diff[cnt + 1][n + 1] - val + MOD) % MOD;
                }
            }
        }

        // Process the final position n
        for (int cnt = 0; cnt <= k; cnt++) {
            curAdd[cnt] = (curAdd[cnt] + diff[cnt][n]) % MOD;
            dp[n][cnt] = (dp[n][cnt] + curAdd[cnt]) % MOD;
        }

        return (int) (dp[n][k] % MOD);
    }
}

