public class Solution {

    private static class DSU {
        private final int[] parent;
        private final int[] size;

        DSU(int n) {
            parent = new int[n];
            size = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        void union(int a, int b) {
            int pa = find(a);
            int pb = find(b);
            if (pa == pb) return;
            if (size[pa] < size[pb]) {
                parent[pa] = pb;
                size[pb] += size[pa];
            } else {
                parent[pb] = pa;
                size[pa] += size[pb];
            }
        }
    }

    private static class Query {
        int p, q, limit, idx;

        Query(int p, int q, int limit, int idx) {
            this.p = p;
            this.q = q;
            this.limit = limit;
            this.idx = idx;
        }
    }

    public boolean[] distanceLimitedPathsExist(int n, int[][] edgeList, int[][] queries) {
        Arrays.sort(edgeList, Comparator.comparingInt(a -> a[2]));

        int m = queries.length;
        Query[] qs = new Query[m];
        for (int i = 0; i < m; i++) {
            qs[i] = new Query(queries[i][0], queries[i][1], queries[i][2], i);
        }
        Arrays.sort(qs, Comparator.comparingInt(q -> q.limit));

        DSU dsu = new DSU(n);
        boolean[] ans = new boolean[m];
        int eIdx = 0;

        for (Query q : qs) {
            while (eIdx < edgeList.length && edgeList[eIdx][2] < q.limit) {
                dsu.union(edgeList[eIdx][0], edgeList[eIdx][1]);
                eIdx++;
            }
            ans[q.idx] = dsu.find(q.p) == dsu.find(q.q);
        }

        return ans;
    }
}

