    public int countConsistentStrings(String allowed, String[] words) {
        boolean[] allowedSet = new boolean[26];
        for (char c : allowed.toCharArray()) {
            allowedSet[c - 'a'] = true;
        }

        int count = 0;
        for (String word : words) {
            boolean ok = true;
            for (char c : word.toCharArray()) {
                if (!allowedSet[c - 'a']) {
                    ok = false;
                    break;
                }
            }
            if (ok) {
                count++;
            }
        }
        return count;
    }
}

