import java.util.Arrays;

public class Solution {
    private static final long MOD = 1_000_000_007L;

    public int maxProfit(int[] inventory, int orders) {
        Arrays.sort(inventory);
        long total = 0;
        int n = inventory.length;
        int idx = n - 1;

        while (orders > 0 && idx >= 0) {
            long current = inventory[idx];
            long next = (idx > 0) ? inventory[idx - 1] : 0;
            long diff = current - next;
            long count = idx + 1; // number of colors at this level or higher

            if (diff == 0) {
                idx--;
                continue;
            }

            long possible = diff * count;
            if (orders >= possible) {
                // sell all levels down to next
                long sum = (current + next + 1) * diff / 2; // sum of one color
                total = (total + sum % MOD * (count % MOD)) % MOD;
                orders -= possible;
                idx--;
            } else {
                // sell only part of the levels
                long full = orders / count; // full levels to sell
                long rem = orders % count;  // remaining balls

                if (full > 0) {
                    long sumFull = (current + (current - full + 1)) * full / 2;
                    total = (total + sumFull % MOD * (count % MOD)) % MOD;
                }

                long valueAfterFull = current - full;
                total = (total + (valueAfterFull % MOD) * (rem % MOD)) % MOD;

                orders = 0;
            }
        }

        return (int) total;
    }
}

