        int maxDuration = -1;
        char bestKey = '\0';
        for (int i = 0; i < releaseTimes.length; i++) {
            int duration = (i == 0) ? releaseTimes[0] : releaseTimes[i] - releaseTimes[i - 1];
            char currentKey = keysPressed.charAt(i);
