public class Solution {
    public String reformatNumber(String number) {
        // Remove spaces and dashes
        StringBuilder cleaned = new StringBuilder();
        for (int i = 0; i < number.length(); i++) {
            char c = number.charAt(i);
            if (Character.isDigit(c)) {
                cleaned.append(c);
            }
        }

        int n = cleaned.length();
        StringBuilder result = new StringBuilder();
        int i = 0;

        // Group into blocks of 3 until 4 or fewer digits remain
        while (n - i > 4) {
            if (result.length() > 0) {
                result.append('-');
            }
            result.append(cleaned, i, i + 3);
            i += 3;
        }

        int remaining = n - i;
        if (remaining == 2 || remaining == 3) {
            if (result.length() > 0) {
                result.append('-');
            }
            result.append(cleaned, i, n);
        } else if (remaining == 4) {
            if (result.length() > 0) {
                result.append('-');
            }
            result.append(cleaned, i, i + 2);
            result.append('-');
            result.append(cleaned, i + 2, i + 4);
        } else if (remaining == 1) {
            // Adjust to avoid a single-digit block
            // Take one digit from the previous block of 3
            // This case occurs only when the original length is 1
            if (result.length() > 0) {
                // Remove the last '-' and the last block of 3
                int lastDash = result.lastIndexOf("-");
                if (lastDash != -1) {
                    result.setLength(lastDash);
                } else {
                    result.setLength(0);
                }
                // Append two blocks of 2
                result.append(cleaned, i, i + 2);
                result.append('-');
                result.append(cleaned, i + 2, i + 3);
            } else {
                // No previous block, just return the single digit
                result.append(cleaned, i, n);
            }
        }

        return result.toString();
    }
}

