public class Solution {
    public int minMoves(int[] nums, int limit) {
        int n = nums.length;
        int maxSum = 2 * limit;
        int[] diff = new int[maxSum + 3]; // +3 to avoid index overflow

        for (int i = 0; i < n / 2; i++) {
            int a = nums[i];
            int b = nums[n - 1 - i];
            int low = Math.min(a, b) + 1;
            int high = Math.max(a, b) + limit;
            int sum = a + b;

            // Base case: assume 2 moves for all sums
            diff[2] += 2;

            // 1 move range
            diff[low] -= 1;
            diff[high + 1] += 1;

            // 0 move case
            diff[sum] += 1;
            diff[sum + 1] -= 1;
        }

        int minMoves = Integer.MAX_VALUE;
        int cur = 0;
        for (int s = 2; s <= maxSum; s++) {
            cur += diff[s];
            if (cur < minMoves) {
                minMoves = cur;
            }
        }
        return minMoves;
    }
}

