import java.util.HashMap;
import java.util.Map;

public class Solution {
    // Preprocess stickers into character count arrays
    private int[][] stickerCounts;
    private int n;
    private static final int INF = 1 << 30;

    public int minStickers(String[] stickers, String target) {
        n = stickers.length;
        stickerCounts = new int[n][26];
        for (int i = 0; i < n; i++) {
            for (char c : stickers[i].toCharArray()) {
                stickerCounts[i][c - 'a']++;
            }
        }
        Map<String, Integer> memo = new HashMap<>();
        int res = dfs(target, memo);
        return res == INF ? -1 : res;
    }

    private int dfs(String target, Map<String, Integer> memo) {
        if (target.isEmpty()) return 0;
        if (memo.containsKey(target)) return memo.get(target);

        int[] targetCount = new int[26];
        for (char c : target.toCharArray()) targetCount[c - 'a']++;

        int min = INF;
        // Try each sticker
        for (int i = 0; i < n; i++) {
            // Skip stickers that don't contain the first character of target
            if (stickerCounts[i][target.charAt(0) - 'a'] == 0) continue;

            // Build new remaining string after using this sticker
            StringBuilder sb = new StringBuilder();
            for (int j = 0; j < 26; j++) {
                int remaining = targetCount[j] - stickerCounts[i][j];
                for (int k = 0; k < Math.max(0, remaining); k++) {
                    sb.append((char) (j + 'a'));
                }
            }
            String newTarget = sb.toString();
            int sub = dfs(newTarget, memo);
            if (sub != INF) {
                min = Math.min(min, 1 + sub);
            }
        }

        memo.put(target, min);
        return min;
    }
}

