import java.util.*;

public class Solution {
    public int[] maxSumOfThreeSubarrays(int[] nums, int k) {
        int n = nums.length;
        int m = n - k + 1; // number of subarrays of length k
        int[] sums = new int[m];
        int windowSum = 0;
        for (int i = 0; i < k; i++) windowSum += nums[i];
        sums[0] = windowSum;
        for (int i = 1; i < m; i++) {
            windowSum += nums[i + k - 1] - nums[i - 1];
            sums[i] = windowSum;
        }

        // best left index up to i
        int[] left = new int[m];
        int best = 0;
        for (int i = 0; i < m; i++) {
            if (sums[i] > sums[best]) {
                best = i;
            }
            left[i] = best;
        }

        // best right index from i to end
        int[] right = new int[m];
        best = m - 1;
        for (int i = m - 1; i >= 0; i--) {
            if (sums[i] >= sums[best]) { // >= to keep smaller index on tie
                best = i;
            }
            right[i] = best;
        }

        int[] ans = new int[3];
        int maxSum = -1;
        for (int mid = k; mid <= m - k - 1; mid++) {
            int leftIdx = left[mid - k];
            int rightIdx = right[mid + k];
            int total = sums[leftIdx] + sums[mid] + sums[rightIdx];
            if (total > maxSum ||
                (total == maxSum && (leftIdx < ans[0] ||
                                     (leftIdx == ans[0] && (mid < ans[1] ||
                                                            (mid == ans[1] && rightIdx < ans[2])))))) {
                maxSum = total;
                ans[0] = leftIdx;
                ans[1] = mid;
                ans[2] = rightIdx;
            }
        }
        return ans;
    }
}

