import java.util.ArrayList;
import java.util.Collections;
import java.util.Comparator;
import java.util.LinkedList;
import java.util.List;
import java.util.Queue;

public class Solution {
    public int cutOffTree(List<List<Integer>> forest) {
        int m = forest.size();
        int n = forest.get(0).size();
        int[][] grid = new int[m][n];
        for (int i = 0; i < m; i++) {
            List<Integer> row = forest.get(i);
            for (int j = 0; j < n; j++) {
                grid[i][j] = row.get(j);
            }
        }

        List<int[]> trees = new ArrayList<>();
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 1) {
                    trees.add(new int[]{grid[i][j], i, j});
                }
            }
        }

        Collections.sort(trees, Comparator.comparingInt(a -> a[0]));

        int totalSteps = 0;
        int curR = 0, curC = 0;

        for (int[] tree : trees) {
            int targetR = tree[1];
            int targetC = tree[2];
            int steps = bfs(grid, curR, curC, targetR, targetC);
            if (steps == -1) {
                return -1;
            }
            totalSteps += steps;
            curR = targetR;
            curC = targetC;
        }

        return totalSteps;
    }

    private int bfs(int[][] grid, int sr, int sc, int tr, int tc) {
        if (sr == tr && sc == tc) {
            return 0;
        }
        int m = grid.length;
        int n = grid[0].length;
        boolean[][] visited = new boolean[m][n];
        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[]{sr, sc, 0});
        visited[sr][sc] = true;
        int[] dr = {-1, 0, 1, 0};
        int[] dc = {0, 1, 0, -1};

        while (!q.isEmpty()) {
            int[] cur = q.poll();
            int r = cur[0];
            int c = cur[1];
            int d = cur[2];
            for (int i = 0; i < 4; i++) {
                int nr = r + dr[i];
                int nc = c + dc[i];
                if (nr < 0 || nr >= m || nc < 0 || nc >= n) {
                    continue;
                }
                if (grid[nr][nc] == 0 || visited[nr][nc]) {
                    continue;
                }
                if (nr == tr && nc == tc) {
                    return d + 1;
                }
                visited[nr][nc] = true;
                q.offer(new int[]{nr, nc, d + 1});
            }
        }
        return -1;
    }
}

