public class Solution {
    private static final int MOD = 1_000_000_007;

    public int numDecodings(String s) {
        int n = s.length();
        if (n == 0) return 0;

        long prev2 = 1; // dp[0] (empty string)
        long prev1 = singleWays(s.charAt(0)); // dp[1]

        for (int i = 1; i < n; i++) {
            char cur = s.charAt(i);
            char prev = s.charAt(i - 1);

            long single = singleWays(cur) * prev1 % MOD;
            long two = twoWays(prev, cur) * prev2 % MOD;

            long curr = (single + two) % MOD;
            prev2 = prev1;
            prev1 = curr;
        }
        return (int) prev1;
    }

    private long singleWays(char c) {
        if (c == '*') return 9;
        if (c == '0') return 0;
        return 1;
    }

    private long twoWays(char a, char b) {
        if (a == '1') {
            if (b == '*') return 9; // 10-19
            return 1; // 10-19
        }
        if (a == '2') {
            if (b == '*') return 6; // 20-26
            if (b <= '6') return 1; // 20-26
            return 0;
        }
        if (a == '*') {
            if (b == '*') return 15; // 11-19 and 21-26
            if (b <= '6') return 2; // 1b and 2b
            return 1; // 1b
        }
        return 0;
    }
}

