import java.util.ArrayList;
import java.util.List;

public class Solution {
    private static final double EPS = 1e-6;

    public boolean judge24(int[] cards) {
        List<Double> nums = new ArrayList<>();
        for (int num : cards) {
            nums.add((double) num);
        }
        return dfs(nums);
    }

    private boolean dfs(List<Double> nums) {
        int n = nums.size();
        if (n == 1) {
            return Math.abs(nums.get(0) - 24.0) < EPS;
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (i == j) continue;
                List<Double> next = new ArrayList<>();
                for (int k = 0; k < n; k++) {
                    if (k != i && k != j) {
                        next.add(nums.get(k));
                    }
                }

                double a = nums.get(i);
                double b = nums.get(j);

                // addition
                next.add(a + b);
                if (dfs(next)) return true;
                next.remove(next.size() - 1);

                // subtraction a - b
                next.add(a - b);
                if (dfs(next)) return true;
                next.remove(next.size() - 1);

                // multiplication
                next.add(a * b);
                if (dfs(next)) return true;
                next.remove(next.size() - 1);

                // division a / b
                if (Math.abs(b) > EPS) {
                    next.add(a / b);
                    if (dfs(next)) return true;
                    next.remove(next.size() - 1);
                }
            }
        }
        return false;
    }
}

