        int n = positions.length;
        TreeSet<Integer> set = new TreeSet<>();
        for (int[] pos : positions) {
            int left = pos[0];
            int side = pos[1];
            int right = left + side - 1;
            set.add(left);
            set.add(right + 1);
        }
        List<Integer> coordList = new ArrayList<>(set);
        int m = coordList.size();
        int[] coords = new int[m];
        for (int i = 0; i < m; i++) coords[i] = coordList.get(i);

        int size = m - 1; // number of segments
        SegmentTree st = new SegmentTree(size);

        List<Integer> ans = new ArrayList<>();
        int globalMax = 0;
        for (int[] pos : positions) {
            int left = pos[0];
            int side = pos[1];
            int right = left + side - 1;
            int lIdx = binarySearch(coords, left);
            int rIdx = binarySearch(coords, right + 1) - 1; // inclusive
            int curMax = st.queryMax(1, 0, size - 1, lIdx, rIdx);
            int newHeight = curMax + side;
            st.updateSet(1, 0, size - 1, lIdx, rIdx, newHeight);
            globalMax = Math.max(globalMax, newHeight);
            ans.add(globalMax);
        }
        return ans;
    }

    private int binarySearch(int[] arr, int target) {
        int l = 0, r = arr.length - 1;
        while (l <= r) {
            int mid = (l + r) >>> 1;
            if (arr[mid] == target) return mid;
            if (arr[mid] < target) l = mid + 1;
            else r = mid - 1;
        }
        return l;
    }

    private static class SegmentTree {
        int[] tree;
        int[] lazy;
        SegmentTree(int n) {
            tree = new int[4 * n];
            lazy = new int[4 * n];
            for (int i = 0; i < lazy.length; i++) lazy[i] = -1;
        }
        int queryMax(int node, int l, int r, int ql, int qr) {
            if (ql > r || qr < l) return 0;
            if (ql <= l && r <= qr) return tree[node];
            push(node);
            int mid = (l + r) >>> 1;
            return Math.max(queryMax(node << 1, l, mid, ql, qr),
                            queryMax(node << 1 | 1, mid + 1, r, ql, qr));
        }
        void updateSet(int node, int l, int r, int ql, int qr, int val) {
            if (ql > r || qr < l) return;
            if (ql <= l && r <= qr) {
                tree[node] = val;
                lazy[node] = val;
                return;
            }
            push(node);
            int mid = (l + r) >>> 1;
            updateSet(node << 1, l, mid, ql, qr, val);
            updateSet(node << 1 | 1, mid + 1, r, ql, qr, val);
            tree[node] = Math.max(tree[node << 1], tree[node << 1 | 1]);
        }
        void push(int node) {
            if (lazy[node] != -1) {
                int val = lazy[node];
                tree[node << 1] = val;
                tree[node << 1 | 1] = val;
                lazy[node << 1] = val;
                lazy[node << 1 | 1] = val;
                lazy[node] = -1;
            }
        }
    }
}

