public class Solution {
    private static final int MOD = 1_000_000_007;

    public int kInversePairs(int n, int k) {
        // If k is larger than the maximum possible inversions, return 0
        if (k > n * (n - 1) / 2) {
            return 0;
        }

        int[][] dp = new int[n + 1][k + 1];
        dp[0][0] = 1;

        for (int i = 1; i <= n; i++) {
            dp[i][0] = 1; // Only one way to arrange i numbers with 0 inversions
            for (int j = 1; j <= k; j++) {
                long val = dp[i][j - 1] + dp[i - 1][j];
                if (j >= i) {
                    val -= dp[i - 1][j - i];
                }
                val %= MOD;
                if (val < 0) val += MOD;
                dp[i][j] = (int) val;
            }
        }

        return dp[n][k];
    }
}

