public class Solution {
    public String solveEquation(String equation) {
        String[] sides = equation.split("=");
        int[] left = parseSide(sides[0]);
        int[] right = parseSide(sides[1]);

        int coeff = left[0] - right[0];
        int constTerm = right[1] - left[1];

        if (coeff == 0) {
            if (constTerm == 0) {
                return "Infinite solutions";
            } else {
                return "No solution";
            }
        } else {
            int x = constTerm / coeff;
            return "x=" + x;
        }
    }

    // returns int[]{coeff, const}
    private int[] parseSide(String s) {
        int coeff = 0;
        int constTerm = 0;
        int sign = 1;
        int num = 0;
        boolean inNumber = false;

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (Character.isDigit(c)) {
                num = num * 10 + (c - '0');
                inNumber = true;
            } else if (c == 'x') {
                if (inNumber) {
                    coeff += sign * num;
                } else {
                    coeff += sign;
                }
                num = 0;
                inNumber = false;
            } else if (c == '+' || c == '-') {
                if (inNumber) {
                    constTerm += sign * num;
                    num = 0;
                    inNumber = false;
                }
                sign = (c == '+') ? 1 : -1;
            }
        }
        if (inNumber) {
            constTerm += sign * num;
        }
        return new int[]{coeff, constTerm};
    }
}

