public class Solution {
    public int[] findRedundantDirectedConnection(int[][] edges) {
        int n = edges.length;
        int[] parent = new int[n + 1];
        int[] firstEdge = null;
        int[] secondEdge = null;

        // Detect a node with two parents
        for (int i = 0; i < n; i++) {
            int u = edges[i][0];
            int v = edges[i][1];
            if (parent[v] == 0) {
                parent[v] = u;
            } else {
                firstEdge = new int[]{parent[v], v};
                secondEdge = new int[]{u, v};
                // Only one node can have two parents in this problem
                break;
            }
        }

        // If no node has two parents, just find the cycle
        if (secondEdge == null) {
            DSU dsu = new DSU(n);
            for (int i = 0; i < n; i++) {
                int u = edges[i][0];
                int v = edges[i][1];
                if (dsu.find(u) == dsu.find(v)) {
                    return edges[i];
                }
                dsu.union(u, v);
            }
        } else {
            // Try removing the second edge first
            DSU dsu = new DSU(n);
            for (int i = 0; i < n; i++) {
                int u = edges[i][0];
                int v = edges[i][1];
                if (u == secondEdge[0] && v == secondEdge[1]) {
                    continue; // skip second edge
                }
                if (dsu.find(u) == dsu.find(v)) {
                    // Removing second edge doesn't fix cycle, so first edge is the answer
                    return firstEdge;
                }
                dsu.union(u, v);
            }
            // No cycle found after removing second edge, so second edge is the answer
            return secondEdge;
        }

        // Should never reach here
        return new int[0];
    }

    // Union-Find (Disjoint Set Union) implementation
    private static class DSU {
        private final int[] parent;
        private final int[] rank;

        DSU(int n) {
            parent = new int[n + 1];
            rank = new int[n + 1];
            for (int i = 1; i <= n; i++) {
                parent[i] = i;
                rank[i] = 0;
            }
        }

        int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]); // Path compression
            }
            return parent[x];
        }

        void union(int x, int y) {
            int px = find(x);
            int py = find(y);
            if (px == py) return;
            if (rank[px] < rank[py]) {
                parent[px] = py;
            } else if (rank[px] > rank[py]) {
                parent[py] = px;
            } else {
                parent[py] = px;
                rank[px]++;
            }
        }
    }
}

