public class Solution {
    public int[] findErrorNums(int[] nums) {
        int n = nums.length;
        long sum = 0;
        long sumSq = 0;
        for (int num : nums) {
            sum += num;
            sumSq += (long) num * num;
        }

        long expectedSum = (long) n * (n + 1) / 2;
        long expectedSq = (long) n * (n + 1) * (2L * n + 1) / 6;

        long diff = sum - expectedSum;          // duplicate - missing
        long sqDiff = sumSq - expectedSq;       // duplicate^2 - missing^2

        long sumDupMissing = sqDiff / diff;     // duplicate + missing

        int duplicate = (int) ((diff + sumDupMissing) / 2);
        int missing = duplicate - (int) diff;

        return new int[]{duplicate, missing};
    }
}

