import java.util.Arrays;
import java.util.PriorityQueue;

public class Solution {
    public int scheduleCourse(int[][] courses) {
        // Sort courses by their deadline (lastDay) in ascending order
        Arrays.sort(courses, (a, b) -> Integer.compare(a[1], b[1]));

        // Max-heap to keep track of the longest duration among selected courses
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>((a, b) -> Integer.compare(b, a));

        long totalTime = 0; // use long to avoid overflow for large sums

        for (int[] course : courses) {
            int duration = course[0];
            int lastDay = course[1];

            if (totalTime + duration <= lastDay) {
                // We can take this course without exceeding its deadline
                totalTime += duration;
                maxHeap.offer(duration);
            } else if (!maxHeap.isEmpty() && maxHeap.peek() > duration) {
                // Replace the longest course with this shorter one if it helps
                totalTime -= maxHeap.poll(); // remove longest
                totalTime += duration;       // add current
                maxHeap.offer(duration);
            }
            // else: cannot take this course, skip it
        }

        return maxHeap.size();
    }
}

