public class Solution {
    public double knightProbability(int n, int k, int row, int column) {
        double[][] curr = new double[n][n];
        curr[row][column] = 1.0;
        int[][] moves = {
            {2, 1}, {1, 2}, {-1, 2}, {-2, 1},
            {-2, -1}, {-1, -2}, {1, -2}, {2, -1}
        };
        for (int step = 0; step < k; step++) {
            double[][] next = new double[n][n];
            for (int r = 0; r < n; r++) {
                for (int c = 0; c < n; c++) {
                    double prob = curr[r][c];
                    if (prob == 0) continue;
                    for (int[] m : moves) {
                        int nr = r + m[0];
                        int nc = c + m[1];
                        if (nr >= 0 && nr < n && nc >= 0 && nc < n) {
                            next[nr][nc] += prob / 8.0;
                        }
                    }
                }
            }
            curr = next;
        }
        double result = 0.0;
        for (int r = 0; r < n; r++) {
            for (int c = 0; c < n; c++) {
                result += curr[r][c];
            }
        }
        return result;
    }
}

