public class Solution {
    public boolean checkValidString(String s) {
        int low = 0;   // minimum possible number of open '('
        int high = 0;  // maximum possible number of open '('

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c == '(') {
                low++;
                high++;
            } else if (c == ')') {
                low--;
                high--;
            } else { // '*'
                low--;   // treat '*' as ')'
                high++;  // treat '*' as '('
            }

            if (high < 0) {
                return false; // too many ')'
