import java.util.List;
import java.util.Objects;
import java.util.PriorityQueue;
import java.util.Comparator;

public class Solution {

    public int[] smallestRange(List<List<Integer>> nums) {
        if (nums == null || nums.isEmpty()) {
            return new int[0];
        }

        int k = nums.size();
        // Min-heap to store the current element from each list
        PriorityQueue<Node> minHeap = new PriorityQueue<>(Comparator.comparingInt(n -> n.value));

        int currentMax = Integer.MIN_VALUE;

        // Initialize heap with the first element of each list
        for (int i = 0; i < k; i++) {
            List<Integer> list = nums.get(i);
            if (list == null || list.isEmpty()) {
                // If any list is empty, no valid range exists
                return new int[0];
            }
            int val = list.get(0);
            minHeap.offer(new Node(val, i, 0));
            currentMax = Math.max(currentMax, val);
        }

        int bestStart = 0;
        int bestEnd = Integer.MAX_VALUE;

        while (true) {
            Node minNode = minHeap.poll();
            int minVal = minNode.value;

            // Update best range if needed
            if (currentMax - minVal < bestEnd - bestStart ||
                (currentMax - minVal == bestEnd - bestStart && minVal < bestStart)) {
                bestStart = minVal;
                bestEnd = currentMax;
            }

            // Move to the next element in the list from which minVal was taken
            int nextIndex = minNode.elementIndex + 1;
            if (nextIndex >= nums.get(minNode.listIndex).size()) {
                // One list is exhausted; cannot find a better range
                break;
            }

            int nextVal = nums.get(minNode.listIndex).get(nextIndex);
            minHeap.offer(new Node(nextVal, minNode.listIndex, nextIndex));
            currentMax = Math.max(currentMax, nextVal);
        }

        return new int[]{bestStart, bestEnd};
    }

    private static class Node {
        int value;
        int listIndex;
        int elementIndex;

        Node(int value, int listIndex, int elementIndex) {
            this.value = value;
            this.listIndex = listIndex;
            this.elementIndex = elementIndex;
        }
    }
}

