import java.util.*;

public class Solution {
    public int shoppingOffers(List<Integer> price, List<List<Integer>> special, List<Integer> needs) {
        int n = price.size();
        int[] priceArr = new int[n];
        for (int i = 0; i < n; i++) priceArr[i] = price.get(i);

        int[] needsArr = new int[n];
        for (int i = 0; i < n; i++) needsArr[i] = needs.get(i);

        Map<String, Integer> memo = new HashMap<>();
        return dfs(needsArr, priceArr, special, memo);
    }

    private int dfs(int[] needs, int[] price, List<List<Integer>> special, Map<String, Integer> memo) {
        String key = Arrays.toString(needs);
        if (memo.containsKey(key)) return memo.get(key);

        int n = needs.length;
        int minCost = 0;
        for (int i = 0; i < n; i++) minCost += needs[i] * price[i];

        for (List<Integer> offer : special) {
            int[] offerCounts = new int[n];
            for (int i = 0; i < n; i++) offerCounts[i] = offer.get(i);
            int offerPrice = offer.get(n);

            boolean canApply = true;
            for (int i = 0; i < n; i++) {
                if (needs[i] < offerCounts[i]) {
                    canApply = false;
                    break;
                }
            }
            if (!canApply) continue;

            int[] newNeeds = new int[n];
            for (int i = 0; i < n; i++) newNeeds[i] = needs[i] - offerCounts[i];
            int costWithOffer = offerPrice + dfs(newNeeds, price, special, memo);
            if (costWithOffer < minCost) minCost = costWithOffer;
        }

        memo.put(key, minCost);
        return minCost;
    }
}

