import java.util.Arrays;

public class Solution {
    public boolean canPartitionKSubsets(int[] nums, int k) {
        int n = nums.length;
        if (k == 0 || n == 0) return false;
        if (k == 1) return true;
        if (k > n) return false;

        int totalSum = 0;
        for (int num : nums) totalSum += num;
        if (totalSum % k != 0) return false;
        int target = totalSum / k;

        // If any number is greater than target, impossible
        for (int num : nums) {
            if (num > target) return false;
        }

        // Sort descending to prune earlier
        Arrays.sort(nums);
        for (int i = 0; i < n / 2; i++) {
            int tmp = nums[i];
            nums[i] = nums[n - 1 - i];
            nums[n - 1 - i] = tmp;
        }

        int fullMask = (1 << n) - 1;
        int[] memo = new int[1 << n];
        Arrays.fill(memo, -1);

        return dfs(0, 0, nums, target, fullMask, memo);
    }

    private boolean dfs(int mask, int currentSum, int[] nums, int target, int fullMask, int[] memo) {
        if (mask == fullMask) return true;
        if (memo[mask] != -1) return memo[mask] == 1;

        if (currentSum == target) {
            // start filling next subset
            if (dfs(mask, 0, nums, target, fullMask, memo)) {
                memo[mask] = 1;
                return true;
            }
        }

        for (int i = 0; i < nums.length; i++) {
            if ((mask & (1 << i)) == 0 && currentSum + nums[i] <= target) {
                if (dfs(mask | (1 << i), currentSum + nums[i], nums, target, fullMask, memo)) {
                    memo[mask] = 1;
                    return true;
                }
            }
        }

        memo[mask] = 0;
        return false;
    }
}

