public class Solution {
    public List<Integer> findClosestElements(int[] arr, int k, int x) {
        int n = arr.length;
        int left = 0, right = n - 1;
        // Find the position where x would be inserted
        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (arr[mid] == x) {
                left = mid;
                break;
            } else if (arr[mid] < x) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        // left is the first index >= x
        int l = left - 1;
        int r = left;
        while (k > 0) {
            if (l < 0) {
                r++;
            } else if (r >= n) {
                l--;
            } else {
                int leftDiff = Math.abs(arr[l] - x);
                int rightDiff = Math.abs(arr[r] - x);
                if (leftDiff <= rightDiff) {
                    l--;
                } else {
                    r++;
                }
            }
            k--;
        }
        List<Integer> result = new ArrayList<>();
        for (int i = l + 1; i < r; i++) {
            result.add(arr[i]);
        }
        return result;
    }
}

