public class Solution {
    public List<List<String>> printTree(TreeNode root) {
        if (root == null) {
            return new ArrayList<>();
        }
        int height = getHeight(root);
        int rows = height + 1;
        int cols = (int) Math.pow(2, height + 1) - 1;
        String[][] res = new String[rows][cols];
        for (int i = 0; i < rows; i++) {
            Arrays.fill(res[i], "");
        }
        fill(res, root, 0, (cols - 1) / 2, height);
        List<List<String>> result = new ArrayList<>();
        for (String[] row : res) {
            result.add(new ArrayList<>(Arrays.asList(row)));
        }
        return result;
    }

    private void fill(String[][] res, TreeNode node, int r, int c, int height) {
        if (node == null) {
            return;
        }
        res[r][c] = String.valueOf(node.val);
        int offset = (int) Math.pow(2, height - r - 1);
        if (node.left != null) {
            fill(res, node.left, r + 1, c - offset, height);
        }
        if (node.right != null) {
            fill(res, node.right, r + 1, c + offset, height);
        }
    }

    private int getHeight(TreeNode node) {
        if (node == null) {
            return -1;
        }
        return 1 + Math.max(getHeight(node.left), getHeight(node.right));
    }
}

