public class Solution {
    public int compareVersion(String version1, String version2) {
        int i = 0, j = 0;
        int n1 = version1.length(), n2 = version2.length();

        while (i < n1 || j < n2) {
            // Extract next revision from version1
            int start1 = i;
            while (i < n1 && version1.charAt(i) != '.') i++;
            String rev1 = version1.substring(start1, i);

            // Extract next revision from version2
            int start2 = j;
            while (j < n2 && version2.charAt(j) != '.') j++;
            String rev2 = version2.substring(start2, j);

            // Remove leading zeros
            int idx1 = 0;
            while (idx1 < rev1.length() && rev1.charAt(idx1) == '0') idx1++;
            int idx2 = 0;
            while (idx2 < rev2.length() && rev2.charAt(idx2) == '0') idx2++;

            String num1 = rev1.substring(idx1);
            String num2 = rev2.substring(idx2);

            // Treat empty string as "0"
            if (num1.isEmpty()) num1 = "0";
            if (num2.isEmpty()) num2 = "0";

            // Compare lengths
            if (num1.length() > num2.length()) return 1;
            if (num1.length() < num2.length()) return -1;

            // Lengths equal, compare lexicographically
            int cmp = num1.compareTo(num2);
            if (cmp != 0) return cmp > 0 ? 1 : -1;
        }
        return 0;
    }
