import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<String> findRepeatedDnaSequences(String s) {
        List<String> result = new ArrayList<>();
        if (s == null || s.length() < 10) {
            return result;
        }

        int[] freq = new int[1 << 20]; // 4^10 possible sequences
        int code = 0;
        int mask = (1 << 20) - 1;

        // Map nucleotides to 2-bit values
        int[] map = new int[256];
        map['A'] = 0;
        map['C'] = 1;
        map['G'] = 2;
        map['T'] = 3;

        // Build the first 10-letter code
        for (int i = 0; i < 10; i++) {
            code = (code << 2) | map[s.charAt(i)];
        }
        freq[code]++;

        // Slide through the string
        for (int i = 10; i < s.length(); i++) {
            code = ((code << 2) | map[s.charAt(i)]) & mask;
            freq[code]++;
            if (freq[code] == 2) {
                result.add(s.substring(i - 9, i + 1));
            }
        }

        return result;
    }
}

