public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) {
            return new ArrayList<>();
        }

        Map<String, List<String>> graph = new HashMap<>();
        Queue<String> queue = new LinkedList<>();
        Set<String> visited = new HashSet<>();
        queue.offer(beginWord);
        visited.add(beginWord);
        boolean found = false;

        while (!queue.isEmpty() && !found) {
            int size = queue.size();
            Set<String> localVisited = new HashSet<>();

            for (int i = 0; i < size; i++) {
                String word = queue.poll();
                char[] chars = word.toCharArray();

                for (int pos = 0; pos < chars.length; pos++) {
                    char original = chars[pos];
                    for (char c = 'a'; c <= 'z'; c++) {
                        if (c == original) continue;
                        chars[pos] = c;
                        String next = new String(chars);
                        if (!wordSet.contains(next)) continue;

                        if (!visited.contains(next)) {
                            localVisited.add(next);
                            queue.offer(next);
                        }

                        graph.computeIfAbsent(next, k -> new ArrayList<>()).add(word);

                        if (next.equals(endWord)) {
                            found = true;
                        }
                    }
                    chars[pos] = original;
                }
            }
            visited.addAll(localVisited);
        }

        List<List<String>> result = new ArrayList<>();
        if (!found) {
            return result;
        }

        List<String> path = new ArrayList<>();
        path.add(endWord);
        dfs(endWord, beginWord, graph, path, result);

        for (List<String> p : result) {
            Collections.reverse(p);
        }
        return result;
    }

    private void dfs(String current, String beginWord, Map<String, List<String>> graph,
                     List<String> path, List<List<String>> result) {
        if (current.equals(beginWord)) {
            result.add(new ArrayList<>(path));
            return;
        }
        List<String> prevs = graph.getOrDefault(current, new ArrayList<>());
        for (String prev : prevs) {
            path.add(prev);
            dfs(prev, beginWord, graph, path, result);
            path.remove(path.size() - 1);
        }
    }
}

