import java.util.HashMap;
import java.util.Map;

public class Solution {
    public String fractionToDecimal(int numerator, int denominator) {
        if (numerator == 0) {
            return "0";
        }

        StringBuilder sb = new StringBuilder();

        // Determine the sign
        boolean negative = (numerator < 0) ^ (denominator < 0);
        if (negative) {
            sb.append("-");
        }

        long num = Math.abs((long) numerator);
        long den = Math.abs((long) denominator);

        // Integer part
        long integerPart = num / den;
        sb.append(integerPart);

        long remainder = num % den;
        if (remainder == 0) {
            return sb.toString();
        }

        sb.append(".");
        Map<Long, Integer> remainderIndex = new HashMap<>();

        while (remainder != 0) {
            if (remainderIndex.containsKey(remainder)) {
                int index = remainderIndex.get(remainder);
                sb.insert(index, "(");
                sb.append(")");
                break;
            }

            remainderIndex.put(remainder, sb.length());
            remainder *= 10;
            long digit = remainder / den;
            sb.append(digit);
            remainder %= den;
        }

        return sb.toString();
    }
}

