import com_github_leetcode.random.Node;

public class Solution {
    public Node copyRandomList(Node head) {
        if (head == null) {
            return null;
        }

        // 1st pass: create cloned nodes and insert them after original nodes
        Node curr = head;
        while (curr != null) {
            Node clone = new Node(curr.val);
            clone.next = curr.next;
            curr.next = clone;
            curr = clone.next;
        }

        // 2nd pass: assign random pointers for the cloned nodes
        curr = head;
        while (curr != null) {
            if (curr.random != null) {
                curr.next.random = curr.random.next;
            }
            curr = curr.next.next;
        }

        // 3rd pass: separate the original and cloned lists
        curr = head;
        Node pseudoHead = new Node(0);
        Node copyCurr = pseudoHead;
        while (curr != null) {
            Node clone = curr.next;
            copyCurr.next = clone;
            copyCurr = clone;

            // restore the original list
            curr.next = clone.next;
            curr = curr.next;
        }

        return pseudoHead.next;
    }
}

