import java.util.*;

public class Solution {
    public int makeArrayIncreasing(int[] arr1, int[] arr2) {
        int n = arr1.length;
        if (n == 0) return 0;

        // Sort and deduplicate arr2
        int[] sorted = arr2.clone();
        Arrays.sort(sorted);
        int m = 0;
        for (int i = 0; i < sorted.length; i++) {
            if (i == 0 || sorted[i] != sorted[i - 1]) {
                sorted[m++] = sorted[i];
            }
        }
        int[] uniq = Arrays.copyOf(sorted, m);

        final int INF = Integer.MAX_VALUE / 2;
        Map<Integer, Integer> dp = new HashMap<>();
        // Initial state: keep first element
        dp.put(arr1[0], 0);
        // Replace first element with smallest arr2 element
        int idx = upperBound(uniq, Integer.MIN_VALUE);
        if (idx < m) {
            dp.put(uniq[idx], 1);
        }

        for (int i = 1; i < n; i++) {
            Map<Integer, Integer> next = new HashMap<>();
            for (Map.Entry<Integer, Integer> entry : dp.entrySet()) {
                int lastVal = entry.getKey();
                int ops = entry.getValue();

                // Keep arr1[i] if it is greater than lastVal
                if (arr1[i] > lastVal) {
                    int cur = next.getOrDefault(arr1[i], INF);
                    if (ops < cur) next.put(arr1[i], ops);
                }

                // Replace arr1[i] with smallest uniq element > lastVal
                int pos = upperBound(uniq, lastVal);
                if (pos < m) {
                    int val = uniq[pos];
                    int cur = next.getOrDefault(val, INF);
                    if (ops + 1 < cur) next.put(val, ops + 1);
                }
            }
            dp = next;
            if (dp.isEmpty()) return -1;
        }

        int ans = INF;
        for (int v : dp.values()) {
            if (v < ans) ans = v;
        }
        return ans == INF ? -1 : ans;
    }

    // Returns the first index in arr where arr[idx] > key
    private int upperBound(int[] arr, int key) {
        int l = 0, r = arr.length;
        while (l < r) {
            int mid = (l + r) >>> 1;
            if (arr[mid] <= key) l = mid + 1;
            else r = mid;
        }
        return l;
    }
}

