    public int maxRepOpt1(String text) {
        if (text == null || text.length() == 0) return 0;
        int n = text.length();
        int[] total = new int[26];
        for (int i = 0; i < n; i++) {
            total[text.charAt(i) - 'a']++;
        }

        int maxLen = 0;
        int i = 0;
        while (i < n) {
            int j = i;
            while (j < n && text.charAt(j) == text.charAt(i)) j++;
            int blockLen = j - i;
            char ch = text.charAt(i);
            int idx = ch - 'a';

            // Case 1: extend current block by one if there is an extra occurrence
            int curMax = blockLen + (total[idx] > blockLen ? 1 : 0);
            maxLen = Math.max(maxLen, curMax);

            // Case 2: merge with next block if separated by one different char
            if (j < n && j + 1 < n && text.charAt(j + 1) == ch) {
                int k = j + 1;
                while (k < n && text.charAt(k) == ch) k++;
                int nextBlockLen = k - (j + 1);
                int combinedLen = blockLen + nextBlockLen;
                combinedLen += (total[idx] > combinedLen ? 1 : 0);
                maxLen = Math.max(maxLen, combinedLen);
            }

            i = j;
        }

        return maxLen;
    }
}

