public class Solution {
    public int maximumSum(int[] arr) {
        int n = arr.length;
        if (n == 0) return 0; // not expected per problem statement
        int keep = arr[0];          // max subarray sum ending at current index without deletion
        int delete = Integer.MIN_VALUE; // max subarray sum ending at current index with one deletion
        int result = keep;          // track global maximum

        for (int i = 1; i < n; i++) {
            int newKeep = Math.max(keep + arr[i], arr[i]);          // extend or start new
            int newDelete = Math.max(delete + arr[i], keep);        // delete current or extend previous deletion
            keep = newKeep;
            delete = newDelete;
            result = Math.max(result, Math.max(keep, delete));
        }
        return result;
    }
}

