public class Solution {
    public int movesToMakeZigzag(int[] nums) {
        int n = nums.length;
        long movesPattern1 = 0; // even indices high, odd low
        for (int i = 1; i < n; i += 2) {
            int left = nums[i - 1];
            int right = (i + 1 < n) ? nums[i + 1] : -1;
            int maxNeighbor = Math.max(left, right);
            if (nums[i] >= maxNeighbor) {
                movesPattern1 += nums[i] - (maxNeighbor - 1);
            }
        }

        long movesPattern2 = 0; // odd indices high, even low
        for (int i = 0; i < n; i += 2) {
            int left = (i - 1 >= 0) ? nums[i - 1] : -1;
            int right = (i + 1 < n) ? nums[i + 1] : -1;
            int maxNeighbor = Math.max(left, right);
            if (nums[i] >= maxNeighbor) {
                movesPattern2 += nums[i] - (maxNeighbor - 1);
            }
        }

        return (int) Math.min(movesPattern1, movesPattern2);
    }
}

