import java.util.Arrays;

public class Solution {
    public int stoneGameII(int[] piles) {
        int n = piles.length;
        int[] suffix = new int[n + 1];
        for (int i = n - 1; i >= 0; i--) {
            suffix[i] = suffix[i + 1] + piles[i];
        }
        int[][] memo = new int[n][n + 1];
        for (int[] row : memo) {
            Arrays.fill(row, -1);
        }
        return dfs(0, 1, suffix, memo);
    }

    private int dfs(int i, int m, int[] suffix, int[][] memo) {
        int n = suffix.length - 1;
        if (i >= n) {
            return 0;
        }
        if (memo[i][m] != -1) {
            return memo[i][m];
        }
        int maxTake = Math.min(n - i, 2 * m);
        int best = 0;
        for (int x = 1; x <= maxTake; x++) {
            int nextM = Math.max(m, x);
            int opponent = dfs(i + x, nextM, suffix, memo);
            int current = suffix[i] - opponent;
            if (current > best) {
                best = current;
            }
        }
        memo[i][m] = best;
        return best;
    }
}

