import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public int[] smallestSufficientTeam(String[] skills, List<List<String>> people) {
        int n = skills.length;
        if (n == 0) return new int[0];

        // Map each skill to a bit position
        Map<String, Integer> skillToBit = new HashMap<>();
        for (int i = 0; i < n; i++) {
            skillToBit.put(skills[i], i);
        }

        int fullMask = (1 << n) - 1;
        int[] dpMask = new int[1 << n];
        @SuppressWarnings("unchecked")
        List<Integer>[] dpTeam = new ArrayList[1 << n];
        for (int i = 0; i < dpMask.length; i++) {
            dpMask[i] = Integer.MAX_VALUE;
            dpTeam[i] = null;
        }
        dpMask[0] = 0;
        dpTeam[0] = new ArrayList<>();

        // Precompute skill mask for each person
        int[] personMask = new int[people.size()];
        for (int i = 0; i < people.size(); i++) {
            int mask = 0;
            for (String skill : people.get(i)) {
                Integer bit = skillToBit.get(skill);
                if (bit != null) {
                    mask |= 1 << bit;
                }
            }
            personMask[i] = mask;
        }

        for (int i = 0; i < people.size(); i++) {
            int pMask = personMask[i];
            if (pMask == 0) continue; // person adds no new skill
            for (int mask = 0; mask <= fullMask; mask++) {
                if (dpMask[mask] == Integer.MAX_VALUE) continue;
                int newMask = mask | pMask;
                if (dpMask[mask] + 1 < dpMask[newMask]) {
                    dpMask[newMask] = dpMask[mask] + 1;
                    List<Integer> newTeam = new ArrayList<>(dpTeam[mask]);
                    newTeam.add(i);
                    dpTeam[newMask] = newTeam;
                }
            }
        }

        List<Integer> resultList = dpTeam[fullMask];
        int[] result = new int[resultList.size()];
        for (int i = 0; i < resultList.size(); i++) {
            result[i] = resultList.get(i);
        }
        return result;
    }
}

