public class Solution {
    public boolean parseBoolExpr(String expression) {
        int[] idx = new int[]{0};
        return parse(expression, idx);
    }

    private boolean parse(String s, int[] idx) {
        char c = s.charAt(idx[0]);

        if (c == 't') {
            idx[0]++;
            return true;
        }
        if (c == 'f') {
            idx[0]++;
            return false;
        }

        // Operator
        char op = c;
        idx[0]++; // skip operator
        idx[0]++; // skip '('

        boolean result;
        if (op == '!') {
            boolean val = parse(s, idx);
            result = !val;
        } else if (op == '&') {
            result = true;
            while (true) {
                boolean val = parse(s, idx);
                result = result && val;
                if (idx[0] < s.length() && s.charAt(idx[0]) == ',') {
                    idx[0]++; // skip comma
                } else {
                    break;
                }
            }
        } else { // op == '|'
            result = false;
            while (true) {
                boolean val = parse(s, idx);
                result = result || val;
                if (idx[0] < s.length() && s.charAt(idx[0]) == ',') {
                    idx[0]++; // skip comma
                } else {
                    break;
                }
            }
        }

        idx[0]++; // skip ')'
        return result;
    }
}

