public class Solution {
    private static final long MOD = 1_000_000_007L;

    public int kConcatenationMaxSum(int[] arr, int k) {
        int n = arr.length;
        long totalSum = 0;
        for (int v : arr) totalSum += v;

        long maxSingle = kadane(arr);
        if (k == 1) {
            return (int) ((Math.max(0L, maxSingle)) % MOD);
        }

        // Compute max subarray sum for two concatenations
        long maxDouble = kadaneDouble(arr);

        if (totalSum <= 0) {
            return (int) ((Math.max(0L, maxDouble)) % MOD);
        } else {
            long ans = maxDouble + (k - 2L) * totalSum;
            return (int) ((Math.max(0L, ans)) % MOD);
        }
    }

    private long kadane(int[] arr) {
        long maxEnding = 0;
        long maxSoFar = Long.MIN_VALUE;
        for (int v : arr) {
            maxEnding = Math.max(0L, maxEnding + v);
            maxSoFar = Math.max(maxSoFar, maxEnding);
        }
        return maxSoFar;
    }

    private long kadaneDouble(int[] arr) {
        long maxEnding = 0;
        long maxSoFar = Long.MIN_VALUE;
        int n = arr.length;
        for (int i = 0; i < 2 * n; i++) {
            int v = arr[i % n];
            maxEnding = Math.max(0L, maxEnding + v);
            maxSoFar = Math.max(maxSoFar, maxEnding);
        }
        return maxSoFar;
    }
}

