public class Solution {
    public List<String> invalidTransactions(String[] transactions) {
        int n = transactions.length;
        Transaction[] trans = new Transaction[n];
        Map<String, List<Integer>> nameToIndices = new HashMap<>();

        for (int i = 0; i < n; i++) {
            String[] parts = transactions[i].split(",");
            String name = parts[0];
            int time = Integer.parseInt(parts[1]);
            int amount = Integer.parseInt(parts[2]);
            String city = parts[3];
            trans[i] = new Transaction(name, time, amount, city, transactions[i]);

            nameToIndices.computeIfAbsent(name, k -> new ArrayList<>()).add(i);
        }

        boolean[] invalid = new boolean[n];

        // Rule 1: amount > 1000
        for (int i = 0; i < n; i++) {
            if (trans[i].amount > 1000) {
                invalid[i] = true;
            }
        }

        // Rule 2: same name, different city within 60 minutes
        for (Map.Entry<String, List<Integer>> entry : nameToIndices.entrySet()) {
            List<Integer> indices = entry.getValue();
            int size = indices.size();
            for (int i = 0; i < size; i++) {
                int idx1 = indices.get(i);
                Transaction t1 = trans[idx1];
                for (int j = i + 1; j < size; j++) {
                    int idx2 = indices.get(j);
                    Transaction t2 = trans[idx2];
                    if (!t1.city.equals(t2.city) && Math.abs(t1.time - t2.time) <= 60) {
                        invalid[idx1] = true;
                        invalid[idx2] = true;
                    }
                }
            }
        }

        List<String> result = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            if (invalid[i]) {
                result.add(trans[i].original);
            }
        }
        return result;
    }

    private static class Transaction {
        String name;
        int time;
        int amount;
        String city;
        String original;

        Transaction(String name, int time, int amount, String city, String original) {
            this.name = name;
            this.time = time;
            this.amount = amount;
            this.city = city;
            this.original = original;
        }
    }
}

