import java.util.LinkedList;
import java.util.List;

public class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        LinkedList<Integer> path = new LinkedList<>();
        while (label > 0) {
            path.addFirst(label);
            if (label == 1) {
                break;
            }
            int level = 32 - Integer.numberOfLeadingZeros(label);
            int maxVal = (1 << level) - 1;
            int actual;
            if ((level & 1) == 1) { // odd level
                actual = label;
            } else { // even level
                actual = maxVal - label + (1 << (level - 1));
            }
            int parentActual = actual / 2;
            int parentLevel = level - 1;
            int parentMaxVal = (1 << parentLevel) - 1;
            int parentLabel;
            if ((parentLevel & 1) == 1) { // odd level
                parentLabel = parentActual;
            } else { // even level
                parentLabel = parentMaxVal - parentActual + (1 << (parentLevel - 1));
            }
            label = parentLabel;
        }
        return path;
    }
}

