import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public List<Integer> findNumOfValidWords(String[] words, String[] puzzles) {
        Map<Integer, Integer> wordMaskCount = new HashMap<>();
        for (String word : words) {
            int mask = 0;
            for (char c : word.toCharArray()) {
                mask |= 1 << (c - 'a');
            }
            // Only consider words with at most 7 distinct letters
            if (Integer.bitCount(mask) <= 7) {
                wordMaskCount.put(mask, wordMaskCount.getOrDefault(mask, 0) + 1);
            }
        }

        List<Integer> result = new ArrayList<>(puzzles.length);
        for (String puzzle : puzzles) {
            int firstBit = 1 << (puzzle.charAt(0) - 'a');
            int puzzleMask = 0;
            for (char c : puzzle.toCharArray()) {
                puzzleMask |= 1 << (c - 'a');
            }
            int maskWithoutFirst = puzzleMask ^ firstBit;

            int count = 0;
            int sub = maskWithoutFirst;
            while (true) {
                int currMask = sub | firstBit;
                count += wordMaskCount.getOrDefault(currMask, 0);
                if (sub == 0) break;
                sub = (sub - 1) & maskWithoutFirst;
            }
            result.add(count);
        }
        return result;
    }
}

