public class Solution {
    public int largest1BorderedSquare(int[][] grid) {
        if (grid == null || grid.length == 0 || grid[0].length == 0) {
            return 0;
        }
        int n = grid.length;
        int m = grid[0].length;

        // Prefix sums for rows and columns
        int[][] rowSum = new int[n][m];
        int[][] colSum = new int[n][m];

        for (int i = 0; i < n; i++) {
            int rowAcc = 0;
            for (int j = 0; j < m; j++) {
                rowAcc += grid[i][j];
                rowSum[i][j] = rowAcc;
            }
        }

        for (int j = 0; j < m; j++) {
            int colAcc = 0;
            for (int i = 0; i < n; i++) {
                colAcc += grid[i][j];
                colSum[i][j] = colAcc;
            }
        }

        int maxSide = Math.min(n, m);

        for (int k = maxSide; k >= 1; k--) {
            for (int i = 0; i + k <= n; i++) {
                for (int j = 0; j + k <= m; j++) {
                    if (isBorderAllOnes(rowSum, colSum, i, j, k)) {
                        return k * k;
                    }
                }
            }
        }
        return 0;
    }

    private boolean isBorderAllOnes(int[][] rowSum, int[][] colSum, int i, int j, int k) {
        int jEnd = j + k - 1;
        int iEnd = i + k - 1;

        // Top row
        int top = rowSum[i][jEnd] - (j > 0 ? rowSum[i][j - 1] : 0);
        if (top != k) return false;

        // Bottom row
        int bottom = rowSum[iEnd][jEnd] - (j > 0 ? rowSum[iEnd][j - 1] : 0);
        if (bottom != k) return false;

        // Left column
        int left = colSum[iEnd][j] - (i > 0 ? colSum[i - 1][j] : 0);
        if (left != k) return false;

        // Right column
        int right = colSum[iEnd][jEnd] - (i > 0 ? colSum[i - 1][jEnd] : 0);
        if (right != k) return false;

        return true;
    }
}

