public class Solution {
    public int longestDecomposition(String text) {
        int n = text.length();
        int i = 0, j = n - 1;
        int count = 0;
        while (i < j) {
            boolean found = false;
            for (int len = 1; i + len - 1 <= j - len + 1; len++) {
                if (text.substring(i, i + len).equals(text.substring(j - len + 1, j + 1))) {
                    count += 2;
                    i += len;
                    j -= len;
                    found = true;
                    break;
                }
            }
            if (!found) {
                break;
            }
        }
        if (i == j) {
            count += 1;
        }
        return count;
    }
}

