import java.util.ArrayList;
import java.util.LinkedList;
import java.util.List;
import java.util.Queue;

public class Solution {
    // red -> 0
    // blue -> 1
    public int[] shortestAlternatingPaths(int n, int[][] redEdges, int[][] blueEdges) {
        List<Integer>[] redAdj = new ArrayList[n];
        List<Integer>[] blueAdj = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            redAdj[i] = new ArrayList<>();
            blueAdj[i] = new ArrayList<>();
        }
        for (int[] e : redEdges) {
            redAdj[e[0]].add(e[1]);
        }
        for (int[] e : blueEdges) {
            blueAdj[e[0]].add(e[1]);
        }

        int[] dist = new int[n];
        java.util.Arrays.fill(dist, -1);
        dist[0] = 0;

        boolean[][] visited = new boolean[n][2];
        Queue<int[]> q = new LinkedList<>();
        // start with both colors from node 0
        q.offer(new int[]{0, 0});
        q.offer(new int[]{0, 1});
        visited[0][0] = true;
        visited[0][1] = true;

        while (!q.isEmpty()) {
            int[] cur = q.poll();
            int node = cur[0];
            int color = cur[1];
            int nextColor = 1 - color;
            List<Integer> neighbors = (nextColor == 0) ? redAdj[node] : blueAdj[node];
            for (int nb : neighbors) {
                if (!visited[nb][nextColor]) {
                    visited[nb][nextColor] = true;
                    if (dist[nb] == -1) {
                        dist[nb] = dist[node] + 1;
                    }
                    q.offer(new int[]{nb, nextColor});
                }
            }
        }

        return dist;
    }
}

