public class Solution {
    public String alphabetBoardPath(String target) {
        StringBuilder sb = new StringBuilder();
        int curRow = 0, curCol = 0;
        for (char ch : target.toCharArray()) {
            int targetRow = (ch - 'a') / 5;
            int targetCol = (ch - 'a') % 5;
            if (ch == 'z') {
                // Move left/right first to avoid invalid positions when moving down
                while (curCol > targetCol) {
                    sb.append('L');
                    curCol--;
                }
                while (curCol < targetCol) {
                    sb.append('R');
                    curCol++;
                }
                while (curRow > targetRow) {
                    sb.append('U');
                    curRow--;
                }
                while (curRow < targetRow) {
                    sb.append('D');
                    curRow++;
                }
            } else {
                // Move up/down first
                while (curRow > targetRow) {
                    sb.append('U');
                    curRow--;
                }
                while (curRow < targetRow) {
                    sb.append('D');
                    curRow++;
                }
                while (curCol > targetCol) {
                    sb.append('L');
                    curCol--;
                }
                while (curCol < targetCol) {
                    sb.append('R');
                    curCol++;
                }
            }
            sb.append('!');
        }
        return sb.toString();
    }
}

