public class Solution {
    public int[] distributeCandies(int candies, int numPeople) {
        int[] result = new int[numPeople];
        int give = 1;
        int index = 0;
        while (candies > 0) {
            int giveNow = Math.min(give, candies);
            result[index] += giveNow;
            candies -= giveNow;
            give++;
            index = (index + 1) % numPeople;
        }
        return result;
    }
}

