import java.util.Arrays;

public class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        int[] wordFreq = new int[words.length];
        for (int i = 0; i < words.length; i++) {
            wordFreq[i] = freq(words[i]);
        }
        Arrays.sort(wordFreq);

        int[] result = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int qFreq = freq(queries[i]);
            int idx = firstGreater(wordFreq, qFreq);
            result[i] = wordFreq.length - idx;
        }
        return result;
    }

    private int freq(String s) {
        char min = 'z' + 1;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c < min) {
                min = c;
            }
        }
        int count = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == min) {
                count++;
            }
        }
        return count;
    }

    private int firstGreater(int[] arr, int target) {
        int left = 0, right = arr.length;
        while (left < right) {
            int mid = (left + right) >>> 1;
            if (arr[mid] <= target) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
}

