public class Solution {
    public int distanceBetweenBusStops(int[] distance, int start, int destination) {
        if (start == destination) {
            return 0;
        }
        int n = distance.length;
        int clockwise = 0;
        int i = start;
        while (i != destination) {
            clockwise += distance[i];
            i = (i + 1) % n;
        }
        int total = 0;
        for (int d : distance) {
            total += d;
        }
        return Math.min(clockwise, total - clockwise);
    }
}

