import java.util.List;

public class Solution {
    public List<List<Integer>> criticalConnections(int n, List<List<Integer>> connections) {
        List<List<Integer>> result = new ArrayList<>();
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (List<Integer> edge : connections) {
            int u = edge.get(0);
            int v = edge.get(1);
            graph[u].add(v);
            graph[v].add(u);
        }

        boolean[] visited = new boolean[n];
        int[] disc = new int[n];
        int[] low = new int[n];
        int[] time = new int[1];

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs(i, -1, graph, visited, disc, low, time, result);
            }
        }
        return result;
    }

    private void dfs(int node, int parent, List<Integer>[] graph, boolean[] visited,
                     int[] disc, int[] low, int[] time, List<List<Integer>> result) {
        visited[node] = true;
        disc[node] = low[node] = time[0]++;
        for (int nei : graph[node]) {
            if (nei == parent) {
                continue;
            }
            if (!visited[nei]) {
                dfs(nei, node, graph, visited, disc, low, time, result);
                low[node] = Math.min(low[node], low[nei]);
                if (low[nei] > disc[node]) {
                    result.add(Arrays.asList(node, nei));
                }
            } else {
                low[node] = Math.min(low[node], disc[nei]);
            }
        }
    }
}

