import java.util.PriorityQueue;
import java.util.Comparator;

public class Solution {
    public String kthLargestNumber(String[] nums, int k) {
        // Min-heap that keeps the k largest numbers seen so far
        PriorityQueue<String> minHeap = new PriorityQueue<>(k, new Comparator<String>() {
            @Override
            public int compare(String a, String b) {
                if (a.length() != b.length()) {
                    return Integer.compare(a.length(), b.length()); // shorter first
                }
                return a.compareTo(b); // lexicographic
            }
        });

        for (String num : nums) {
            minHeap.offer(num);
            if (minHeap.size() > k) {
                minHeap.poll(); // remove the smallest among the k+1
            }
        }

        // The root of the min-heap is the kth largest number
        return minHeap.peek();
    }
}

