public class Solution {
    public boolean canBeIncreasing(int[] nums) {
        int n = nums.length;
        if (n <= 2) return true;
        int violations = 0;
        for (int i = 1; i < n; i++) {
            if (nums[i] <= nums[i - 1]) {
                violations++;
                if (violations > 1) return false;
                // Check if removing nums[i] or nums[i-1] fixes the sequence
                if (i - 2 >= 0 && nums[i] <= nums[i - 2]) {
                    if (i + 1 < n && nums[i + 1] <= nums[i - 1]) {
                        return false;
                    }
                }
            }
        }
        return true;
    }
}

