import java.util.Arrays;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int numberOfUniqueGoodSubsequences(String binary) {
        int n = binary.length();
        long[] dp = new long[n + 1];
        dp[0] = 1; // empty subsequence
        int[] last = new int[2];
        Arrays.fill(last, -1);

        for (int i = 1; i <= n; i++) {
            char c = binary.charAt(i - 1);
            int idx = c - '0';
            dp[i] = (dp[i - 1] * 2) % MOD;
            if (last[idx] != -1) {
                dp[i] = (dp[i] - dp[last[idx]]) % MOD;
            }
            last[idx] = i - 1;
        }

        long totalDistinct = dp[n];
        int firstZeroPos = binary.indexOf('0');
        long invalidCount = 0;
        if (firstZeroPos != -1) {
            String suffix = binary.substring(firstZeroPos + 1);
            int m = suffix.length();
            if (m > 0) {
                long[] dpS = new long[m + 1];
                dpS[0] = 1;
                int[] lastS = new int[2];
                Arrays.fill(lastS, -1);
                for (int i = 1; i <= m; i++) {
                    char c = suffix.charAt(i - 1);
                    int idx = c - '0';
                    dpS[i] = (dpS[i - 1] * 2) % MOD;
                    if (lastS[idx] != -1) {
                        dpS[i] = (dpS[i] - dpS[lastS[idx]]) % MOD;
                    }
                    lastS[idx] = i - 1;
                }
                invalidCount = (dpS[m] - 1 + MOD) % MOD;
            }
        }

        long ans = (totalDistinct - 1 - invalidCount) % MOD;
        if (ans < 0) ans += MOD;
        return (int) ans;
    }
}

