public class Solution {
    public int[][] rotateGrid(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        int layers = Math.min(m, n) / 2;

        for (int layer = 0; layer < layers; layer++) {
            int top = layer;
            int left = layer;
            int bottom = m - 1 - layer;
            int right = n - 1 - layer;

            // Collect elements of the current layer
            List<Integer> elems = new ArrayList<>();

            // top row
            for (int j = left; j <= right; j++) {
                elems.add(grid[top][j]);
            }
            // right column
            for (int i = top + 1; i <= bottom - 1; i++) {
                elems.add(grid[i][right]);
            }
            // bottom row
            if (bottom != top) {
                for (int j = right; j >= left; j--) {
                    elems.add(grid[bottom][j]);
                }
            }
            // left column
            if (right != left) {
                for (int i = bottom - 1; i >= top + 1; i--) {
                    elems.add(grid[i][left]);
                }
            }

            int len = elems.size();
            int rot = k % len;
            if (rot != 0) {
                // Rotate counter-clockwise by rot positions
                List<Integer> rotated = new ArrayList<>(len);
                rotated.addAll(elems.subList(rot, len));
                rotated.addAll(elems.subList(0, rot));

                // Write back rotated elements
                int idx = 0;
                // top row
                for (int j = left; j <= right; j++) {
                    grid[top][j] = rotated.get(idx++);
                }
                // right column
                for (int i = top + 1; i <= bottom - 1; i++) {
                    grid[i][right] = rotated.get(idx++);
                }
                // bottom row
                if (bottom != top) {
                    for (int j = right; j >= left; j--) {
                        grid[bottom][j] = rotated.get(idx++);
                    }
                }
                // left column
                if (right != left) {
                    for (int i = bottom - 1; i >= top + 1; i--) {
                        grid[i][left] = rotated.get(idx++);
                    }
                }
            }
        }

        return grid;
    }
}

