import java.util.*;

public class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        int m = students.length;
        if (m == 0) return 0;
        int n = students[0].length;

        // Precompute compatibility scores
        int[][] compat = new int[m][m];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < m; j++) {
                int score = 0;
                for (int k = 0; k < n; k++) {
                    if (students[i][k] == mentors[j][k]) score++;
                }
                compat[i][j] = score;
            }
        }

        int totalMasks = 1 << m;
        int[] dp = new int[totalMasks];
        Arrays.fill(dp, -1);
        dp[0] = 0;

        for (int mask = 0; mask < totalMasks; mask++) {
            if (dp[mask] == -1) continue;
            int studentIdx = Integer.bitCount(mask);
            if (studentIdx >= m) continue;
            for (int mentor = 0; mentor < m; mentor++) {
                if ((mask & (1 << mentor)) == 0) {
                    int newMask = mask | (1 << mentor);
                    int newScore = dp[mask] + compat[studentIdx][mentor];
                    if (newScore > dp[newMask]) {
                        dp[newMask] = newScore;
                    }
                }
            }
        }

        return dp[totalMasks - 1];
    }
}

