public class Solution {
    public int[] longestObstacleCourseAtEachPosition(int[] obstacles) {
        int n = obstacles.length;
        int[] dp = new int[n + 1];
        Arrays.fill(dp, Integer.MAX_VALUE);
        int[] ans = new int[n];

        for (int i = 0; i < n; i++) {
            int h = obstacles[i];
            int l = 1, r = n;
            while (l <= r) {
                int mid = (l + r) >>> 1;
                if (dp[mid] <= h) {
                    l = mid + 1;
                } else {
                    r = mid - 1;
                }
