public class Solution {
    public int[] findPeakGrid(int[][] mat) {
        int m = mat.length;
        int n = mat[0].length;
        int left = 0, right = n - 1;
        while (left <= right) {
            int mid = left + (right - left) / 2;
            // Find the row index of the maximum element in column mid
            int maxRow = 0;
            for (int i = 1; i < m; i++) {
                if (mat[i][mid] > mat[maxRow][mid]) {
                    maxRow = i;
                }
            }
            int current = mat[maxRow][mid];
            int leftVal = (mid > 0) ? mat[maxRow][mid - 1] : -1;
            int rightVal = (mid < n - 1) ? mat[maxRow][mid + 1] : -1;
            if (leftVal > current) {
                right = mid - 1;
            } else if (rightVal > current) {
                left = mid + 1;
            } else {
                return new int[]{maxRow, mid};
            }
        }
        // Fallback (should not reach here for valid input)
        return new int[]{0, 0};
    }
}

